(4, 'PLANES LARGOS EFECTIVO', '<p><font color=\"#000000\"><b>Efectivo</b><br><u>Semestre: </u><br>- Cobro: En todos los casos cobramos directamente lo que dice la tabla. En el caso de ser abonado en 2 cuotas, cobramos la primera cuota al cliente y lo liberamos. <br>- Cargamos en su perfil el semestre efectivo <br>- Cargamos dos recargos (nombres \"cuota 1\" y \"cuota 2\") Cuyos montos corresponderán&nbsp;al 5% de recargo del semestre dividido en dos. Por ejemplo, si el semestre vale $50mil, el 5% es $2500 por lo que cada cuota sera de $1250.&nbsp;<br>- Cambiamos el pendiente dandole un mes de gracia<br><br><u>Anual<br></u></font><span style=\"color: rgb(0, 0, 0);\">- Cobro: En todos los casos cobramos directamente lo que dice la tabla. En el caso de ser abonado en 2 o 3 cuotas, cobramos la primera cuota al cliente y lo liberamos.</span><br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0);\">- Cargamos en su perfil el anual efectivo</span><br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; color: rgb(0, 0, 0);\"><font color=\"#000000\">- Cargamos dos o tres recargos dependiendo la cantidad de cuotas (nombres \"cuota 1\"&nbsp; \"cuota 2\" y cuota\") Cuyos montos corresponderán&nbsp;al 5% de recargo en dos cuotas o 10% en tres cuotas del anual dividido en dos o tres. Por ejemplo, si el anual vale $50mil y abona en dos cuotas el 5% es $2500 por lo que cada cuota sera de $1250. Si abona en 3 cuotas el 10% es $5000, por lo que al dividirlo en 3 cada cuota será&nbsp;de $1700 (redondeado)</font><br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; color: rgb(0, 0, 0);\"><font color=\"#000000\">- Cambiamos el pendiente dándole&nbsp;un mes de gracia a la 2da cuota, o 2 meses a la 3ra cuota.<br></font><font color=\"#000000\"><br>NOTA: Los planes largos no son acumulables con otras promociones<br>Los planes largos comprados en cuotas en efectivo, una vez transcurrido los 30 dias desde el ultimo pago, no pueden continuar asistiendo al gimnasio, a lo sumo se permite el primer dia y se solicita que lo lleve al otro dia.</font></p>', 1, 1, '2023-10-17 19:59:29', '2024-01-12 06:02:07'),
(6, 'PROMOCION REFERIDOS', '<p>Valido solo para planes mensuales.<br>En caso de referentes (no referidos) es la unica promocion acumulable con el resto de promociones.<br><br>La promoción se divide en REFERIDOS (el invitado) y REFERENTES (el que invita)<br>1_ Referidos: Todos tienen un 10% de descuento aplicado solo en su primer plan. Estos deben ser cargados en socio plus, apartado \"¿Como nos conocio?\" \"Socio referido\" \"Colocar DNI referente). <br><b>CODIGO</b>: Para cargarlo en sistema colocamos el CODIGO: REF (nombre del referente) y al darlo de alta al perfil completamos en ¿Como nos conocio? Ponemos \"Socio referido\" y el DNI del referente.<br><br>2_ Referentes: De acuerdo a la cantidad de referidos que lleve 10% para 1 referido - 25% para 2 referidos - 40% para 3 referidos - Plan pase libre gratuito para 4 referidos. Para ser cobrados, al entrar a su perfil observamos en \"Referidos\" los socios a los que mencione haber referido para confirmar su veracidad y luego aplicamos el descuento. <br>Luego de realizar el cobro en comentarios colocamos los nombres de los referidos ya utilizados (Esto permitirá identificar posteriormente que la promo ya fue utilizada y no volveremos a realizarle)<br>CODIGO: Al realizar el descuento utilizamos el CODIGO REF x (numero de referidos) (nombre de referidos).</p>', 6, 1, '2023-10-24 13:38:52', '2024-03-12 15:18:23'),
(7, 'PROMOCION INSTRUCTOR', '<p>Valida solo para planes mensuales <u>(ACTUALIZADO 29/2/2023)</u><br><b>Monteros: </b>$1000 off&nbsp;<br><b>Concepción:</b> $1000 off<br><br>Usamos el CODIGO INST Enzo Diaz (ejemplo)</p>', 5, 1, '2023-10-24 13:47:49', '2024-03-12 15:18:16'),
(8, 'PROMOCION FAMILIAR', '<p>- No acumulable con otras promociones, solo con Referente.<br>- Solo familiares directos, hijos, hermanos, esposos, no tíos ni primos.&nbsp;<br>- Solo se puede elegir un tipo de familiar: Es decir, en caso de una madre con su hermana y su hijo, solo puede elegir realizarlo con su hijo o con su hermana, el hijo no entraría con su tío.<br>- En caso de convenios, no tenemos promociones. Ahora si un integrante hace un convenio y el otro hace un plan de HAMMER hacemos el 10% solo a este, si son 3 y 2 hacen PLAN HAMMER hacemos 10% a estos 2 y asi seguimos sumando.<br>- En caso que sus familiares abonen un plan largo, se le hace un descuento de 10% off solamente. Pongo un ejemplo, si 2 familiares pagaron plan largo y el paga el mensual se le hace 10% off, si fueran dos los que pagan mensual 10% a cada uno, si fueran 3, ya se los toma como un grupo diferente y se le hace el 1/2 mes gratis entre esos tres.<br><br><b>- OPCIONES DE PAGO:</b> En caso de ser 2 en el grupo familiar, pueden abonar el mismo dia o dias separados. En el caso de ser 3 o mas integrantes, deben pagar el mismo día si es que desean ingresar a los descuentos de grupos amplios, en el caso que no lo hagan, solo accederan a un 10% de descuento siempre y cuando al menos uno de los demas integrantes este activo. Es necesario ser claro con los socios de esta norma, para evitar generar confictos en el futuro.<br><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-weight: bolder;\">- COMO VINCULAR EN SOCIO PLUS: </span><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Vamos a editar perfil de cliente, o bien cargar un nuevo perfil en caso de ser nuevo, en vez de \"SOCIO INDIVIDUAL\" seleccionamos Grupo familiar y damos a guardar. Este cliente seria la cabeza de la flia, vamos a su perfil y abajo a la izquierda encontraremos \"FAMILIARES\" damos click a \"agregar integrante\" y agregamos los demas integrantes. Se debe explicar a la familia que ese socio sera la cabeza de la familia por lo que si quieren acceder a promociones de familias amplias (3 o mas) deben abonar el dia que se le venza a el.</span><br><br>2 Integrantes: 10% off cada uno<br>3 Integrantes: medio mensual gratis al plan mas económico<br>4 Integrantes: un mensual gratis al plan mas económico<br>5 Integrantes: un mensual y medio gratis a los planes mas económicos.<br><br>En sistema colocamos FAM x (numero de integrantes) (nombre de todos los integrantes)<br><br></p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\"><font color=\"#000000\" style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\"><br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">NOTA: La promo familiar no es acumulable con otras promociones</font></p>', 4, 1, '2023-10-24 13:54:11', '2024-03-12 15:18:10'),
(9, 'CONGELAMIENTOS Y EXTENSION DE CONTRATOS - TRANSFERENCIAS DE CONTRATOS', '<p><b>¿Cuando congelar?</b><br>Solo se puede realizar por motivos de enfermedad, lesión o viajes en temporada de vacaciones.&nbsp;<br>Solo se puede realizar una vez por contrato, es decir si un semestre lo congelan por 10 días, luego no se puede volver a congelar<br>Planes mensuales: Desde 10 (7 en pilates) días mínimos hasta 30 días.<br>Planes semestrales: Desde 10 días mínimo hasta 45 días.<br>Planes anuales: Desde 10 días mínimo hasta 2 meses.<br></p><p><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-weight: bolder;\">¿Cuando extender?<br></span>Se modifica la fecha de finalización de contrato en aquellos casos que no se haya realizado el congelamiento por algún motivo, cuando se suspende alguna clase del gym (no feriados), y en todos aquellos casos que sean autorizados por dueños. Es obligación colocar en observaciones siempre el motivo. Este procedimiento casi no se realiza, no se recuperan días por que el cliente no asistió por algún motivo de enfermedad, lesión o viajes en temporada de vacaciones, e inclusive en estos casos el procedimiento correcto es realizar&nbsp; el congelamiento.<br><br><b>¿Se puede transferir un contrato?</b><br>Se puede realizar la transferencia dentro de los primeros 10 días de contrato (mensuales) 21 días en semestrales y 30 días en anuales. Siempre que sea a clientes nuevos, o a personas que no vengan hace 4 meses o mas.<br>De todas maneras cada situación es particular en estos casos por lo que es necesario consultar previamente.</p>', 10, 1, '2023-10-31 15:10:53', '2024-03-12 15:21:05'),
(10, 'CONVENIOS', '<p class=\"MsoNormal\"><b><u>GYM PASS.(ACTIVO)<o:p></o:p></u></b></p><p class=\"MsoNormal\">Método principal: El cliente debe ingresar a su app de GYMPASS y desde allí puede dar acceso, una vez da acceso se crea automáticamente en socio plus un perfil con sus datos, en donde su dni corresponde a su numero de usuario de GYMPASS. Luego el cliente de debe colocar su GYMPASS ID en molinete y se dará acceso. Lo que podemos hacer a futuro es en su perfil editarlo una vez creado y cambiar su numero de DNI pero nunca cambiar su numero de GYMPASS ID. En el caso que ya sea un cliente que asistia no debe hacer este proceso por que se creara un perfil duplicado, lo que debemos hacer es entrar a su perfil editarlo y abajo en la esquina inferior derecha dice \"GYMPASS ID\" Le pedimos que nos brinde su gympass id que se encuentra en su aplicacion de gympass y lo agregamos. El cliente manda la solicitud desde su APP y coloca su gympass id en molinete, no debemos hacer nada mas.<br>Metodo alternativo: En caso de no funcionar lo antes mencionado, el socio debe dar acceso desde la APP de Gympass y luego entramos a las siguientes paginas para darle validez, una vez realizado debemos cargar una clase GYMPASS y hacemos el egreso como transferencia BNA.<br><a href=\"https://partners.gympass.com/validation/hammer-fitness-gym-sede-concepcion\"><span style=\"color:windowtext\">https://partners.gympass.com/validation/hammer-fitness-gym-sede-concepcion</span></a><o:p></o:p></p><p class=\"MsoNormal\">https://partners.gympass.com/validation/hammer-fitness-gym-sede-monteros<o:p></o:p></p><p class=\"MsoNormal\">AHI SE LO ACEPTA.<o:p></o:p></p><p class=\"MsoNormal\"><b style=\"font-size: 1rem;\"><u>ARCOR.(CORROBORAR\r\nACTIVO)<br></u></b>LISTA: ARCOR ENVIAR A NUESTRO CORREO TODOS LOS MESES LA LISTA DE EMPLEADOS QUE TENDRAN EL CONVENIO</p><p class=\"MsoNormal\">INGRESO DE COMPROBANTES: SE HACE EN MONTEROS<o:p></o:p></p><p class=\"MsoNormal\">ADMISION DE SOCIOS: MARCELO INFORMARA TODOS LOS MESES EN\r\nGRUPO RECEPCION QUIENES SON LOS SOCIOS A INSCRIBIR Y LES INFORMARA COMO COBRAR\r\nY EGRESAR DE CAJA (TRANSEFERENCIA BANCARIA).<o:p></o:p></p><p class=\"MsoNormal\"><b style=\"font-size: 1rem;\"><u>CITROMAX.</u></b><br></p><p class=\"MsoNormal\">NO ABONAN. DIRECTAMENTE SE CARGA EL CONTRATO, SE EGRESA COMO\r\nTRANSFERENCIA BNA Y SE NOTIFICA A DUEÑOS.<b><u><o:p></o:p></u></b></p><p class=\"MsoNormal\"><b><u>JUDICIALES - GEMIO UEJN Y CENTRO JUDICIAL<br>\r\n</u></b>DEBE LLEVAR LA BOLETA DE SUELDO Y QUE FIGURE ALLI DESCUENTO UEJN, SOLO\r\nA ESTE GREMIO SE LE HACE EL DESCUENTO.<b><u><o:p></o:p></u></b></p><p class=\"MsoNormal\"><b><u>SIPROSA (ACTIVO)<o:p></o:p></u></b></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:ES;mso-fareast-language:EN-US;\r\nmso-bidi-language:AR-SA\"><span style=\"font-family: &quot;Messina Regular&quot;; font-size: 1rem;\">BOL. Descuento del 10% off en cualquiera de sus planes. Con boleta de sueldo</span></span></p><p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:ES;mso-fareast-language:EN-US;\r\nmso-bidi-language:AR-SA\"><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; 