amily:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:ES;mso-fareast-language:EN-US;\r\nmso-bidi-language:AR-SA\"><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-family: &quot;Messina Regular&quot;; font-size: 16px;\"><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">10% OFF, DEBE LLEVAR SU CREDENCIAL DE QUE PERTENECE.<br></span></span></span></p><p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:ES;mso-fareast-language:EN-US;\r\nmso-bidi-language:AR-SA\"><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-family: &quot;Messina Regular&quot;; font-size: 16px;\"><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\"><b><u>CONVENIO AFIP 15%</u></b></span></span></span></p><p>El gremio envia una planilla de integrantes que les pasaremos nosotros, los integrantes de la lista irian al gimnasio y ustedes corrobarian que esten presentes en la misma, en el caso de ser asi le explican que ya se comunicara nuestro coordinador de convenios ya que el turno mañana es el encargado de la facturacion, le dejan avisado al turno mañana el nombre y dni del cliente, este se comunica en la mañana con el mismo y le pide la transferencia, ya que los convenios afip solo se recibe transferencia. ES IMPORTANTE QUE NO RECIBAN EFECTIVO. Turno mañana recibe la transferencia, solicita el comprobante, le factura y le envia la factura, de ahi se carga todo normal. Siempre los hacen pasar y luego avisan para que el turno de la mañana los haga pasar. Si no saben que hacer se comunican con dueños.<br><br>El pago solo se realiza de esta manera, en el caso que no esten en la lista deben ir al gimnasio con la credencial de afip, tampoco reciben&nbsp;<br></p><p>VALIDO PARA:&nbsp; Los afiliados y/o hasta 2 familiares del afiliado a AEFIP (Gremio de Afip) enviarán el comprobante de pago vía whatsapp a HAMMER, se debe chequear el listado de altas o credencial si no esta en la misma. (Siempre dejenlos pasar, le cargan el mes y pasan, luego nos notifican y vemos como hacemos)</p><p><br></p><p>EL CBU A ENTREGAR SIEMPRE ES EL DE MARCELO SEDE CONCEPCION CHOCHO SEDE MONTEROS.</p><p><br><br></p><p><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:ES;mso-fareast-language:EN-US;\r\nmso-bidi-language:AR-SA\"><br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--></span></p>', 8, 1, '2023-11-01 12:15:10', '2024-03-07 13:52:52'),
(11, 'VENTAS', '<p><font color=\"#000000\">Protocolo de ventas en visitas o consultas espontaneas<br></font><font color=\"#000000\">1_ Presentación (1ra impresión):<br></font><font color=\"#000000\">&nbsp;<br></font><font color=\"#000000\">REDES:<br></font><font color=\"#000000\">Ej. Hola… (Tratar de ver nombre en su perfil si no obviarlo) Como estas?, soy Adrián. Déjame consultarte, estas interesad@ en Sede Monteros o Concepción? Sería la primera vez que vendrías a hammer o ya viniste en algún momento?<br></font><font color=\"#000000\">&nbsp;<br></font><font color=\"#000000\">-Etiquetamos y continúa la sede y persona encargada -<br></font><font color=\"#000000\">&nbsp;<br></font><font color=\"#000000\">&nbsp;</font><font color=\"#000000\"><br></font><font color=\"#000000\">3_ DIAGNOSTICO:&nbsp;<br></font><font color=\"#000000\">&nbsp;</font></p><p><font color=\"#000000\">&nbsp;</font><span style=\"color: rgb(0, 0, 0);\">“En hammer contamos con diferentes actividades individuales y grupales todas orientadas por un profe ¿Tenes pensada alguna en particular o te gustaría decirme tu objetivo para que juntos elijamos la más adecuada para vos?”</span><font color=\"#000000\"><br></font><font color=\"#000000\"><br></font><font color=\"#000000\">&nbsp;<br></font><font color=\"#000000\">3_ TRATAMIENTO: Presentación de Actividad/es (VER MODULO ACTIVIDAD PARA SABER COMO ENVIAR)<br></font><font color=\"#000000\"><br></font><font color=\"#000000\"><br></font><font color=\"#000000\">4_ Pregunta de compromiso<br></font><font color=\"#000000\">. Me gustaría invitarte a realizar una clase de prueba para que conozcas nuestro servicio, al profe y al grupo ¿Qué te parece venir hoy? (condicionamos el día para evitar que decida por su cuenta)<br></font><font color=\"#000000\"><br>NOTA: Clase de prueba de la actividad orientada a ese objetivo, En redes sociales es obligacion ofrecer la clase de prueba, ya que nuestro objetivo es cargarlo al prospecto en sistema y que nos visite, en mostrador la ofrecemos cuando no vaya a pagar en ese mismo dia, por lo que no debemos acelerarnos a ofrecerla.<br></font><font color=\"#000000\">Otras preguntas:<br></font><font color=\"#000000\">. ¿Te gustaría comenzar hoy?<br></font><font color=\"#000000\">. ¿Cuándo tenes pensado comenzar?</font><font color=\"#000000\"><br></font><font color=\"#000000\"><br></font><font color=\"#000000\">&nbsp;<br></font><font color=\"#000000\">&nbsp;5_ _ Cierre de venta o prospección<br></font><font color=\"#000000\">Pedir datos para cargar el perfil.<br></font><font color=\"#000000\">&nbsp;<br><br>6_ En caso que nos pidan por 2da vez los precios, presentamos los precios ¿Como hacerlo?<br>Te comento que el precio del mensual es ( ), pero ademas contas con la posibilidad de abonarlo de forma semestral, en donde te regalamos 1 mes gratis y la posibilidad de abonar de forma anual donde te regalamos 3 meses. Tambien podes hacerlo en cuotas tanto en efectivo como en tarjeta, si necesitas mas info sobre esto avisame y te asesoro mejor :)<br></font><font color=\"#000000\"><br></font><font color=\"#000000\">&nbsp;PROTOCOLO DE VENTAS.<br></font><font color=\"#000000\">Reglas: (las mismas aplican a todas las conversaciones)<br></font><font color=\"#000000\">1_ ATENCION EMPATICA, DINAMICA Y DIVERTIDA: En redes sociales, utilizar emotij para mostrar simpatía, en mostrador SONREIRJ.<br></font><font color=\"#000000\">2_ LOS PUNTOS CORTAN LA CONVERSACION: En redes sociales nunca terminar una conversación con un punto “.” Las conversaciones siempre deben terminar con una pregunta. Por ejemplo ¿Cuándo comenzas? ¿Cuándo volves? ¿Queres probar una clase? El objetivo siempre es buscar una agenda.<br></font><font color=\"#000000\">3_ EL CLIENTE NO TERMINA LA CONVERSACION: Siempre la conversación debe ser terminada por nosotros, nunca el cliente será el último en enviar el mensaje.<br></font><font color=\"#000000\">4_ PUESTA EN VALOR: No enviar precios sin antes intentar ponernos en valor, explicando nuestro servicio y como solucionara su problema (objetivo) sobre todo si son prospectos, en caso de clientes y ex clientes que no necesiten tanto asesoramiento porque ya conocen nuestro servicio. Por regla pasaremos el precio si nos consulta por segunda vez.<br></font><font color=\"#000000\">5_ AGENDAMIENTO: El objetivo de todas las consultas es realizar una agenda, para la misma necesitamos sus datos y cargar su perfil, lo que podremos obtener ofreciendo clases de prueba, descuentos en caso de estar habilitados, o bien en mostrador con la excusa de darles un papel con nuestra info solicitamos sus datos. Esta agenda puede ser una clase de prueba pactada o un día de inscripción pactado (ideales) para cargar la visita, o bien que nos diga cuando tiene pensado comenzar para poder realizar solamente una agenda y no perder el hilo de la conversación. (Todos los prospectos son recuperables siempre y cuando sean cargados en Socio Plus, aquellos que no pidamos datos y no carguemos tarde o temprano los perderemos)<br></font><font color=\"#000000\">6_ EMOCION: No debemos ofrecer una clase de prueba sin previamente generar emoción y motivación, lo que logamos ofreciendo una solución a su problema (detectado en el diagnostico) si no lo hacemos dependeremos completamente de la emoción que tenga el prospecto por su propia cuenta, no será reforzada por nosotros. Por ejemplo, si la persona nos indica que está en sobrepeso, generamos emoción asegurándole acompañamiento y que al trabajar con nosotros y su instructor&nbsp; podrá bajar de peso, aumentar masa muscular tonificando su cuerpo y aumentando su metabolismo, recién luego de esto podemos ofrecer una clase de prueba. Para poder ofrecer una actividad acorde a su problema es necesario realizar un buen diagnóstico, convirtiéndose en un paso fundamental del protocolo (ver abajo).<br></font><font color=\"#000000\">8_ COMPROMISO: Reforzamos la emoción y motivación con compromiso, esto lo logramos cuando pactamos un día y un horario, por ejemplo una clase de prueba, y se refuerza aún más cuando lo hacemos con un tercero (instructor o profesor). “A las personas no nos gusta asumir un compromiso y fallarnos a nosotros mismos, pero menos aún nos gusta fallarle a otra persona”<br></font><font color=\"#000000\">7_ VÍNCULO, CONEXIÓN: Durante la conversación debemos generar un vínculo, para esto:<br></font><font color=\"#000000\">. El cliente debe confiar en nosotros y ganarnos la confianza detrás de una pantalla no es fácil, debemos lograr que el cliente sienta que nos interesa su objetivo, y que estamos tomándonos nuestro tiempo para preguntar, conocerlo y poder ofrecerle la mejor actividad para él, así no sienta que solo nos interesa vender.<br></font><font color=\"#000000\">. Es fundamental el tiempo de respuesta, si nos demoramos en responder o la charla se vuelve poco dinámica se pierde la emoción del momento.<br></font><font color=\"#000000\">. Es fundamental mantener el hilo de la conversación, si repreguntamos cosas ya respondidas, si no ofrecemos la solución vinculada a su necesidad u objetivo, etc perdemos credibilidad y confianza.</font></p>', 11, 1, '2023-11-01 12:25:35', '2024-03-12 15:21:27');
