cale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; color: rgb(0, 0, 0); font-family: Helvetica;\">- En posnet marcar CODIGO 11.<br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\"></span>Explcacion: Tarjeta naranja comun no tiene 3, 6, 12 cuotas, directamente vende el plan Z (que por defecto son 3 cuotas), nosotros le vendemos el plan Z, no X cuotas. Si la persona luego prefiere en 6 cuotas luego debe arreglar su financiamiento con la tarjeta, no con nosotros. Recuerden, nosotros no vendemos cuotas, vendemos el PLAN Z que por defecto es en 3 cuotas al menos que ellos lo cambien.<br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; color: rgb(0, 0, 0);\"><br></p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\"><font color=\"#000000\" style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">NOTA: Los planes largos no son acumulables con otras promociones. Ver preguntas frecuentes \"Promo Familiar\" para saber como es en caso de familias.</font></p><div><font color=\"#000000\" style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\"><br></font></div>', 2, 1, '2023-11-09 15:28:16', '2024-03-12 15:17:35'),
(13, 'CABINA SOLAR', '<ol><li>- DURACION: CONCEPCION 8 minutos a 12 minutos. MONTEROS 12<span style=\"font-size: 1rem;\">minutos.&nbsp;<br>-VENCIMIENTO: Cada sesion tiene una duracion de 2 semanas, si es un pack de 3 sesiones duraria 1 mes y medio.</span></li><li>- CANCELACION: de turnos con 2 horas de anticipacion<br>- COMPARTIR PACKS: No se puede compartir los packs, solo de 10 sesiones y maximo dos personas.</li><li>-TRANSFERENCIA: Solo una vez en paquetes.</li><li>- TURNOS: son dados cada 30 minutos<br>- CANTIDAD: No se puede realizar dos sesiones el mismo dia, lo ideal es realizar sesiones con 1 dia de descanso por medio sobre todo en las primeras sesiones<br>- SOBRES:<br>Cobrizzo: Permite tomar un color a mayor velocidad, se utiliza en las 3 primeras sesiones.<br>Exprezzo: Permite homogenizar (asentar) el color, se utiliza desde la 4ta sesion.<br>-PROTECTORES SOLARES: Se utiliza solo cuando tienen piel sensible y/o por recomendacion de un dermatologo, no es recomendable usarlo por que inhibe los efectos del bronceado, la cabina solar trabaja filtrando los rayor UV (No utiliza rayos dañinos)&nbsp;<br>- PROCESO: Se debe entregar las fichas y la cajita con una tohalla limpia, desodorante, desmaquillante (cuando lo piden), algodon, y antifaces.<br>- En caso de abonar un plan del gimnasio no lo dejara pasar ya que le querra consumir un pase de cabina (y esta con reservas), por lo que hay que vencer el contrato de la cabina y cuando quiera hacer cabina solar le debemos activar y sacar el turno para que coloque el DNI.</li></ol>', 13, 1, '2023-11-16 00:43:27', '2024-03-12 15:22:08'),
(14, 'ACTIVIDADES', '<p class=\"MsoNormal\"><b><u>SERVICIOS\r\nACTIVIDADES.<o:p></o:p></u></b></p><p class=\"MsoNormal\"><i>Las actividades están\r\nexplicadas de manera técnica, por supuesto que para vender debemos adaptarlo y\r\nbajarlo a un vocabulario más cotidiano.<o:p></o:p></i></p><p class=\"MsoNormal\"><u>MUSCULACION</u></p><p class=\"MsoNormal\">Te comento como vamos a trabajar en musculacion! Vas a entrenar junto con nuestros instructores quienes van a\r\norientarte y guiarte en tu rutina con ejercicios de fuerza para aumentar masa\r\nmuscular y combinarlo con ejercicios cardiovasculares para bajar grasa corporal\r\ny de esta manera iremos tonificando al mismo tiempo! Nuestros horarios son .... y nuestros salones estan equipados con aires acondicionados&nbsp;<span style=\"font-family:\r\nWingdings;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-char-type:\r\nsymbol;mso-symbol-font-family:Wingdings\">J</span>. &nbsp;<br>\r\nMe gustaría invitarte a que vengas a realizar una clase de prueba asi conoces\r\nal profe, al gim y de paso luego de la clase conversamos sobre los planes, te gustaria venir hoy (mañana)? <span style=\"font-family:Wingdings;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-char-type:symbol;mso-symbol-font-family:Wingdings\">J</span><o:p></o:p></p><p class=\"MsoNormal\">¿Cuándo ofrecer?<o:p></o:p></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]-->1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Cuando el principal objetivo sea aumentar de\r\nmasa muscular<o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]-->2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Cuando no le gusten realizar otros tipos de\r\nactividades<o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]-->3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->En personas nuevas, sobre todo de alta edad en\r\nla que ya no podemos ofrecer funcional (si son más jóvenes seguramente tendrá\r\nmejor adaptación funcional para bajar de peso) que nunca realizaron actividad\r\nfísica porque podemos trabajar a baja intensidad. (Acompañados por instructor)<o:p></o:p></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]-->4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->En personas obesas, sobrepeso que no pueden\r\nrealizar otras actividades.<o:p></o:p></p><p class=\"MsoNormal\">¿Cuándo no ofrecer?<o:p></o:p></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l7 level1 lfo2\"><!--[if !supportLists]-->1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Personas que hayan realizado la actividad en el\r\npasado y no se hayan adaptado<o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l7 level1 lfo2\"><!--[if !supportLists]-->2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Personas que quieran compartir&nbsp; en grupo, hacer amigos, divertirse y crear\r\nvínculos<o:p></o:p></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-18.0pt;mso-list:l7 level1 lfo2\"><!--[if !supportLists]-->3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Personas que hayan realizado una clase de prueba\r\ny no se hayan sentido cómodas<o:p></o:p></p><p class=\"MsoNormal\"><u><o:p>&nbsp;</o:p></u></p><p class=\"MsoNormal\"><u>CARDIO<o:p></o:p></u></p><p class=\"MsoNormal\"><span style=\"font-size: 1rem;\">Te\r\ncomento que con nuestros equipos y nuestros instructores vas a poder trabajar ejercicios\r\ncardiovasculares que te van a permitir quemar muchas calorías, tonificar la\r\nmusculatura y mejorar la resistencia cardiovascular. Además el plan te habilita\r\npara todo el sector de musculación. Siempre recomiendo que combinen con esta\r\nactividad para aumentar masa muscular al mismo tiempo que bajamos de peso, eso\r\ntonificara mucho más tu cuerpo y además aumentara tu metabolismo, esto te va a permitir quemas mas calorias durante el resto del dia por mas que no estes entrenando!</span><span style=\"font-size: 1rem; font-family: Wingdings;\">J</span><span style=\"font-size: 1rem;\">. No te preocupes, que\r\nno te de miedo venir a musculación, tenemos profes y equipos con los que vas a\r\npoder trabajar desde el nivel 0, no hace falta tener ningún conocimiento de técnica\r\nni nada por el estilo! </span><span style=\"font-size: 1rem; font-family: Wingdings;\">J</span><br></p><p class=\"MsoNormal\">\r\nDe todas maneras me gustaría ofrecerte una&nbsp;\r\nclase de prueba para que vengas a conocer al profe, al gym y luego\r\ncharlamos sobre los planes, te gustaria venir hoy (mañana)?<br>\r\n<br><u style=\"font-size: 1rem;\">FUNCIONAL</u><br></p><p class=\"MsoNormal\"><span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 1rem; color: rgb(32, 33, 36);\">En funcional vas a trabajar de\r\nmanera grupal! Son clases de 1 hs, guiadas por un profe en el cual se realizan\r\nejercicios que te van a permitirán bajar de peso por el gasto calórico, es\r\ndecir el principal trabajo es cardiovascular, y también se realizan algunos\r\nejercicios de fuerza con carga corporal o carga externa liviana para tonificar\r\nlos músculos y hacer un trabajo mucho más completo. Lo bueno de estas clases es\r\nque son muy divertidas </span><span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 1rem; font-family: Wingdings; color: rgb(32, 33, 36);\">J</span><br></p><p class=\"MsoNormal\">Me gustaría ofrecerte una&nbsp; clase\r\nde prueba para que vengas a conocer al profe, al gym y luego charlamos sobre\r\nlos planes, que te parece venir hoy (mañana)?&nbsp;<br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><u style=\"font-size: 1rem;\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">CROSSFIT</span></u><br></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); font-size: 1rem;\">De una manera muy similar a\r\nfuncional, solo remarcando que se trabajan algunos ejercicios de levantamiento\r\ny fuerza.</span><br></p><p class=\"MsoNormal\"><u style=\"font-size: 1rem;\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">PILATES Y YOGA</span></u><br></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); font-size: 1rem;\">Es una actividad realizada con\r\ngrupos muy reducidos y con un gran seguimiento por parte del profesor, en la\r\ncual se trabaja principalmente en el control del cuerpo mediante ejercicios de\r\nfuerza, resistencia, movilidad, flexibilidad. Permite&nbsp; fortalecer sobre todo el core (abdomen,\r\nglúteos, lumbares), pero trabaja de forma integral todo el cuerpo. Es muy\r\nimportante para mejorar la postura.</span><br></p><p class=\"MsoNormal\"><br></p>', 9, 1, '2023-11-28 23:20:55', '2024-03-12 15:20:56'),
(15, 'PROSPECTOS Y VISITAS', 'Un prospecto es aquella persona que no abono aun el plan, pero esta interesado en el gimnasio, podemos obtener sus datos en mostrador (Ningun prospecto que entre a consultar debe irse sin ser cargado en sistema), o por redes sociales.<br><br>Sobre este \"PROSPECTO\" podemos cargar una visita, que puede ser:<br><b>1_ CLASE DE PRUEBA:</b>&nbsp;Debemos seleccionar la fecha en la que se coordino la clase, sacar turno, y realizar una agenda \"Recordatorio clase de prueba dia anterior\" la que nos permitirá recordarnos al día siguiente de la clase de entrar a su perfil, corroborar si:<br>A_ ASISTIO: En caso de haberlo hecho enviarle un mensaje preguntándole como la pase y tratar de agendar una clase de \"VIENE A ABONAR\" con su respectivo turno<br>B_ NO ASISTIO: En caso de no haber asistido se envía un mensaje tratando de reprogramar la clase<br>C_ ASISTIO Y SE CONVIRTIO EN CLIENTE: No se envía nada.<br><b>2_ VIENE A ABONAR:</b> Esta visita se carga en aquellos clientes que directamente se programa para que vengan a abonar su contrato, no a realizar una clase de prueba, puede ser directo o bien puede ser despues de realizar una clase de prueba ya sea en mostrador (despues de la clase nos dicen que vendran x dia a comenzar), o bien cuando enviamos el mensaje de agenda de dia despues. Debemos seleccionar la fecha en la que se comprometió en venir, sacar turno y realizar una agenda \"Recordatorio abonaba dia anterior\" la que nos permitirá recordarnos al día siguiente de la clase de entrar a su perfil, corroborar si:<br>A_ ASISTIO: En caso de haberlo hecho enviarle un mensaje preguntándole como la pase y tratar de agendar una clase de \"VIENE A ABONAR\" con su respectivo turno<br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">B_ NO ASISTIO: En caso de no haber asistido se envía un mensaje tratando de reprogramar la clase<br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">C_ ASISTIO Y SE CONVIRTIO EN CLIENTE: No se envía nada.<br><br><br>NOTA: Siempre son 3 pasos, cargar clase, sacar tuno, cargar agenda día después.&nbsp;', 12, 1, '2023-12-05 13:06:04', '2024-03-12 15:21:52'),
(18, 'PROMO BNA', '<p><b><u>PROMO PAGAS 3 Y TE DAMOS 4 MESES</u></b></p><p>Solo valido para APP BNA+ \"MODO\" con tarjetas de crédito (Es decir debe pagar con la aplicación, no con tarjeta de crédito física)<br>Solo valido los jueves de febrero<br>Se paga en 3 o en 6 cuotas sin interés - Siempre usar código 3 o 6 en este caso (No confundir con 13 y 16 del ahora 12)<br>Se le regala le regala el banco luego cuando le llega el resumen de su tarjeta, nosotros cobramos normal los 4 meses)<br><br><u>¿COMO COBRAR?</u><br>1_ Se ingresa a \"ventas\" y se genera un código QR en 3 o 6 cuotas. <br>2_ <b>No se cobra en un solo monto</b>, se cobra en montos máximos de 12000 y se hace tantos cobros hasta alcanzar el monto total.<br><br><b>SEDE MONTEROS:</b>&nbsp;<span style=\"font-size: 1rem;\">Monto total a cobrar: $56000. Como podemos solo hacer cobros de 12000 tenemos que hacer 4 cobros de 12 mil (48000) + un cobro de $8000 (</span>ahí<span style=\"font-size: 1rem;\">&nbsp;</span>estarían<span style=\"font-size: 1rem;\">&nbsp;en total los $56000).</span></p><p><br><b>SEDE CONCEPCION:</b> Monto total a cobrar: $66000 en 5 cobros de 12mil + 1 cobro de $6000.&nbsp;<br><u><br>¿COMO EXPLICAR?</u><br>Le explican a la gente que la devolución le hace el banco en el resumen de la tarjeta y que por cada cobro que le hicimos se le reintegran 3 mil pesos, es decir en total el mes completo gratis.&nbsp;<br><u><br>¿Cómo&nbsp;hacer las transferencias y los congelamientos?</u><br>Como un mensual, sus mismas reglas</p>', 7, 1, '2024-02-02 16:33:35', '2024-03-12 15:18:48'),
(19, 'VOUCHERS DE REGALO', '<p><u>¿COMO PROCEDER?</u><br><br>En caso que una persona desee realizarle un regalo a otra, vamos a entregarle un voucher con el nombre (de quien recibe el regalo obviamente).<br><br><u>¿Cómo&nbsp;ingreso el dinero?</u><br><br>Ingresan al perfil \"GIFT CARD\" , ingresan con la opcion \"devengar\", marcan \"PLANES\", seleccionan el plan y cobrán el monto, en observaciones del cobro marcan el nombre de la persona a la que le regalaron.<br><br><u>¿Cómo&nbsp;hago el canje?</u><br><br>La persona ira a canjear su regalo, es decir ira con la tarjeta, en ese momento ingresan al perfil \"GIFT CARD\", controlan que este el cobro realizado y lo dan de alta o le cargan el plan en su perfil.<br>Egresar el monto que ingreso (que obviamente pagaron otro dia) Scomo \"planes\" \"gift card\" \"gift card\".</p>', 15, 1, '2024-02-10 19:04:14', '2024-03-12 15:24:42');
