(21, 'SOBRANTES Y FALTANTES', '<p>Faltante: Es necesario reponer con el salario del dia, o de los dias que correspondan, no se debe hacer correcion de caja. En caso de tener un faltante, obviamente correspondiente a que hay menos plata en caja de lo que el sistema marca, puede corresponder a:<br>1_ Realizamos mal la apertura de caja o el cierre de caja<br>2_ Contamos mal la plata<br>3_ Realizamos mal el sobre<br>4_ Se entrego mal un vuelto o se perdio plata<br>5_ Se cobro una deuda a alguien que no abono (controlar en planilla)<br>6_ Falto realizar el egreso de un comprobante electronico (controlar en planilla)<br>7_ Stock: vendimos un producto que no correspondia o cobramos un producto que habian fiado (controlar el stock para ver si coincide y en caso de ser asi, controlar en planilla que no se haya cobrado a alguien que fio)<br>8_ Pagaron un sueldo, o un egreso de caja sin hacer el movimiento<br><br>SOBRANTE: Se hace correccion de caja y se cierra en 0<br>1_ Stock de productos: Error mas frecuente, vendieron un producto y no lo cargaron en sistema<br>2_ Falto cargarle y/o cobrarle un mensual a un cliente por lo que le quedo la deuda: Por lo general en los siguientes dias ira, saltara la deuda y compensamos.<br><br><br>STOCK DE PRODUCTOS:<br>Si les faltan productos controlar que no sobre plata en caja, se compensaria ahi. Si sigue faltando por que perdieron algo, se cargan en su perfil y entregan en 0. Si sobran productos controlar planilla de caja que no hayan vendido mal algo y les falte plata y si no me avisan para ver a quien le cargaron una deuda de producto que no le corresponde.&nbsp;</p>', 16, 1, '2024-02-21 18:09:53', '2024-03-12 15:25:49'),
(22, 'CONTROL DE ACCESO', '<p>El molinete puede indicar:<br>HABILITADO: Pasa correctamente el socio<br>INHABILITADO \"FALTA DE PASES\": Corresponde a que el socio consumio el total de pases, ya sea por que esta yendo mas de lo permitido diariamente, o por un error en sistema donde se cargan las reservas y no los pases, en este caso vamos a venc de contratos y agregamos pases (la misma cantidad que reservas) y notificamos el error.<br>INHABILITADO \"DEUDA\": En este caso el cliente se debe dirigir al molinete, se recuerda y se hace pasar manualmente con la promesa de saldar su deuda al otro dia.</p>', 14, 1, '2024-03-05 12:51:21', '2024-03-05 12:51:21'),
(23, 'AGENDAMIENTOS Y SEGUIMIENTO DE CLIENTES', '<p class=\"MsoNormal\"><u>AGENDAMIENTOS<br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--><o:p></o:p></u></p><p class=\"MsoNormal\">El objetivo de toda interacciones ya sea en mostrador o por\r\nredes siempre sera conseguir una agenda.<br>\r\n<u><br>\r\nOBJETIVOS</u><br>\r\nCLIENTE NUEVO: Debemos lograr agendar una clase de prueba para que el cliente\r\npruebe nuestro servicio y luego poder convencerlo. Nuestra desventaja es el\r\nprecio por lo que es un error pasar precios sin intentar que pruebe el servicio\r\npreviamente.<o:p></o:p></p><p class=\"MsoNormal\">Ex CLIENTE: Debemos lograr agendar una fecha en el cual el\r\ncliente renovara.<o:p></o:p></p><p class=\"MsoNormal\">SOCIOS: Debemos realizar agendas para hacer seguimientos y mejorar\r\nsu experiencia fomentando los vínculos emocionales. Por ejemplo en caso de\r\nvacaciones, enfermedades, estudios, etc. Enviamos mensajes para desear éxitos,\r\npara consultar como va con su evolución, etc.<br>\r\n<br>\r\n¿Cómo SE REALIZA?<o:p></o:p></p><p class=\"MsoNormal\">CLASES DE PRUEBA: La clase de prueba (semana de prueba,\r\nquincena de prueba) se puede realizar tanto para perfiles “prospectos” o para\r\nperfiles “socios individuales”. <o:p></o:p></p><p class=\"MsoNormal\">-En el caso de prospectos directamente podremos cargar la\r\nclase de prueba, luego debemos sacar el turno para el día y fecha pactada y\r\nfinalmente cargamos una agenda “PROSPECTO” “WHATSAPP” “RECORDATORIO CLASE DE\r\nPRUEBA DÍA ANTERIOR” (Esta ultima permitirá al día siguiente actuar como un\r\nrecordatorio para ingresar al perfil del prospecto y revisar si se convirtió o\r\nno, en el caso que no lo haya hecho, debemos analizar si asistió o no, en el\r\ncaso de no asistir enviamos un mensaje para reprogramar, en el caso de asistir\r\nconsultamos como le parecio el servicio e intentamos conseguir una clase “VIENE\r\nA ABONAR”<br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--><o:p></o:p></p><p class=\"MsoNormal\">- En el caso de clientes o ex clientes quienes figuran en\r\nsocio plus como “socio indidividual”, como no tenemos la opción de cargar una\r\nclase de prueba directamente cargamos una agenda “SOCIO” o “Ex CLIENTE”\r\n“WHATSAPP” “CLASE DE PRUEBA PROGRAMADA” en observaciones aclaramos la fecha y\r\nhorario y luego cargamos la agenda para el día siguiente “SOCIO” o “EX\r\nCLIENTE”&nbsp; “WHATSAPP” “RECORDATORIO CLASE\r\nDE PRUEBA DÍA ANTERIOR”.<o:p></o:p></p><p class=\"MsoNormal\">CLASES VIENE A ABONAR: También puede ser cargado tanto para\r\nprospectos como par ex clientes, en este caso directamente se logro una agenda\r\ndonde el cliente asistirá para abonar, no para acceder a una clase de prueba.\r\nEn el caso de prospectos cargamos directamente la clase “VIENE A ABONAR”\r\nsacamos turno y luego cargamos la agenda “PROSPECTOS” “WHATSAPP” “RECORDATORIO\r\nABONABA DÍA ANTERIOR” para el día siguiente. En el caso de socios o ex socios\r\nque quieren renovar se carga directamente una agenda ya que no podemos cargar\r\nla clase viene a abonar. La agenda es “EX CLIENTE” “WHATSAPP” “INACTIVO PARA\r\nRENOVAR” y en observaciones colocamos el horario en el que dijo asistir, luego\r\ncargamos la agenda para el día siguiente “RECORDATORIO ABONABA DÍA ANTERIOR”.<o:p></o:p></p><p class=\"MsoNormal\">¡AQUÍ NO TERMINA EL PROCEDIMIENTO!<br>\r\nLas agendas obviamente se cargar para contactarnos nuevamente en el futuro,\r\ncuando cargamos agendas de clases de prueba, agendas para venir a abonar\r\ndirectamente, debemos entrar al perfil del mismo, copiar su numero de teléfono\r\ny enviarles un mensaje recordándole que lo esperamos ese día. Las agendas &nbsp;que se hicieron para clase de prueba el día\r\nanterior o tenían que abonar el día anterior, debemos entrar al perfil de\r\ncliente y revisar si fue, no fue y se convirtió o no se convirtió. Si se\r\nconvirtió cumplimos con el trabajo y descartamos, si no se convirtió revisamos\r\nsi fue o no, si no fue enviamos un mensaje para reprogramar, si fue enviamos un\r\nmsj preguntando como la paso e intentamos pactar una clase “VIENE A ABONAR” es\r\ndecir lograr una nueva agenda en la que el cliente directamente ira a pagar, si\r\nsucede asi cargaríamos la clase, el turno y la agenda para el día siguiente\r\ncomo hablamos anteriormente.<br>\r\n<br>\r\nAGENDAS PARA MEJORAR EL SEGUIMIENTO Y LA EXPERIENCIA DEL CLIENTE: Su objetivo\r\nes hacer notar nuestra presencia en la vida del cliente, por ese motivo vamos a\r\ncargar agendas en casos de viajes, lesiones, enfermedades, exámenes, quejas.\r\nPor ejemplo un cliente nos comenta que se ira de vacaciones 2 semanas, podemos\r\ncargar una agenda o bien al principio para el día que se va para enviar un\r\nmensaje deseando que la pase bien y lo esperamos a la vuelta, o bien cargar una\r\nagenda para la mitad del viaje para lo mismo, o bien para el final para enviar\r\nun mensaje preguntando como la paso y comentándole que lo estamos esperando en\r\nel gimnasio. El mensaje siempre tiene que tener las dos funciones, desear lo\r\nmejor (emocional) y lograr una agenda para regrese al gimnasio (comercial). Si\r\nes solo comercial no da una buena sensación al cliente y siente que es un\r\nnúmero más, si es solo emocional no tiene rendimiento para el gimnasio. <o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><u>ERRORES FRECUENTES<o:p></o:p></u></p><p class=\"MsoNormal\">1_ No buscar una agenda, por ejemplo nos consultan para una\r\nventa, nos comentan sobre vacaciones, etc y no buscamos coordinar fechas para\r\nrealizar las agendas correspondientes<o:p></o:p></p><p class=\"MsoNormal\">2_ Realizar las agendas pero no enviar el mensaje: El\r\nprocedimiento no termina con la agenda, el objetivo de la agenda es enviarle el\r\nmsj al cliente. El objetivo final es que el cliente abone su cuota, la agenda\r\nes el paso intermedio que nos permitirá conseguirlo o poder realizarle un\r\nseguimiento al mismo sin perder su rastro hasta que abone<o:p></o:p></p><p class=\"MsoNormal\">3_ No cargar de manera completa las agendas recodar siempre:<br>\r\n<u>EN PROSPECTOS:</u> CARGAR CLASE DE PRUEBA (O “VIENE A ABONAR”) – CARGAR\r\nTURNO – CARGAR AGENDA DÍA DESPUES (CLASE DE PRUEBA O ABONABA DÍA ANTERIOR)<o:p></o:p></p><p class=\"MsoNormal\"><u>EN SOCIO INDIV:</u> CARGAR AGENDA DE CLASE DE PRUEBA O\r\nVIENE A ABONAR – CARGAR AGENDA DÍA DESPUES (CLASE DE PRUEBA O ABONABA DÍA\r\nANTERIOR)<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">NOTA: Las clases viene a abonar y clase de prueba con turnos\r\npermitirán al encargado durante la mañana enviarles un mensaje a los mismos\r\nsobre su clase programada, este es el único mensaje que estará a cargo de otra\r\npersona. El objetivo es que esta persona envié al cliente y notifique al\r\nprofesor informando sobre las características del nuevo alumno.<o:p></o:p></p>', 12, 1, '2024-03-12 14:58:40', '2024-03-12 15:21:36');
