(24, 'INSTALACIONES Y EQUIPOS + BENEFICIOS DEL ENTRENAMIENTO', '<p class=\"MsoNormal\"><b><u><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">1 INSTALACIONES<o:p></o:p></span></u></b></p><p class=\"MsoNormal\"><u><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">MONTEROS</span></u><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">: Contamos con 700 mt2 aproximadamente, divididos en 4\r\nsectores de área productiva (en donde se hace gimnasia). Un salón de Pilates,\r\nun salón de actividades, un salón de musculación y un sector de cintas. Todos\r\nlos salones están climatizados con aire acondicionado y disponemos de dispenser\r\npara recargar agua<o:p></o:p></span></p><p class=\"MsoNormal\"><u><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">CONCEPCION:</span></u><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> Contamos con 1100 mt2 aproximadamente, divididos en 6\r\nsectores, 2 salones de musculación, 2 salón para actividades, 1 salón de\r\ncardio&nbsp; y 1 espacio al aire libre. Todos\r\nlos salones están climatizados con aire acondicionado y disponemos de dispenser\r\npara recargar agua<o:p></o:p></span></p><p class=\"MsoNormal\"><b><u><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">2 EQUIPOS<o:p></o:p></span></u></b></p><p class=\"MsoNormal\"><u><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">MONTEROS:</span></u><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> Trabajamos con marca nacional millenium y maquinas\r\nimportadas G FITNESS. Contamos con más de 40 máquinas de musculación + 10\r\nbancos<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;Para cardio contamos con 5 cintas, 10 bicis, 1\r\nelíptico y también contamos con un remo y un airebike. <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Las mancuernas que utilizamos son\r\nhexagonales y cilíndricas con un peso total de 600 kg aproximadamente<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">En discos tenemos 1000 kg.<o:p></o:p></span></p><p class=\"MsoNormal\"><u><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">CONCEPCION:</span></u><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> Trabajamos con marca importada G FITNESS<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Contamos con más de 50 máquinas y\r\nmás de 10 bancos.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">En cardio contamos con 10 cintas 5\r\nbicis 2 elípticos 2 remos y 2 airbike<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Las mancuernas que utilizamos son\r\nhexagonales con un peso de 700 kg<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Contamos con 1000 kg aprox en\r\ndiscos<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p class=\"MsoNormal\"><span style=\"color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p class=\"MsoNormal\"><b>4 BENEFICIOS DEL\r\nENTRENAMIENTO<o:p></o:p></b></p><p class=\"MsoNormal\"><u>FISICOS: <o:p></o:p></u></p><p class=\"MsoNormal\">Aumentar masa muscular y disminuir porcentaje de grasa<o:p></o:p></p><p class=\"MsoNormal\">Mejorar la condición física: Fuerza, potencia, velocidad,\r\nresistencia, movilidad, flexibilidad<o:p></o:p></p><p class=\"MsoNormal\">Normalizar la presión arterial, azúcar en sangre, el entorno\r\nhormonal mejorando la calidad de vida y disminuyendo riesgos de enfermedades\r\ncardiovasculares, hipertensión, diabetes, obesidad<o:p></o:p></p><p class=\"MsoNormal\"><u>SOCIALES:<o:p></o:p></u></p><p class=\"MsoNormal\">Al ser un entorno altamente sociable, el compartir con otras\r\npersonas hacer amigos etc nos da más seguridad en uno mismo y mayor control de\r\nlas situaciones. Además al mejorar desde el aspecto mental y emocional nos da\r\nmás seguridad para vincularnos con los demas.<o:p></o:p></p><p class=\"MsoNormal\"><u>PSICOLOGICOS:<o:p></o:p></u></p><p class=\"MsoNormal\">Disminuye estrés, ansiedad, angustia, depresión<o:p></o:p></p><p class=\"MsoNormal\"><u>EMOCIONALES<br>\r\n<br>\r\n</u><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ncolor:#374151\">Ver mejoras en la forma física y la capacidad atlética puede\r\ntener un impacto positivo en la percepción personal, mejorando el autoestima\r\nautoconfianza y seguridad lo cual está estrechamente relacionado a los\r\nbeneficios sociales y mentales, permitiendo relacionarse con personas con mayor\r\nfelicidad y de manera más activa y aumentando las probabilidades de vivir\r\nexperiencias positivas y crear vínculos emocionales con los demás.</span><u><o:p></o:p></u></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><u>El fin no es hacer actividad física, ese es el medio, el\r\nFin es verse mejor, sentirse mejor con uno mismo, disminuir el estrés, estar\r\nmás productivo durante el día, hacer amigos, pasarla bien etc, nadie continua\r\nhaciendo algo en el tiempo que no disfruta, por lo que es nuestra\r\nresponsabilidad lograr que los clientes disfruten de ir al gimnasio.<o:p></o:p></u></p>', 17, 1, '2024-03-12 15:00:29', '2024-03-12 15:25:59');
