('064274a8-8ebc-416e-9d3d-115cc74c7ea8', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":245,\"sede\":\"todas\",\"mensaje\":\"<span class=\\\"selectable-text copyable-text\\\">Se agrega <b>CONSULTAS DE INACTIVOS<\\/b>, para cuando venga un exsocio por mostrador o mande msj y le hagan una agenda, ya que no ten\\u00edamos como registrar eso porque solo registrabamos las CONSULTAS NUEVOS y los EXSOCIOS (inactivos) que agendabamos por protocolo de msj (30-60-90 d\\u00edas), en este caso la columna de CONSULTAS DE INACTIVOS es para cualquier tipo de exsocio que quiera volver por INICIATIVA PROPIA y pacte un d\\u00eda y le hagan una agenda para mas tarde o para los d\\u00edas futuros, o sea si vuelve en el momento no lo anoten.<\\/span>\",\"vencimiento\":\"2023-11-06\"}', NULL, '2023-11-06 12:59:56', '2023-11-06 12:59:56'),
