('077b100a-d923-4965-949d-958433927500', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 15, '{\"novedad_id\":184,\"sede\":\"concepcion\",\"mensaje\":\"Organizar para que el turno ma\\u00f1ana complete los correos electronicos de las personas que estan inscriptas en estos ultimos 3 meses (aprox 300), hacer unos 20 por d\\u00eda e ir pasando para otra caja.\",\"vencimiento\":\"2023-09-20\"}', NULL, '2023-09-20 12:10:05', '2023-09-20 12:10:05'),
('07e54c58-0b57-44e0-923a-a2a146d76d38', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":301,\"sede\":\"concepcion\",\"mensaje\":\"No olviden que un cliente que no permita pasar el molinete por que tiene el contrato de cabina, es necesario que le venzan el mismo y le vayan activando cada vez que quiera hacer una sesion, por otro lado, no olviden vencer los contratos de cabina que ya se gastaron\",\"vencimiento\":\"2023-12-18\"}', NULL, '2023-12-18 12:43:20', '2023-12-18 12:43:20'),
('0887be5e-a5d3-433f-80ca-265935251579', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":298,\"sede\":\"todas\",\"mensaje\":\"Estan disponibles en recepci\\u00f3n, faltan las entradas VIP de Concepcion (pulseras) \\u00fanicamente, pero pueden ir vendiendo desde el perfil en sistema ya que figuran dentro de productos como FIESTA HAMMER CATERING (son las vips) y FIESTA HAMMER (las comunes). En caso que vendan a un no socio lo venden desde el perfil de Hammer (DNI: 8.888.888) con la observaci\\u00f3n del nombre de a quien le venden, sobre todo las vips ya que haremos lista.<br>\",\"vencimiento\":\"2023-12-11\"}', NULL, '2023-12-11 11:36:58', '2023-12-11 11:36:58'),
('0899f31c-7d02-404d-9ada-5e605ca3696e', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":142,\"sede\":\"todas\",\"mensaje\":\"Este jueves, y solo por este jueves tenemos la promo de bna, consiste en realizar un reintegro de un 25% en los planes semestrales y anuales para todos aquellos que abonen con tarjeta de credito de banco nacion y en 6 cuotas (Recuerden que solo en este caso usarian el codigo 6 y solamente se puede usar 6 cuotas no 12 tanto para el anual como semestral). Si hay alguien que no recuerde bien como realizar el cobro y como explicarle a la gente el por que de las muchas facturas me manda un mensaje y lo vemos nuevamente las veces que sea necesario. El otro mes confirmamos si continuamos con la promo\",\"vencimiento\":\"2023-08-28\"}', '2023-10-04 03:59:18', '2023-08-28 12:54:08', '2023-10-04 03:59:18'),
('089d0a4a-534f-4d2c-94fb-61bc847a3a18', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":179,\"sede\":\"concepcion\",\"mensaje\":\"Plan de 4 veces por semana (2 a la siesta y 2 a la ma\\u00f1ana) en promo a $8.900. Pueden ofrecerlo incluso a los mismo clientes ya que la diferencia es poca con el de dos veces.\",\"vencimiento\":\"2023-09-18\"}', '2023-09-18 12:50:18', '2023-09-18 12:09:26', '2023-09-18 12:50:18');
