pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 \\/ 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\\\">\\\"La admisi\\u00f3n est\\u00e1 lista, cuando asistas debes comunicar en recepci\\u00f3n que est\\u00e1s dado de alta a trav\\u00e9s del gremio de AEFIP y seguidamente vas a ingresar colocando tu n\\u00famero de documento en el molinete, en caso de requerir entrenador se lo comunicas en recepci\\u00f3n para que te gu\\u00eden al mismo, idealmente debes asistir con tu botella y toalla personal. Para cualquier consulta podes contactarte a trav\\u00e9s de este numero o bajarte la App HAMMERX disponible para tu tel\\u00e9fono Android o Iphone, donde tenes toda tu info y vas a recibir comunicados, promociones y fecha de renovaci\\u00f3n\\\"<\\/p><p style=\\\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 \\/ 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\\\">Seguidamente enviar a franco pidiendole la factura, cuando franco les envie inmediatamente se la mandan a los clientes. Se les notifica que estar\\u00e1 disponible en 48 hs h\\u00e1biles a trav\\u00e9s de este medio. El \\u00fanico medio de pago para este gremio es Transferencia al CBU de BANCO NACION de Marcelo (MUY IMPORTANTE) o tarjeta de cr\\u00e9dito. No entregar otro CBU como el de Jessi que no sea el de marcelo, no cobrar en efectivo, directamente les dicen que el convenio esta dado de alta para pagos por transferencia.<\\/p><div><br><\\/div>\",\"vencimiento\":\"2024-02-21\"}', '2024-02-27 22:20:09', '2024-02-21 14:12:54', '2024-02-27 22:20:09'),
