('2e072a61-83a6-4e24-a310-5b9c36dc9184', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 15, '{\"novedad_id\":393,\"sede\":\"todas\",\"mensaje\":\"Debemos mencionar en la historia que publicamos a los ganadores del sorteo, en sede concepcion loana si puede enviarle a brisa o adrian los perfiles para que etiqueten aqui. Por otro lado tenemos que preparar las tarjetitas de quechevere, gerf y lookfit, y una bolsita de hammer para colocar y entregar una remera. Le envian todos los mensajes a los ganadores tambien, cada sede se hace cargo de los suyos, y debe pedirle a los ganadores que descarguen la aplicacion para poder recibir el premio\",\"vencimiento\":\"2024-02-05\"}', NULL, '2024-02-05 03:15:31', '2024-02-05 03:15:31'),
('2e08d4bb-771f-44ff-a161-13cc15e1ea42', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":311,\"sede\":\"todas\",\"mensaje\":\"Tema remeras:<br>1_ Todas las perchas colgadas tienen que estar ennumeradas con un felpon o algo<br>2_ Todas las perchas colgadas siempre tienen que tener una remera, lo que haremos es poner una de cada modelo y talle y sexo, cada vez que vendan una, buscan en las cajas la misma para reponer (si se acaban me avisan asi llevo mas de esa)<br>3_ Todas las remeras colgadas tienen que tener una cinta de papel si es de hombre o mujer y separamos a la derecha hombre izquierda mujer con un espacio en el medio, siempre que&nbsp; cuelguen una le ponen la cinta (al finalizar cada turno, asi ayudamos tambien a su compa\\u00f1ero a que cuenta facilmente)&nbsp;<br>4_ El resto de remeras repetidas quedara en la caja, estas ya tienen su cinta especificando de que son\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 13:01:52', '2023-12-21 13:01:52'),
