('431f29cd-11a4-408d-8d4d-eba459c22d24', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":82,\"sede\":\"monteros\",\"mensaje\":\"PROMO BANCO NACION: Cambiaron las condiciones de la promo y paso a explicar los nuevos terminos ademas voy a poner un ejemplo para que tengan aqui el paso a paso de como realizarlo.\\r\\nSolo se puede pasar en 6 cuotas fijas y sin interes (recuerden poner el c\\u00f3digo 6 en vez de 16 en estos casos). Ya no acepta 12 cuotas y la devoluci\\u00f3n es de un 25% (ya no de 15%) hasta un tope de 3000 ( ya no de 1000)\\r\\nEl monto m\\u00e1ximo que vamos a pasar por transacci\\u00f3n es de 12000 (y se le devuelven 3000 por cada una que es el 25%).\\r\\nA\\u00d1O: Tendr\\u00e1 3 meses gratis mas 6 cuotas fijas y sin inter\\u00e9s. Pasamos  5 montos de 12000 (con c\\u00f3digo 6) y uno de 9600 )se devuelve 17400.\\r\\nSemestre: Tendr\\u00e1 casi 1 mes y medio gratis y 6 cuotas fijas y sin inter\\u00e9s. Pasamos 2 montos de 12000 y uno de 10800 y se le devolver\\u00e1 8700. Las devoluciones se hacen el primer mes, osea en el resumen de la tarjeta les saldran los pagos y las devoluciones el primer mes, como la devolucion es mas que el monto que van a pagar el primer mes les queda como saldo a favor. Me consultan por privado cualquier cosa\",\"vencimiento\":\"2023-07-28\"}', '2023-08-11 03:03:20', '2023-07-28 14:19:01', '2023-08-11 03:03:20'),
('4341f455-5fc8-4590-a6da-9ff61c2c65f1', 'App\\Notifications\\NewCv', 'App\\Models\\User', 0, '{\"postulante_id\":65,\"name\":\"Campos valentina\",\"celular\":\"3863549694\",\"edad\":\"19\",\"puesto\":\"recepcionista\",\"sede\":\"monteros\"}', NULL, '2024-02-23 02:51:19', '2024-02-23 02:51:19'),
('43423bd0-89f4-43a7-a416-3b050104caa2', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":74,\"sede\":\"monteros\",\"mensaje\":\"PROMOCION BANCO NACION: A partir de esta semana largamos el convenio de banco nacion con tarjeta de cr\\u00e9dito (solo apto para tarjetas de credito banco nacion)\\r\\n\\r\\nComo es? SEMESTRE: Deben realizar el cobro del plan que carguen, semestre (solo es valido para semestres y anuales) en 4 montos de 6700 y uno de 8000 (son 5 recibos en total y suman los 34800)\\r\\nANUAL: Deben realizar el cobro del plan anual en 9 pagos de 6700 y uno de 9300. (69300 en total). \\r\\nCODIGO: 6 y 12, no usan los de ahora 12 que eran el 16 y 13, usan los codigos comunes, pero tengan cuidado que solo se puede hacer dia jueves y con tarjeta de credito de banco nacion.\\r\\nPor que hacemos los cobros asi? Por cada 6700 que nosotros cobramos, se le devuelven 1000 a los clientes, por lo que en el semestre al hacerlo en 5 pagos se le devuelve 5000 y en el anual 10000 porlo que para venderlos le dicen que ademas de las cuotas fijas y sin interes se le reintegran esos montos, es un poco engorroso hacer tantos cobros pero bueno. Esas devoluciones les llegaran en sus resumenes a fin de mes.\\r\\n\\r\\nMe consultan cualquier cosa\",\"vencimiento\":\"2023-07-18\"}', '2023-10-06 14:32:31', '2023-07-18 19:00:29', '2023-10-06 14:32:31'),
