('4cb0eb7a-0184-4b7b-8e1f-8e663a31d865', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":298,\"sede\":\"todas\",\"mensaje\":\"Estan disponibles en recepci\\u00f3n, faltan las entradas VIP de Concepcion (pulseras) \\u00fanicamente, pero pueden ir vendiendo desde el perfil en sistema ya que figuran dentro de productos como FIESTA HAMMER CATERING (son las vips) y FIESTA HAMMER (las comunes). En caso que vendan a un no socio lo venden desde el perfil de Hammer (DNI: 8.888.888) con la observaci\\u00f3n del nombre de a quien le venden, sobre todo las vips ya que haremos lista.<br>\",\"vencimiento\":\"2023-12-11\"}', NULL, '2023-12-11 11:36:58', '2023-12-11 11:36:58'),
