('51038617-a3eb-4a35-b57b-017cfe59ff8a', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":245,\"sede\":\"todas\",\"mensaje\":\"<span class=\\\"selectable-text copyable-text\\\">Se agrega <b>CONSULTAS DE INACTIVOS<\\/b>, para cuando venga un exsocio por mostrador o mande msj y le hagan una agenda, ya que no ten\\u00edamos como registrar eso porque solo registrabamos las CONSULTAS NUEVOS y los EXSOCIOS (inactivos) que agendabamos por protocolo de msj (30-60-90 d\\u00edas), en este caso la columna de CONSULTAS DE INACTIVOS es para cualquier tipo de exsocio que quiera volver por INICIATIVA PROPIA y pacte un d\\u00eda y le hagan una agenda para mas tarde o para los d\\u00edas futuros, o sea si vuelve en el momento no lo anoten.<\\/span>\",\"vencimiento\":\"2023-11-06\"}', NULL, '2023-11-06 12:59:56', '2023-11-06 12:59:56'),
('512f5b79-5fff-41a3-afef-5c009080ab53', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 12, '{\"novedad_id\":377,\"sede\":\"concepcion\",\"mensaje\":\"3863615978: Revisar chat y si se convirtio en cliente o no, de ultima consultale, si te dice que no ofrecele un 15% off hasta el lunes de la semana que viene<br><br>Carbelo Nestor: Falto en un chat hacerle una agenda, por lo que hay que revisar si al final vino o no y en caso que no preguntar que paso y ofrecer un 15% off hasta el lunes.&nbsp;<br><br>NOTA: Todos aquellos que acepten la promo se le tiene que devengar una bonificacion y poner VALIDO HASTA (fecha del lunes)\",\"vencimiento\":\"2024-01-25\"}', NULL, '2024-01-25 16:30:21', '2024-01-25 16:30:21'),
('51330a1b-78b9-42ec-a857-7e7ab955c302', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 21, '{\"novedad_id\":418,\"sede\":\"concepcion\",\"mensaje\":\"<p style=\\\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 \\/ 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\\\">El gremio les envia a marcelo una lista con los integrantes que vendran a hammer, le solicitamos que hagan su pago por transferencia y les envie a ustedes el comprobante por whatsapp. Los afiliados y\\/o hasta 2 familiares del afiliado a AEFIP (Gremio de Afip) enviar\\u00e1n el comprobante de pago v\\u00eda whatsapp a HAMMER, se debe chequear el listado de altas (solicitar a Marcelo), en caso de que figure el nombre avanzar, si no figura solicitar credencial de AEFIP del titular o del familiar que sea titular. Una vez confirmado, solicitar dem\\u00e1s datos para crearle el perfil y dejar el siguiente mensaje:<\\/p><p style=\\\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-