('550fa369-68b4-4f4a-ad91-b14ea9600be9', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":393,\"sede\":\"todas\",\"mensaje\":\"Debemos mencionar en la historia que publicamos a los ganadores del sorteo, en sede concepcion loana si puede enviarle a brisa o adrian los perfiles para que etiqueten aqui. Por otro lado tenemos que preparar las tarjetitas de quechevere, gerf y lookfit, y una bolsita de hammer para colocar y entregar una remera. Le envian todos los mensajes a los ganadores tambien, cada sede se hace cargo de los suyos, y debe pedirle a los ganadores que descarguen la aplicacion para poder recibir el premio\",\"vencimiento\":\"2024-02-05\"}', NULL, '2024-02-05 03:15:31', '2024-02-05 03:15:31'),
