('5607768e-5b2d-412d-9056-ff0b4955e530', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":180,\"sede\":\"todas\",\"mensaje\":\"<p>Les dejo info de las cremas para cabina solar:<\\/p><p>Todas estan hechas de extractos de vegetales.<br>COBRIZZO: incrementa la velocidad del bronceado en un tono \\\"tipo cobre\\\" y estimulan la produccion de colageno (cuidado de la piel). Recomendado para las tres primeras sesiones.<br>EXPRESSO: adicional a lo anterior, tambi\\u00e9n permite un bronceado m\\u00e1s duradero al fijar el color. O sea es tipo mitad para cada cosa (velocidad y duraci\\u00f3n). Recomendado para la cuarta sesi\\u00f3n en adelante.<br><br>En ambos casos se recomienda usar esto porque se logra un bronceado mas eficiente y saludable.<\\/p><p>No se deben usar otro tipo de cremas no dise\\u00f1adas para la cabina solar porque se puede bloquear todo el bronceado (en caso de usar protectores) o bien da\\u00f1ar la piel (bronceadores para sol), salvo recomendaci\\u00f3n de un dermat\\u00f3logo.<br><br><br><\\/p>\",\"vencimiento\":\"2023-09-19\"}', '2023-09-19 13:13:34', '2023-09-19 12:24:16', '2023-09-19 13:13:34');
