('57c3f8cd-4e59-4fb7-bfc1-293d67eca151', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 19, '{\"novedad_id\":344,\"sede\":\"concepcion\",\"mensaje\":\"Ya les hice el cobro, falta hacerle el cobro de los 10 mil de interes nada mas, 5m il por persona, cuando te paguen cobrales desde el perfil de medina santiago, en grupos familiares siempre a la cabeza de la flia le salen las deudas de los demas\",\"vencimiento\":\"2024-01-09\"}', NULL, '2024-01-09 13:05:46', '2024-01-09 13:05:46'),
('57d55028-0b9b-44a5-85bd-20ac5639cd82', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 3, '{\"novedad_id\":312,\"sede\":\"todas\",\"mensaje\":\"Chicos tengan muchisimo cuidado con los pendientes de deuda de los planes largos, la gente realmente no puede pasarse dias despues de los 30 ya tienen que pagar, por que si no, uds los dejan pasar, ellos se hacen los boludos y pasan 15 dias mas y eso implica que yo pierda en un mes 15 % de inflacion, en medio mes mas 22% en total, y nosotros solo le recargamos un 5%, no puedo vender en cuotas asi. Si alguien no lleva el primer dia le dicen que tiene que abonar si no se le aplicara recargo por la cantidad de dias que se demore y no puede seguir pasando con deuda (es un compromiso que ellos asumieton)<br>2_ Si en algun caso alguien adelanta su plan semestral por ejemplo igual tiene que pagar a los 30 dias, si no me van a adelantar 3 meses, pagaran la priemera cuota y la segunda recien a los 4 meses, super devaluado, no funciona asi, desde el primer dia que pagan a los 30 tienen que pagar la segunda, caiga cuando caiga<br><br>PD: Estos dos casos los anoto aqui por que en Concepcion sucedieron. Muchas gracias\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 13:06:22', '2023-12-21 13:06:22'),
