('5cafe616-58ec-4116-a18f-991444f8c2ce', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":174,\"sede\":\"concepcion\",\"mensaje\":\"Se esta promocionando el video de Loana \\u00fanicamente para Concepci\\u00f3n y alrededores. La gente usar\\u00e1 el contacto por facebook messenger, por whatsapp (tienen el boton en la publicacion) o por comentarios, a esto ultimo Irina debe ingresar cada d\\u00eda y contestar los msjs generales (ubicacion, horarios), y los que sean info o precio se pone RESPONDIDO POR MD. La promo estar vigente por una semana. Proceder normalmente derivando a Irina los prospectos, pero estar\\u00eda bueno ir anotando cuantas personas se contactaron y los nombres para saber bien el resultado de la campa\\u00f1a. Armen una hojita donde puedan anotar todo: FECHA, NOMBRE, MEDIO DE CONTACTO, unicamente a la gente que provenga de esta campa\\u00f1a\",\"vencimiento\":\"2023-09-13\"}', NULL, '2023-09-13 16:27:59', '2023-09-13 16:27:59'),
