('5ed3d5fd-3a28-4c85-8153-b8e39b5c6ca2', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 3, '{\"novedad_id\":390,\"sede\":\"todas\",\"mensaje\":\"Activamos una promo donde las personas pagaran 3 meses y le cargaremos cuatro, osea le regalamos un mes. Como tienen que pagar, desde su app BNA + es decir banco nacion, entran a \\\"MODO\\\", modo es un modo de pago que tiene el banco nacion donde en su cuenta vinculan sus tarjetas, entonces es como que pueden pagar con tarjeta pero desde su celu, no es necesaria la tarjeta fisica, pero como se la pasa por el posnet? Con un codigo QR, que se genera entrando a ventas, y dice generar codigo qr, me avisan si no lo encuentran. Ahora el monto maximo que pueden pasar por cada pago es de 12mil, por lo que uds tienen que hacer es calcular el pago total por ejemplo, en monteros sale 12400 x 4 = 49600 que es lo que tenemos que cobrarle (el mes que se le regala le regala el banco luego cuando le llega el resumen de su tarjeta, nosotros cobramos normal los 4 meses). Pero como podemos solo hacer cobros de 12000 tenemos que hacer 3 cobros de 12 mil (36mil) + un cobro de 13600 (ahi estarian en total los 49600). El codigo que tienen que usar siempre es 6 en este caso (no el 16), solo con el codigo qr usan el 6.<br><br>Obviamente tienen que explicarle a la gente que el mes que se le regala es en el resumen luego.\",\"vencimiento\":\"2024-02-02\"}', NULL, '2024-02-02 16:20:41', '2024-02-02 16:20:41'),
