('6556dd62-f1a6-4dbf-8900-1c834756b797', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":274,\"sede\":\"concepcion\",\"mensaje\":\"Reemplazar el de Molina Diego de Lemon provisoriamente por este hasta que resolvamos un asunto.<br><br>0000003100084039574714<br>Personal Pay<br>Cancino Jessica<br><br>Lo dejamo escrito en recepci\\u00f3n ya. Se egresa como Transf Personal Pay<br><br><br>\",\"vencimiento\":\"2023-11-27\"}', NULL, '2023-11-27 14:41:08', '2023-11-27 14:41:08'),
('65c360fa-4197-4ee7-855b-0767231bbb3c', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":261,\"sede\":\"concepcion\",\"mensaje\":\"MUSCULACION $10900 (DESC. INSTRUCTOR 1000)<br>CLASES GRUPALES $9400<br>PASE LIBRE $11400<br>CONVENIO X3 $8900<br>PASE X8 CLASES $7900\",\"vencimiento\":\"2023-11-17\"}', NULL, '2023-11-17 11:24:50', '2023-11-17 11:24:50'),
('65d90ac3-291d-4029-afa6-09fd5c036cc2', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 14, '{\"novedad_id\":333,\"sede\":\"todas\",\"mensaje\":\"Se modifican los intereses, antes era 5 y 10% ahora 13 y 27%, ya solicite que corrijan las cartillas y si estan cargadas imagenes en liveconnect pro ahora no las usen hasta que las corrijamos\",\"vencimiento\":\"2024-01-02\"}', NULL, '2024-01-02 16:09:48', '2024-01-02 16:09:48'),
