('67012ba6-fa02-4917-8115-59f21f769575', 'App\\Notifications\\NewLead', 'App\\Models\\User', 15, '{\"lead_id\":29,\"name\":\"test noti\",\"celular\":\"966332\",\"sede\":\"monteros\",\"fecha\":\"2023-06-27T05:17:26.000000Z\"}', '2023-07-04 12:26:04', '2023-06-27 05:17:27', '2023-07-04 12:26:04'),
('6736f435-091d-46ff-8d1e-3e0994b3ee31', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 21, '{\"novedad_id\":444,\"sede\":\"concepcion\",\"mensaje\":\"Buenas tardes Bian. Estoy cerrando el mes de febrero, si podes cuando abones siempre a los chicos entra antes a sus perfiles para ver si tienen que saldar algun prodcuto, en realidad eso es diario. Creo que ahora tenia un producto cargado ale diaz y ramon y bueno vos tb tenes que ir saldandola a la tuya\",\"vencimiento\":\"2024-03-06\"}', NULL, '2024-03-06 12:52:41', '2024-03-06 12:52:41'),
('6766bf39-710d-4b3b-a71a-999fe14650ed', 'App\\Notifications\\NewCv', 'App\\Models\\User', 1, '{\"postulante_id\":73,\"name\":\"Valentina racedo\",\"celular\":\"3863577152\",\"edad\":\"20\",\"puesto\":\"recepcionista\",\"sede\":\"monteros\"}', NULL, '2024-03-08 02:51:57', '2024-03-08 02:51:57'),
('67bb54c6-7f1c-448d-9d03-6229c5b00d7d', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 3, '{\"novedad_id\":283,\"sede\":\"monteros\",\"mensaje\":\"Pedirle 35.500 que iba a dar el s\\u00e1bado ya que el ultimo finde subi\\u00f3 (antes era 10.000 y deb\\u00eda 2 findes, ahora es 15.500 y debe el ultimo)\",\"vencimiento\":\"2023-12-04\"}', NULL, '2023-12-04 12:07:47', '2023-12-04 12:07:47'),
('682b33e4-2693-41c3-b5a7-6aa444c3387b', 'App\\Notifications\\NewLead', 'App\\Models\\User', 22, '{\"lead_id\":59,\"name\":\"Erika\",\"celular\":\"3813953111\",\"sede\":\"monteros\",\"fecha\":\"2024-03-12T12:24:58.000000Z\"}', '2024-03-14 20:22:01', '2024-03-12 12:24:59', '2024-03-14 20:22:01'),
('683a7904-0c93-4fff-b558-b4b4329d7726', 'App\\Notifications\\NewCv', 'App\\Models\\User', 15, '{\"postulante_id\":48,\"name\":\"Tabar\\u00e9 Daniel jerez\",\"celular\":\"3863503610\",\"edad\":\"21\",\"puesto\":\"recepcionista\",\"sede\":\"monteros\"}', NULL, '2024-01-15 17:05:04', '2024-01-15 17:05:04'),
('684bc504-8314-435b-a393-8e8c76020c1c', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 20, '{\"novedad_id\":312,\"sede\":\"todas\",\"mensaje\":\"Chicos tengan muchisimo cuidado con los pendientes de deuda de los planes largos, la gente realmente no puede pasarse dias despues de los 30 ya tienen que pagar, por que si no, uds los dejan pasar, ellos se hacen los boludos y pasan 15 dias mas y eso implica que yo pierda en un mes 15 % de inflacion, en medio mes mas 22% en total, y nosotros solo le recargamos un 5%, no puedo vender en cuotas asi. Si alguien no lleva el primer dia le dicen que tiene que abonar si no se le aplicara recargo por la cantidad de dias que se demore y no puede seguir pasando con deuda (es un compromiso que ellos asumieton)<br>2_ Si en algun caso alguien adelanta su plan semestral por ejemplo igual tiene que pagar a los 30 dias, si no me van a adelantar 3 meses, pagaran la priemera cuota y la segunda recien a los 4 meses, super devaluado, no funciona asi, desde el primer dia que pagan a los 30 tienen que pagar la segunda, caiga cuando caiga<br><br>PD: Estos dos casos los anoto aqui por que en Concepcion sucedieron. Muchas gracias\",\"vencimiento\":\"2023-12-21\"}', '2023-12-23 14:11:45', '2023-12-21 13:06:22', '2023-12-23 14:11:45'),
('6857c19f-3bfa-46d6-b1f5-f34680fc50b9', 'App\\Notifications\\NewLead', 'App\\Models\\User', 12, '{\"lead_id\":52,\"name\":\"Mariel\",\"celular\":\"3863457434\",\"sede\":\"monteros\",\"fecha\":\"2024-02-21T18:05:17.000000Z\"}', NULL, '2024-02-21 18:05:17', '2024-02-21 18:05:17'),
