('71fdff46-fb20-43b1-870c-27898fcc4b40', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 1, '{\"novedad_id\":74,\"sede\":\"monteros\",\"mensaje\":\"PROMOCION BANCO NACION: A partir de esta semana largamos el convenio de banco nacion con tarjeta de cr\\u00e9dito (solo apto para tarjetas de credito banco nacion)\\r\\n\\r\\nComo es? SEMESTRE: Deben realizar el cobro del plan que carguen, semestre (solo es valido para semestres y anuales) en 4 montos de 6700 y uno de 8000 (son 5 recibos en total y suman los 34800)\\r\\nANUAL: Deben realizar el cobro del plan anual en 9 pagos de 6700 y uno de 9300. (69300 en total). \\r\\nCODIGO: 6 y 12, no usan los de ahora 12 que eran el 16 y 13, usan los codigos comunes, pero tengan cuidado que solo se puede hacer dia jueves y con tarjeta de credito de banco nacion.\\r\\nPor que hacemos los cobros asi? Por cada 6700 que nosotros cobramos, se le devuelven 1000 a los clientes, por lo que en el semestre al hacerlo en 5 pagos se le devuelve 5000 y en el anual 10000 porlo que para venderlos le dicen que ademas de las cuotas fijas y sin interes se le reintegran esos montos, es un poco engorroso hacer tantos cobros pero bueno. Esas devoluciones les llegaran en sus resumenes a fin de mes.\\r\\n\\r\\nMe consultan cualquier cosa\",\"vencimiento\":\"2023-07-18\"}', '2023-07-18 19:37:13', '2023-07-18 19:00:29', '2023-07-18 19:37:13'),
('723ca959-1a7a-4bb3-b012-85233ebf16f8', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 20, '{\"novedad_id\":298,\"sede\":\"todas\",\"mensaje\":\"Estan disponibles en recepci\\u00f3n, faltan las entradas VIP de Concepcion (pulseras) \\u00fanicamente, pero pueden ir vendiendo desde el perfil en sistema ya que figuran dentro de productos como FIESTA HAMMER CATERING (son las vips) y FIESTA HAMMER (las comunes). En caso que vendan a un no socio lo venden desde el perfil de Hammer (DNI: 8.888.888) con la observaci\\u00f3n del nombre de a quien le venden, sobre todo las vips ya que haremos lista.<br>\",\"vencimiento\":\"2023-12-11\"}', '2023-12-16 19:04:37', '2023-12-11 11:36:58', '2023-12-16 19:04:37'),
