('730a20fe-fe2b-419c-b18c-7229cf0b2529', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 1, '{\"novedad_id\":283,\"sede\":\"monteros\",\"mensaje\":\"Pedirle 35.500 que iba a dar el s\\u00e1bado ya que el ultimo finde subi\\u00f3 (antes era 10.000 y deb\\u00eda 2 findes, ahora es 15.500 y debe el ultimo)\",\"vencimiento\":\"2023-12-04\"}', NULL, '2023-12-04 12:07:47', '2023-12-04 12:07:47'),
('7312612a-7728-4dcb-8310-642bbc1baec7', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 1, '{\"novedad_id\":418,\"sede\":\"concepcion\",\"mensaje\":\"<p style=\\\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 \\/ 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\\\">El gremio les envia a marcelo una lista con los integrantes que vendran a hammer, le solicitamos que hagan su pago por transferencia y les envie a ustedes el comprobante por whatsapp. Los afiliados y\\/o hasta 2 familiares del afiliado a AEFIP (Gremio de Afip) enviar\\u00e1n el comprobante de pago v\\u00eda whatsapp a HAMMER, se debe chequear el listado de altas (solicitar a Marcelo), en caso de que figure el nombre avanzar, si no figura solicitar credencial de AEFIP del titular o del familiar que sea titular. Una vez confirmado, solicitar dem\\u00e1s datos para crearle el perfil y dejar el siguiente mensaje:<\\/p><p style=\\\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 \\/ 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\\\">\\\"La admisi\\u00f3n est\\u00e1 lista, cuando asistas debes comunicar en recepci\\u00f3n que est\\u00e1s dado de alta a trav\\u00e9s del gremio de AEFIP y seguidamente vas a ingresar colocando tu n\\u00famero de documento en el molinete, en caso de requerir entrenador se lo comunicas en recepci\\u00f3n para que te gu\\u00eden al mismo, idealmente debes asistir con tu botella y toalla personal. Para cualquier consulta podes contactarte a trav\\u00e9s de este numero o bajarte la App HAMMERX disponible para tu tel\\u00e9fono Android o Iphone, donde tenes toda tu info y vas a recibir comunicados, promociones y fecha de renovaci\\u00f3n\\\"<\\/p><p style=\\\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 \\/ 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\\\">Seguidamente enviar a franco pidiendole la factura, cuando franco les envie inmediatamente se la mandan a los clientes. Se les notifica que estar\\u00e1 disponible en 48 hs h\\u00e1biles a trav\\u00e9s de este medio. El \\u00fanico medio de pago para este gremio es Transferencia al CBU de BANCO NACION de Marcelo (MUY IMPORTANTE) o tarjeta de cr\\u00e9dito. No entregar otro CBU como el de Jessi que no sea el de marcelo, no cobrar en efectivo, directamente les dicen que el convenio esta dado de alta para pagos por transferencia.<\\/p><div><br><\\/div>\",\"vencimiento\":\"2024-02-21\"}', NULL, '2024-02-21 14:12:54', '2024-02-21 14:12:54'),
