('749a21ac-76dc-4842-bcfb-e29f4fcbeaf3', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 14, '{\"novedad_id\":74,\"sede\":\"monteros\",\"mensaje\":\"PROMOCION BANCO NACION: A partir de esta semana largamos el convenio de banco nacion con tarjeta de cr\\u00e9dito (solo apto para tarjetas de credito banco nacion)\\r\\n\\r\\nComo es? SEMESTRE: Deben realizar el cobro del plan que carguen, semestre (solo es valido para semestres y anuales) en 4 montos de 6700 y uno de 8000 (son 5 recibos en total y suman los 34800)\\r\\nANUAL: Deben realizar el cobro del plan anual en 9 pagos de 6700 y uno de 9300. (69300 en total). \\r\\nCODIGO: 6 y 12, no usan los de ahora 12 que eran el 16 y 13, usan los codigos comunes, pero tengan cuidado que solo se puede hacer dia jueves y con tarjeta de credito de banco nacion.\\r\\nPor que hacemos los cobros asi? Por cada 6700 que nosotros cobramos, se le devuelven 1000 a los clientes, por lo que en el semestre al hacerlo en 5 pagos se le devuelve 5000 y en el anual 10000 porlo que para venderlos le dicen que ademas de las cuotas fijas y sin interes se le reintegran esos montos, es un poco engorroso hacer tantos cobros pero bueno. Esas devoluciones les llegaran en sus resumenes a fin de mes.\\r\\n\\r\\nMe consultan cualquier cosa\",\"vencimiento\":\"2023-07-18\"}', NULL, '2023-07-18 19:00:29', '2023-07-18 19:00:29'),
('749be301-0da1-494e-80e1-b46f98b1a77d', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":418,\"sede\":\"concepcion\",\"mensaje\":\"<p style=\\\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 \\/ 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\\\">El gremio les envia a marcelo una lista con los integrantes que vendran a hammer, le solicitamos que hagan su pago por transferencia y les envie a ustedes el comprobante por whatsapp. Los afiliados y\\/o hasta 2 familiares del afiliado a AEFIP (Gremio de Afip) enviar\\u00e1n el comprobante de pago v\\u00eda whatsapp a HAMMER, se debe chequear el listado de altas (solicitar a Marcelo), en caso de que figure el nombre avanzar, si no figura solicitar credencial de AEFIP del titular o del familiar que sea titular. Una vez confirmado, solicitar dem\\u00e1s datos para crearle el perfil y dejar el siguiente mensaje:<\\/p><p style=\\\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-p