('7518d0b0-5503-4977-8db3-b748793570f4', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":134,\"sede\":\"monteros\",\"mensaje\":\"<p>POST EVENTO: Acomodar todas las cosas, dejar luces en oscar, guardar bandera, ornamentacion, bajar mesa de dj, acomodar prensa, banderin, cable dj, vasos, todo lo que haya a la bolsa negra y guardar en deposito.<br>Hacer papelitos con todos los uqe compartieron la historia y ponerlos dentro de la caja y hacer el&nbsp; sorteo, esta ma\\u00f1ana lo sorteamos. Tiene que haber un ganador para:<br>Zapatillas de GERF<br>Remera de hammer (si no hay talle se le da un mensual)<br>Cerveza de cb + cortes de pelo<br>Meriendas de Roma<br>No se si participo la rocio carrizo tambien&nbsp;<br>Trabajar en conjunto con nazareno para que les haga el flyer que diga GANADORES SORTEO ANIVERSARIO y abajo cada uno de los premios (etiquetar al local) y etiquetar al ganador en el costado.<br><\\/p>\",\"vencimiento\":\"2023-08-23\"}', NULL, '2023-08-23 05:16:35', '2023-08-23 05:16:35'),
