('793341d4-707b-4b53-948a-afba816343b6', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 12, '{\"novedad_id\":82,\"sede\":\"monteros\",\"mensaje\":\"PROMO BANCO NACION: Cambiaron las condiciones de la promo y paso a explicar los nuevos terminos ademas voy a poner un ejemplo para que tengan aqui el paso a paso de como realizarlo.\\r\\nSolo se puede pasar en 6 cuotas fijas y sin interes (recuerden poner el c\\u00f3digo 6 en vez de 16 en estos casos). Ya no acepta 12 cuotas y la devoluci\\u00f3n es de un 25% (ya no de 15%) hasta un tope de 3000 ( ya no de 1000)\\r\\nEl monto m\\u00e1ximo que vamos a pasar por transacci\\u00f3n es de 12000 (y se le devuelven 3000 por cada una que es el 25%).\\r\\nA\\u00d1O: Tendr\\u00e1 3 meses gratis mas 6 cuotas fijas y sin inter\\u00e9s. Pasamos  5 montos de 12000 (con c\\u00f3digo 6) y uno de 9600 )se devuelve 17400.\\r\\nSemestre: Tendr\\u00e1 casi 1 mes y medio gratis y 6 cuotas fijas y sin inter\\u00e9s. Pasamos 2 montos de 12000 y uno de 10800 y se le devolver\\u00e1 8700. Las devoluciones se hacen el primer mes, osea en el resumen de la tarjeta les saldran los pagos y las devoluciones el primer mes, como la devolucion es mas que el monto que van a pagar el primer mes les queda como saldo a favor. Me consultan por privado cualquier cosa\",\"vencimiento\":\"2023-07-28\"}', NULL, '2023-07-28 14:19:01', '2023-07-28 14:19:01'),
('796e8f1b-a914-4c9b-b18f-02244cd4c5be', 'App\\Notifications\\NewCv', 'App\\Models\\User', 12, '{\"postulante_id\":81,\"name\":\"Alexander gramajo\",\"celular\":\"3865665587\",\"edad\":\"18\",\"puesto\":\"limpieza\",\"sede\":\"concepcion\"}', NULL, '2024-03-14 13:53:49', '2024-03-14 13:53:49'),
('796ffe71-7775-425d-ba75-6e38b30c5099', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 12, '{\"novedad_id\":393,\"sede\":\"todas\",\"mensaje\":\"Debemos mencionar en la historia que publicamos a los ganadores del sorteo, en sede concepcion loana si puede enviarle a brisa o adrian los perfiles para que etiqueten aqui. Por otro lado tenemos que preparar las tarjetitas de quechevere, gerf y lookfit, y una bolsita de hammer para colocar y entregar una remera. Le envian todos los mensajes a los ganadores tambien, cada sede se hace cargo de los suyos, y debe pedirle a los ganadores que descarguen la aplicacion para poder recibir el premio\",\"vencimiento\":\"2024-02-05\"}', NULL, '2024-02-05 03:15:31', '2024-02-05 03:15:31'),
('797d8b8c-1614-43fb-8fe5-aa279c47b1aa', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":235,\"sede\":\"todas\",\"mensaje\":\"Ya esta disponible la nueva APP de hammer. El beneficio que tiene la gente por ahora es poder visualizar su vencimiento de contrato (ya dejaremos de mandar los mensajes la semana que viene asi le explican a la gente). Van a poder renovar desde ahi e ir directamente a pagar en el gym. proximamente vamos a cargar rutinas y van a participar en competencias por premios\",\"vencimiento\":\"2023-10-31\"}', NULL, '2023-10-31 13:52:59', '2023-10-31 13:52:59'),
