('79d56f42-2de7-4efb-9fe7-00c6b86e25b6', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 14, '{\"novedad_id\":142,\"sede\":\"todas\",\"mensaje\":\"Este jueves, y solo por este jueves tenemos la promo de bna, consiste en realizar un reintegro de un 25% en los planes semestrales y anuales para todos aquellos que abonen con tarjeta de credito de banco nacion y en 6 cuotas (Recuerden que solo en este caso usarian el codigo 6 y solamente se puede usar 6 cuotas no 12 tanto para el anual como semestral). Si hay alguien que no recuerde bien como realizar el cobro y como explicarle a la gente el por que de las muchas facturas me manda un mensaje y lo vemos nuevamente las veces que sea necesario. El otro mes confirmamos si continuamos con la promo\",\"vencimiento\":\"2023-08-28\"}', NULL, '2023-08-28 12:54:08', '2023-08-28 12:54:08'),
('79f30a4a-269c-4b96-adf4-7a4325aa13bc', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 15, '{\"novedad_id\":418,\"sede\":\"concepcion\",\"mensaje\":\"<p style=\\\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 \\/ 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\\\">El gremio les envia a marcelo una lista con los integrantes que vendran a hammer, le solicitamos que hagan su pago por transferencia y les envie a ustedes el comprobante por whatsapp. Los afiliados y\\/o hasta 2 familiares del afiliado a AEFIP (Gremio de Afip) enviar\\u00e1n el comprobante de pago v\\u00eda whatsapp a HAMMER, se debe chequear el listado de altas (solicitar a Marcelo), en caso de que figure el nombre avanzar, si no figura solicitar credencial de AEFIP del titular o del familiar que sea titular. Una vez confirmado, solicitar dem\\u00e1s datos para crearle el perfil y dejar el siguiente mensaje:<\\/p><p style=\\\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 \\/ 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\\\">\\\"La admisi\\u00f3n est\\u00e1 lista, cuando asistas debes comunicar en recepci\\u00f3n que est\\u00e1s dado de alta a trav\\u00e9s del gremio de AEFIP y seguidamente vas a ingresar colocando tu n\\u00famero de documento en el molinete, en caso de requerir entrenador se lo comunicas en recepci\\u00f3n para que te gu\\u00eden al mismo, idealmente debes asistir con tu botella y toalla personal. Para cualquier consulta podes contactarte a trav\\u00e9s de este numero o bajarte la App HAMMERX disponible para tu tel\\u00e9fono Android o Iphone, donde tenes toda tu info y vas a recibir comunicados, promociones y fecha de renovaci\\u00f3n\\\"<\\/p><p style=\\\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 \\/ 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\\\">Seguidamente enviar a franco pidiendole la factura, cuando franco les envie inmediatamente se la mandan a los clientes. Se les notifica que estar\\u00e1 disponible en 48 hs h\\u00e1biles a trav\\u00e9s de este medio. El \\u00fanico medio de pago para este gremio es Transferencia al CBU de BANCO NACION de Marcelo (MUY IMPORTANTE) o tarjeta de cr\\u00e9dito. No entregar otro CBU como el de Jessi que no sea el de marcelo, no cobrar en efectivo, directamente les dicen que el convenio esta dado de alta para pagos por transferencia.<\\/p><div><br><\\/div>\",\"vencimiento\":\"2024-02-21\"}', NULL, '2024-02-21 14:12:54', '2024-02-21 14:12:54'),
('7a186678-3d95-4e2a-8073-7c8954040977', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":237,\"sede\":\"monteros\",\"mensaje\":\"Los vencimientos de contrato esta semana, hay que agregar:<br>Adem\\u00e1s quer\\u00eda comentarte que estamos muy contentos de anunciarte que a partir de la siguiente semana este mensaje ya no sera reenviado, ya que desde hoy tenes disponible nuestra APP HAMMERX para que puedas visualizar el vencimiento de tu contrato por este medio y todas nuestras novedades!<br><br>Descargala del siguiente enlace!&nbsp;https:\\/\\/play.google.com\\/store\\/apps\\/details?id=com.hammerx&amp;hl=es_AR&amp;gl=US\",\"vencimiento\":\"2023-10-31\"}', NULL, '2023-10-31 14:47:15', '2023-10-31 14:47:15'),
