('7d6e8cf2-3119-475f-8a62-a9a5c1d3ea00', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 14, '{\"novedad_id\":253,\"sede\":\"concepcion\",\"mensaje\":\"-&gt; Se agrega turno a las 22:30 hs, veremos como se desenvuelve Mariano. LUCIANA: hacer una simulacion para ver si sabe vender bien y asignar el turno.<br>-&gt; Cremas: recordar que COBRIZZO es para acelerar el color, o sea un bronceado mas rapido, se recomienda en sesiones 1ra, 2da y 3ra, y EXPRESSO es para que dure mas el color (intensifica), se recomienda para fijar en las sesiones 4ta en adelante.\",\"vencimiento\":\"2023-11-14\"}', NULL, '2023-11-14 12:06:32', '2023-11-14 12:06:32'),
