('8c64d8f4-5c68-4933-bbe2-a435d6e54f21', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 12, '{\"novedad_id\":74,\"sede\":\"monteros\",\"mensaje\":\"PROMOCION BANCO NACION: A partir de esta semana largamos el convenio de banco nacion con tarjeta de cr\\u00e9dito (solo apto para tarjetas de credito banco nacion)\\r\\n\\r\\nComo es? SEMESTRE: Deben realizar el cobro del plan que carguen, semestre (solo es valido para semestres y anuales) en 4 montos de 6700 y uno de 8000 (son 5 recibos en total y suman los 34800)\\r\\nANUAL: Deben realizar el cobro del plan anual en 9 pagos de 6700 y uno de 9300. (69300 en total). \\r\\nCODIGO: 6 y 12, no usan los de ahora 12 que eran el 16 y 13, usan los codigos comunes, pero tengan cuidado que solo se puede hacer dia jueves y con tarjeta de credito de banco nacion.\\r\\nPor que hacemos los cobros asi? Por cada 6700 que nosotros cobramos, se le devuelven 1000 a los clientes, por lo que en el semestre al hacerlo en 5 pagos se le devuelve 5000 y en el anual 10000 porlo que para venderlos le dicen que ademas de las cuotas fijas y sin interes se le reintegran esos montos, es un poco engorroso hacer tantos cobros pero bueno. Esas devoluciones les llegaran en sus resumenes a fin de mes.\\r\\n\\r\\nMe consultan cualquier cosa\",\"vencimiento\":\"2023-07-18\"}', NULL, '2023-07-18 19:00:29', '2023-07-18 19:00:29'),
('8c73f415-2fff-49d2-9320-d2acc6102399', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 3, '{\"novedad_id\":413,\"sede\":\"concepcion\",\"mensaje\":\"bian, siempre que se hagan promos familiares tiene que estar la familia en grupo, si no sabe scomo en preguntas frecuentes esta como cargalos asi, por que de esa manera cuando van a renovar vos rapidamente te fijas si estan activos y quienes son sus familiares directamente. Esto es algo que hicimos hace poco por lo que hay muchos que no estaban agregados en grupo, por lo que a emdida que vayas haciendoles descuento y detectndo grupos, los vas agregando por ejemplo a la flia LOBO ayer teniamos que hacer un grupo, siempre el cabeza del grupo familiar sera el adulto, es decir a ese perfil entras a editarlo y donde dice socio individual, cambias a familiar, y abajito a la izquierda te aparece grupo familiar y te aparecera un + de ir agregando los integrantes\",\"vencimiento\":\"2024-02-20\"}', NULL, '2024-02-20 14:22:25', '2024-02-20 14:22:25'),
