('920ec3fa-6596-49ef-8469-a9c3eb63acad', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 12, '{\"novedad_id\":310,\"sede\":\"todas\",\"mensaje\":\"Chicos no se olvide de dejar abierta siempre la pagina web por que les deje tareas recordatorios a cada uno programados en X horarios, como recordatorios para compartir fotos, para enviar agendas, clases de pruebas, hacer kpis, ver comprobantes etc. Hicimos una inversion grande para esta actualizacion en la pagina y es para ustedes, para que lo usen como recordatorio y alarma ustedes asi que por favor usenla y dejen abierta siempre la pagina. Gracias!\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 12:57:42', '2023-12-21 12:57:42'),
