('93050084-3bec-4eb9-91a9-dd0309416c86', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":428,\"sede\":\"monteros\",\"mensaje\":\"buscarl en socioplus cargarle el mensual de marzo y cargarle una agenda para el viernes para enviarle un msj y comentarle que desde el lunes arranca su mensual que lo esperamos para que comience a entrenar nuevamente con nosotros\",\"vencimiento\":\"2024-02-26\"}', NULL, '2024-02-26 10:33:05', '2024-02-26 10:33:05'),
('93711ecb-5575-4961-a5b6-f591f11ae6c9', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":312,\"sede\":\"todas\",\"mensaje\":\"Chicos tengan muchisimo cuidado con los pendientes de deuda de los planes largos, la gente realmente no puede pasarse dias despues de los 30 ya tienen que pagar, por que si no, uds los dejan pasar, ellos se hacen los boludos y pasan 15 dias mas y eso implica que yo pierda en un mes 15 % de inflacion, en medio mes mas 22% en total, y nosotros solo le recargamos un 5%, no puedo vender en cuotas asi. Si alguien no lleva el primer dia le dicen que tiene que abonar si no se le aplicara recargo por la cantidad de dias que se demore y no puede seguir pasando con deuda (es un compromiso que ellos asumieton)<br>2_ Si en algun caso alguien adelanta su plan semestral por ejemplo igual tiene que pagar a los 30 dias, si no me van a adelantar 3 meses, pagaran la priemera cuota y la segunda recien a los 4 meses, super devaluado, no funciona asi, desde el primer dia que pagan a los 30 tienen que pagar la segunda, caiga cuando caiga<br><br>PD: Estos dos casos los anoto aqui por que en Concepcion sucedieron. Muchas gracias\",\"vencimiento\":\"2023-12-21\"}', '2024-01-02 12:43:45', '2023-12-21 13:06:22', '2024-01-02 12:43:45'),
('9388c7e7-41d7-4037-acfd-9d1e5603ffc8', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 3, '{\"novedad_id\":302,\"sede\":\"todas\",\"mensaje\":\"Ya se encuentra corregido las agendas que aparecen en la pantalla inicio, se visualiza el \\\"tipo de agendamiento\\\" por lo que no hace falta repetir lo que poniamos antes en observaciones, podemos poner cosas diferentes\",\"vencimiento\":\"2023-12-19\"}', NULL, '2023-12-19 03:26:05', '2023-12-19 03:26:05'),
