ng-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\\\">Seguidamente enviar a franco pidiendole la factura, cuando franco les envie inmediatamente se la mandan a los clientes. Se les notifica que estar\\u00e1 disponible en 48 hs h\\u00e1biles a trav\\u00e9s de este medio. El \\u00fanico medio de pago para este gremio es Transferencia al CBU de BANCO NACION de Marcelo (MUY IMPORTANTE) o tarjeta de cr\\u00e9dito. No entregar otro CBU como el de Jessi que no sea el de marcelo, no cobrar en efectivo, directamente les dicen que el convenio esta dado de alta para pagos por transferencia.<\\/p><div><br><\\/div>\",\"vencimiento\":\"2024-02-21\"}', NULL, '2024-02-21 14:12:54', '2024-02-21 14:12:54'),
