('9eb07ef0-752b-48b2-9bc8-8959febd24ad', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":413,\"sede\":\"concepcion\",\"mensaje\":\"bian, siempre que se hagan promos familiares tiene que estar la familia en grupo, si no sabe scomo en preguntas frecuentes esta como cargalos asi, por que de esa manera cuando van a renovar vos rapidamente te fijas si estan activos y quienes son sus familiares directamente. Esto es algo que hicimos hace poco por lo que hay muchos que no estaban agregados en grupo, por lo que a emdida que vayas haciendoles descuento y detectndo grupos, los vas agregando por ejemplo a la flia LOBO ayer teniamos que hacer un grupo, siempre el cabeza del grupo familiar sera el adulto, es decir a ese perfil entras a editarlo y donde dice socio individual, cambias a familiar, y abajito a la izquierda te aparece grupo familiar y te aparecera un + de ir agregando los integrantes\",\"vencimiento\":\"2024-02-20\"}', NULL, '2024-02-20 14:22:25', '2024-02-20 14:22:25'),
