('a2161424-250a-42e5-aff3-e92f5070bf8f', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 19, '{\"novedad_id\":253,\"sede\":\"concepcion\",\"mensaje\":\"-&gt; Se agrega turno a las 22:30 hs, veremos como se desenvuelve Mariano. LUCIANA: hacer una simulacion para ver si sabe vender bien y asignar el turno.<br>-&gt; Cremas: recordar que COBRIZZO es para acelerar el color, o sea un bronceado mas rapido, se recomienda en sesiones 1ra, 2da y 3ra, y EXPRESSO es para que dure mas el color (intensifica), se recomienda para fijar en las sesiones 4ta en adelante.\",\"vencimiento\":\"2023-11-14\"}', NULL, '2023-11-14 12:06:32', '2023-11-14 12:06:32'),
('a238d5c9-dbc4-4fac-8e17-42e6b930ca02', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":82,\"sede\":\"monteros\",\"mensaje\":\"PROMO BANCO NACION: Cambiaron las condiciones de la promo y paso a explicar los nuevos terminos ademas voy a poner un ejemplo para que tengan aqui el paso a paso de como realizarlo.\\r\\nSolo se puede pasar en 6 cuotas fijas y sin interes (recuerden poner el c\\u00f3digo 6 en vez de 16 en estos casos). Ya no acepta 12 cuotas y la devoluci\\u00f3n es de un 25% (ya no de 15%) hasta un tope de 3000 ( ya no de 1000)\\r\\nEl monto m\\u00e1ximo que vamos a pasar por transacci\\u00f3n es de 12000 (y se le devuelven 3000 por cada una que es el 25%).\\r\\nA\\u00d1O: Tendr\\u00e1 3 meses gratis mas 6 cuotas fijas y sin inter\\u00e9s. Pasamos  5 montos de 12000 (con c\\u00f3digo 6) y uno de 9600 )se devuelve 17400.\\r\\nSemestre: Tendr\\u00e1 casi 1 mes y medio gratis y 6 cuotas fijas y sin inter\\u00e9s. Pasamos 2 montos de 12000 y uno de 10800 y se le devolver\\u00e1 8700. Las devoluciones se hacen el primer mes, osea en el resumen de la tarjeta les saldran los pagos y las devoluciones el primer mes, como la devolucion es mas que el monto que van a pagar el primer mes les queda como saldo a favor. Me consultan por privado cualquier cosa\",\"vencimiento\":\"2023-07-28\"}', '2023-07-31 10:14:40', '2023-07-28 14:19:01', '2023-07-31 10:14:40'),
