('a8fb8639-6c5d-46d8-821c-f50ba5228de1', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":393,\"sede\":\"todas\",\"mensaje\":\"Debemos mencionar en la historia que publicamos a los ganadores del sorteo, en sede concepcion loana si puede enviarle a brisa o adrian los perfiles para que etiqueten aqui. Por otro lado tenemos que preparar las tarjetitas de quechevere, gerf y lookfit, y una bolsita de hammer para colocar y entregar una remera. Le envian todos los mensajes a los ganadores tambien, cada sede se hace cargo de los suyos, y debe pedirle a los ganadores que descarguen la aplicacion para poder recibir el premio\",\"vencimiento\":\"2024-02-05\"}', '2024-02-05 10:29:55', '2024-02-05 03:15:31', '2024-02-05 10:29:55'),
('a90e5e07-efdf-44b9-87ea-e13a668a7be1', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 13, '{\"novedad_id\":310,\"sede\":\"todas\",\"mensaje\":\"Chicos no se olvide de dejar abierta siempre la pagina web por que les deje tareas recordatorios a cada uno programados en X horarios, como recordatorios para compartir fotos, para enviar agendas, clases de pruebas, hacer kpis, ver comprobantes etc. Hicimos una inversion grande para esta actualizacion en la pagina y es para ustedes, para que lo usen como recordatorio y alarma ustedes asi que por favor usenla y dejen abierta siempre la pagina. Gracias!\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 12:57:42', '2023-12-21 12:57:42'),
