('abb40575-5d61-4823-a883-7f48636e47de', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 1, '{\"novedad_id\":393,\"sede\":\"todas\",\"mensaje\":\"Debemos mencionar en la historia que publicamos a los ganadores del sorteo, en sede concepcion loana si puede enviarle a brisa o adrian los perfiles para que etiqueten aqui. Por otro lado tenemos que preparar las tarjetitas de quechevere, gerf y lookfit, y una bolsita de hammer para colocar y entregar una remera. Le envian todos los mensajes a los ganadores tambien, cada sede se hace cargo de los suyos, y debe pedirle a los ganadores que descarguen la aplicacion para poder recibir el premio\",\"vencimiento\":\"2024-02-05\"}', NULL, '2024-02-05 03:15:31', '2024-02-05 03:15:31'),
('abb474e0-8230-4add-850f-2e4f158e9048', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 15, '{\"novedad_id\":313,\"sede\":\"todas\",\"mensaje\":\"Para hacer un descuento si o si deben estar agregados los perfiles y vinculados en un grupo familiar, no pueden hacerle la promo si no entran a su perfil y se fijan que esten activos los otros integrantes (recuerden que si no abonan el mismo dia solo se puede hacer un 10% de descuento asi sean 20, si quieren los descuentos grandes tienen que pagar juntos, si no solo le hacen el 10% a cada uno por pagar separado, pero igual deben entrar a su perfil y fijarse en \\\"GRUPO FAMILIAR\\\" acercan el raton a la fotito del otro y ahi ssale activo o inactivo, me mandan si no entienden\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 13:20:34', '2023-12-21 13:20:34'),
