('abe47e79-f751-4dc1-8e3b-e6d3ce387594', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 19, '{\"novedad_id\":180,\"sede\":\"todas\",\"mensaje\":\"<p>Les dejo info de las cremas para cabina solar:<\\/p><p>Todas estan hechas de extractos de vegetales.<br>COBRIZZO: incrementa la velocidad del bronceado en un tono \\\"tipo cobre\\\" y estimulan la produccion de colageno (cuidado de la piel). Recomendado para las tres primeras sesiones.<br>EXPRESSO: adicional a lo anterior, tambi\\u00e9n permite un bronceado m\\u00e1s duradero al fijar el color. O sea es tipo mitad para cada cosa (velocidad y duraci\\u00f3n). Recomendado para la cuarta sesi\\u00f3n en adelante.<br><br>En ambos casos se recomienda usar esto porque se logra un bronceado mas eficiente y saludable.<\\/p><p>No se deben usar otro tipo de cremas no dise\\u00f1adas para la cabina solar porque se puede bloquear todo el bronceado (en caso de usar protectores) o bien da\\u00f1ar la piel (bronceadores para sol), salvo recomendaci\\u00f3n de un dermat\\u00f3logo.<br><br><br><\\/p>\",\"vencimiento\":\"2023-09-19\"}', NULL, '2023-09-19 12:24:16', '2023-09-19 12:24:16'),
('ac30c00b-b0ea-417d-85ce-f508b84e6c90', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":237,\"sede\":\"monteros\",\"mensaje\":\"Los vencimientos de contrato esta semana, hay que agregar:<br>Adem\\u00e1s quer\\u00eda comentarte que estamos muy contentos de anunciarte que a partir de la siguiente semana este mensaje ya no sera reenviado, ya que desde hoy tenes disponible nuestra APP HAMMERX para que puedas visualizar el vencimiento de tu contrato por este medio y todas nuestras novedades!<br><br>Descargala del siguiente enlace!&nbsp;https:\\/\\/play.google.com\\/store\\/apps\\/details?id=com.hammerx&amp;hl=es_AR&amp;gl=US\",\"vencimiento\":\"2023-10-31\"}', NULL, '2023-10-31 14:47:15', '2023-10-31 14:47:15'),
