('ad07ba86-7f02-4bdd-a6b8-eb208ea3f462', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":250,\"sede\":\"todas\",\"mensaje\":\"<p>Compartir primero las historias grupales, luego las fotos de mas calidad donde se vea la persona, por ultimo las de menor calidad. NO SE COMPARTEN:<br>- Historias muy borrosas de mala calidad<\\/p><p>- Gente sin remera<\\/p><p>- Historias de otro lugar salvo que se vea la persona (por ej. compartir gente sponsoreando en otro lado, pero no compartir la merienda de la estrella porque no tenemos ese producto)<\\/p><p>- Stories repetidas subidas por distintas personas o staff<\\/p>\",\"vencimiento\":\"2023-11-10\"}', '2023-11-10 12:01:03', '2023-11-10 11:50:25', '2023-11-10 12:01:03'),
