('adac3eb3-5c7e-4890-9f6d-258914929995', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 1, '{\"novedad_id\":253,\"sede\":\"concepcion\",\"mensaje\":\"-&gt; Se agrega turno a las 22:30 hs, veremos como se desenvuelve Mariano. LUCIANA: hacer una simulacion para ver si sabe vender bien y asignar el turno.<br>-&gt; Cremas: recordar que COBRIZZO es para acelerar el color, o sea un bronceado mas rapido, se recomienda en sesiones 1ra, 2da y 3ra, y EXPRESSO es para que dure mas el color (intensifica), se recomienda para fijar en las sesiones 4ta en adelante.\",\"vencimiento\":\"2023-11-14\"}', NULL, '2023-11-14 12:06:32', '2023-11-14 12:06:32'),
('adaf45a9-b176-4892-822c-00f8d2cecd50', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 15, '{\"novedad_id\":253,\"sede\":\"concepcion\",\"mensaje\":\"-&gt; Se agrega turno a las 22:30 hs, veremos como se desenvuelve Mariano. LUCIANA: hacer una simulacion para ver si sabe vender bien y asignar el turno.<br>-&gt; Cremas: recordar que COBRIZZO es para acelerar el color, o sea un bronceado mas rapido, se recomienda en sesiones 1ra, 2da y 3ra, y EXPRESSO es para que dure mas el color (intensifica), se recomienda para fijar en las sesiones 4ta en adelante.\",\"vencimiento\":\"2023-11-14\"}', NULL, '2023-11-14 12:06:32', '2023-11-14 12:06:32'),
('adb5d286-962b-476f-a073-fe849e6526d2', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 22, '{\"novedad_id\":413,\"sede\":\"concepcion\",\"mensaje\":\"bian, siempre que se hagan promos familiares tiene que estar la familia en grupo, si no sabe scomo en preguntas frecuentes esta como cargalos asi, por que de esa manera cuando van a renovar vos rapidamente te fijas si estan activos y quienes son sus familiares directamente. Esto es algo que hicimos hace poco por lo que hay muchos que no estaban agregados en grupo, por lo que a emdida que vayas haciendoles descuento y detectndo grupos, los vas agregando por ejemplo a la flia LOBO ayer teniamos que hacer un grupo, siempre el cabeza del grupo familiar sera el adulto, es decir a ese perfil entras a editarlo y donde dice socio individual, cambias a familiar, y abajito a la izquierda te aparece grupo familiar y te aparecera un + de ir agregando los integrantes\",\"vencimiento\":\"2024-02-20\"}', NULL, '2024-02-20 14:22:26', '2024-02-20 14:22:26'),
