('b3345dd4-83d3-49fc-9c1b-de50161a7e67', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 19, '{\"novedad_id\":310,\"sede\":\"todas\",\"mensaje\":\"Chicos no se olvide de dejar abierta siempre la pagina web por que les deje tareas recordatorios a cada uno programados en X horarios, como recordatorios para compartir fotos, para enviar agendas, clases de pruebas, hacer kpis, ver comprobantes etc. Hicimos una inversion grande para esta actualizacion en la pagina y es para ustedes, para que lo usen como recordatorio y alarma ustedes asi que por favor usenla y dejen abierta siempre la pagina. Gracias!\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 12:57:42', '2023-12-21 12:57:42'),
('b33738dd-0ea2-4227-8704-e4dda3540bd8', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 20, '{\"novedad_id\":419,\"sede\":\"concepcion\",\"mensaje\":\"Volvemos el 5 de marzo con yoga con profesora DORA. Martes y jueves de 16 a 17\",\"vencimiento\":\"2024-02-21\"}', NULL, '2024-02-21 14:17:49', '2024-02-21 14:17:49'),
('b33bf433-daaf-453d-a313-a7900c4b4137', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":179,\"sede\":\"concepcion\",\"mensaje\":\"Plan de 4 veces por semana (2 a la siesta y 2 a la ma\\u00f1ana) en promo a $8.900. Pueden ofrecerlo incluso a los mismo clientes ya que la diferencia es poca con el de dos veces.\",\"vencimiento\":\"2023-09-18\"}', '2023-10-04 03:59:18', '2023-09-18 12:09:26', '2023-10-04 03:59:18'),
('b34d7aa8-c91a-4ee4-b305-afb126462721', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":312,\"sede\":\"todas\",\"mensaje\":\"Chicos tengan muchisimo cuidado con los pendientes de deuda de los planes largos, la gente realmente no puede pasarse dias despues de los 30 ya tienen que pagar, por que si no, uds los dejan pasar, ellos se hacen los boludos y pasan 15 dias mas y eso implica que yo pierda en un mes 15 % de inflacion, en medio mes mas 22% en total, y nosotros solo le recargamos un 5%, no puedo vender en cuotas asi. Si alguien no lleva el primer dia le dicen que tiene que abonar si no se le aplicara recargo por la cantidad de dias que se demore y no puede seguir pasando con deuda (es un compromiso que ellos asumieton)<br>2_ Si en algun caso alguien adelanta su plan semestral por ejemplo igual tiene que pagar a los 30 dias, si no me van a adelantar 3 meses, pagaran la priemera cuota y la segunda recien a los 4 meses, super devaluado, no funciona asi, desde el primer dia que pagan a los 30 tienen que pagar la segunda, caiga cuando caiga<br><br>PD: Estos dos casos los anoto aqui por que en Concepcion sucedieron. Muchas gracias\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 13:06:22', '2023-12-21 13:06:22'),
