('b9109ffe-df5e-4014-a72e-bc93ea616901', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":413,\"sede\":\"concepcion\",\"mensaje\":\"bian, siempre que se hagan promos familiares tiene que estar la familia en grupo, si no sabe scomo en preguntas frecuentes esta como cargalos asi, por que de esa manera cuando van a renovar vos rapidamente te fijas si estan activos y quienes son sus familiares directamente. Esto es algo que hicimos hace poco por lo que hay muchos que no estaban agregados en grupo, por lo que a emdida que vayas haciendoles descuento y detectndo grupos, los vas agregando por ejemplo a la flia LOBO ayer teniamos que hacer un grupo, siempre el cabeza del grupo familiar sera el adulto, es decir a ese perfil entras a editarlo y donde dice socio individual, cambias a familiar, y abajito a la izquierda te aparece grupo familiar y te aparecera un + de ir agregando los integrantes\",\"vencimiento\":\"2024-02-20\"}', NULL, '2024-02-20 14:22:25', '2024-02-20 14:22:25'),
('b9389748-cce9-487a-9190-5548892e8834', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":250,\"sede\":\"todas\",\"mensaje\":\"<p>Compartir primero las historias grupales, luego las fotos de mas calidad donde se vea la persona, por ultimo las de menor calidad. NO SE COMPARTEN:<br>- Historias muy borrosas de mala calidad<\\/p><p>- Gente sin remera<\\/p><p>- Historias de otro lugar salvo que se vea la persona (por ej. compartir gente sponsoreando en otro lado, pero no compartir la merienda de la estrella porque no tenemos ese producto)<\\/p><p>- Stories repetidas subidas por distintas personas o staff<\\/p>\",\"vencimiento\":\"2023-11-10\"}', NULL, '2023-11-10 11:50:25', '2023-11-10 11:50:25'),
