('bd8b66f3-5279-4f86-a651-ebcc47027f85', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 18, '{\"novedad_id\":444,\"sede\":\"concepcion\",\"mensaje\":\"Buenas tardes Bian. Estoy cerrando el mes de febrero, si podes cuando abones siempre a los chicos entra antes a sus perfiles para ver si tienen que saldar algun prodcuto, en realidad eso es diario. Creo que ahora tenia un producto cargado ale diaz y ramon y bueno vos tb tenes que ir saldandola a la tuya\",\"vencimiento\":\"2024-03-06\"}', '2024-03-07 20:08:26', '2024-03-06 12:52:41', '2024-03-07 20:08:26'),
('bdd50687-7b26-479a-8b1a-660ccf96887c', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 19, '{\"novedad_id\":413,\"sede\":\"concepcion\",\"mensaje\":\"bian, siempre que se hagan promos familiares tiene que estar la familia en grupo, si no sabe scomo en preguntas frecuentes esta como cargalos asi, por que de esa manera cuando van a renovar vos rapidamente te fijas si estan activos y quienes son sus familiares directamente. Esto es algo que hicimos hace poco por lo que hay muchos que no estaban agregados en grupo, por lo que a emdida que vayas haciendoles descuento y detectndo grupos, los vas agregando por ejemplo a la flia LOBO ayer teniamos que hacer un grupo, siempre el cabeza del grupo familiar sera el adulto, es decir a ese perfil entras a editarlo y donde dice socio individual, cambias a familiar, y abajito a la izquierda te aparece grupo familiar y te aparecera un + de ir agregando los integrantes\",\"vencimiento\":\"2024-02-20\"}', NULL, '2024-02-20 14:22:25', '2024-02-20 14:22:25'),
