('c19c8334-8907-4599-9bc9-2001af577ec8', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":220,\"sede\":\"concepcion\",\"mensaje\":\"Continuamos con yoga la semana que viene con la Profe Dora, martes jeuves 16 hs\",\"vencimiento\":\"2023-10-10\"}', NULL, '2023-10-10 13:31:05', '2023-10-10 13:31:05'),
('c1db0fc9-80af-4f3b-9529-8fc82e4f3876', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 19, '{\"novedad_id\":210,\"sede\":\"todas\",\"mensaje\":\"Chicos es una novedad para probar las funciones de una nueva actualizaci\\u00f3n del sistema, solo pongan leer para comprobar que todo sigue funciondo bien\",\"vencimiento\":\"2023-10-04\"}', NULL, '2023-10-04 04:06:33', '2023-10-04 04:06:33'),
