('c2178e92-b3a5-4939-ab36-b94d23517427', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 14, '{\"novedad_id\":302,\"sede\":\"todas\",\"mensaje\":\"Ya se encuentra corregido las agendas que aparecen en la pantalla inicio, se visualiza el \\\"tipo de agendamiento\\\" por lo que no hace falta repetir lo que poniamos antes en observaciones, podemos poner cosas diferentes\",\"vencimiento\":\"2023-12-19\"}', NULL, '2023-12-19 03:26:05', '2023-12-19 03:26:05'),
('c225d947-7127-4d5a-b246-2801dd7804e0', 'App\\Notifications\\NewLead', 'App\\Models\\User', 4, '{\"lead_id\":48,\"name\":\"Felipe\",\"celular\":\"3865437814\",\"sede\":\"concepcion\",\"fecha\":\"2024-02-08T02:01:56.000000Z\"}', NULL, '2024-02-08 02:01:56', '2024-02-08 02:01:56'),
('c2260fca-55be-4db3-90bf-e36df278e2a0', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":313,\"sede\":\"todas\",\"mensaje\":\"Para hacer un descuento si o si deben estar agregados los perfiles y vinculados en un grupo familiar, no pueden hacerle la promo si no entran a su perfil y se fijan que esten activos los otros integrantes (recuerden que si no abonan el mismo dia solo se puede hacer un 10% de descuento asi sean 20, si quieren los descuentos grandes tienen que pagar juntos, si no solo le hacen el 10% a cada uno por pagar separado, pero igual deben entrar a su perfil y fijarse en \\\"GRUPO FAMILIAR\\\" acercan el raton a la fotito del otro y ahi ssale activo o inactivo, me mandan si no entienden\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 13:20:34', '2023-12-21 13:20:34'),
('c22dd9e5-19a2-4172-99c3-146dfef6b676', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 3, '{\"novedad_id\":235,\"sede\":\"todas\",\"mensaje\":\"Ya esta disponible la nueva APP de hammer. El beneficio que tiene la gente por ahora es poder visualizar su vencimiento de contrato (ya dejaremos de mandar los mensajes la semana que viene asi le explican a la gente). Van a poder renovar desde ahi e ir directamente a pagar en el gym. proximamente vamos a cargar rutinas y van a participar en competencias por premios\",\"vencimiento\":\"2023-10-31\"}', NULL, '2023-10-31 13:52:59', '2023-10-31 13:52:59'),
('c23d1c11-7412-4f4e-9139-27912b23e046', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 22, '{\"novedad_id\":444,\"sede\":\"concepcion\",\"mensaje\":\"Buenas tardes Bian. Estoy cerrando el mes de febrero, si podes cuando abones siempre a los chicos entra antes a sus perfiles para ver si tienen que saldar algun prodcuto, en realidad eso es diario. Creo que ahora tenia un producto cargado ale diaz y ramon y bueno vos tb tenes que ir saldandola a la tuya\",\"vencimiento\":\"2024-03-06\"}', '2024-03-08 16:51:40', '2024-03-06 12:52:41', '2024-03-08 16:51:40'),
('c2cac65f-da9b-446c-ba2c-c22f2a852d54', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":313,\"sede\":\"todas\",\"mensaje\":\"Para hacer un descuento si o si deben estar agregados los perfiles y vinculados en un grupo familiar, no pueden hacerle la promo si no entran a su perfil y se fijan que esten activos los otros integrantes (recuerden que si no abonan el mismo dia solo se puede hacer un 10% de descuento asi sean 20, si quieren los descuentos grandes tienen que pagar juntos, si no solo le hacen el 10% a cada uno por pagar separado, pero igual deben entrar a su perfil y fijarse en \\\"GRUPO FAMILIAR\\\" acercan el raton a la fotito del otro y ahi ssale activo o inactivo, me mandan si no entienden\",\"vencimiento\":\"2023-12-21\"}', '2023-12-21 14:39:21', '2023-12-21 13:20:34', '2023-12-21 14:39:21'),
