('cae62089-0880-4c6a-9a47-9e6f1b11c5b8', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 14, '{\"novedad_id\":440,\"sede\":\"concepcion\",\"mensaje\":\"Los papas de las clases de kids deben esperar abajo, tienen para sentarse y esperarlos, no puede pasar nadie por el molinete sin acceso, les notifican por favor, camila ya esta notificada tambien\",\"vencimiento\":\"2024-03-05\"}', NULL, '2024-03-05 13:41:20', '2024-03-05 13:41:20'),
('caedfc3e-5304-45c1-b475-8df4f85cdb86', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":390,\"sede\":\"todas\",\"mensaje\":\"Activamos una promo donde las personas pagaran 3 meses y le cargaremos cuatro, osea le regalamos un mes. Como tienen que pagar, desde su app BNA + es decir banco nacion, entran a \\\"MODO\\\", modo es un modo de pago que tiene el banco nacion donde en su cuenta vinculan sus tarjetas, entonces es como que pueden pagar con tarjeta pero desde su celu, no es necesaria la tarjeta fisica, pero como se la pasa por el posnet? Con un codigo QR, que se genera entrando a ventas, y dice generar codigo qr, me avisan si no lo encuentran. Ahora el monto maximo que pueden pasar por cada pago es de 12mil, por lo que uds tienen que hacer es calcular el pago total por ejemplo, en monteros sale 12400 x 4 = 49600 que es lo que tenemos que cobrarle (el mes que se le regala le regala el banco luego cuando le llega el resumen de su tarjeta, nosotros cobramos normal los 4 meses). Pero como podemos solo hacer cobros de 12000 tenemos que hacer 3 cobros de 12 mil (36mil) + un cobro de 13600 (ahi estarian en total los 49600). El codigo que tienen que usar siempre es 6 en este caso (no el 16), solo con el codigo qr usan el 6.<br><br>Obviamente tienen que explicarle a la gente que el mes que se le regala es en el resumen luego.\",\"vencimiento\":\"2024-02-02\"}', NULL, '2024-02-02 16:20:41', '2024-02-02 16:20:41'),
('cb0ced6d-2baf-4945-985f-93dbd485beb0', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 13, '{\"novedad_id\":277,\"sede\":\"todas\",\"mensaje\":\"<p>Se modifica, ya no se aplica a aquellos que pagan con tarjeta de credito en posnet en \\\"MODO\\\" del banco nacion. Les dejo un link del video de como deberian hacer las personas&nbsp;<a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=xhDJ0ZLyW-I\\\" target=\\\"_blank\\\">https:\\/\\/www.youtube.com\\/watch?v=xhDJ0ZLyW-I<\\/a>&nbsp;<br>Durante la semana se pondran los codigos QR en el gym<\\/p>\",\"vencimiento\":\"2023-11-30\"}', NULL, '2023-11-30 15:16:16', '2023-11-30 15:16:16'),
('cb17daff-41a9-40e1-8b01-96d19d1fc328', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 20, '{\"novedad_id\":445,\"sede\":\"monteros\",\"mensaje\":\"buenas tardes jess. Cuando abones los sueldos en el dia a dia entra a los perfiles de los chicos por favor y siempre saldale las deudas que tengan con el pago del dia. Ahora tienen benja y enzo creeria\",\"vencimiento\":\"2024-03-06\"}', NULL, '2024-03-06 13:07:48', '2024-03-06 13:07:48'),
