('d03c327b-57d3-460e-9b17-754a50e91dad', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":419,\"sede\":\"concepcion\",\"mensaje\":\"Volvemos el 5 de marzo con yoga con profesora DORA. Martes y jueves de 16 a 17\",\"vencimiento\":\"2024-02-21\"}', '2024-02-21 15:09:46', '2024-02-21 14:17:49', '2024-02-21 15:09:46'),
('d03cd695-ea33-48cc-8059-c1fdcb0ccf0b', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 14, '{\"novedad_id\":312,\"sede\":\"todas\",\"mensaje\":\"Chicos tengan muchisimo cuidado con los pendientes de deuda de los planes largos, la gente realmente no puede pasarse dias despues de los 30 ya tienen que pagar, por que si no, uds los dejan pasar, ellos se hacen los boludos y pasan 15 dias mas y eso implica que yo pierda en un mes 15 % de inflacion, en medio mes mas 22% en total, y nosotros solo le recargamos un 5%, no puedo vender en cuotas asi. Si alguien no lleva el primer dia le dicen que tiene que abonar si no se le aplicara recargo por la cantidad de dias que se demore y no puede seguir pasando con deuda (es un compromiso que ellos asumieton)<br>2_ Si en algun caso alguien adelanta su plan semestral por ejemplo igual tiene que pagar a los 30 dias, si no me van a adelantar 3 meses, pagaran la priemera cuota y la segunda recien a los 4 meses, super devaluado, no funciona asi, desde el primer dia que pagan a los 30 tienen que pagar la segunda, caiga cuando caiga<br><br>PD: Estos dos casos los anoto aqui por que en Concepcion sucedieron. Muchas gracias\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 13:06:22', '2023-12-21 13:06:22'),
