('d0650ba6-e92d-40b3-bd80-e2cb59eb297d', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 3, '{\"novedad_id\":82,\"sede\":\"monteros\",\"mensaje\":\"PROMO BANCO NACION: Cambiaron las condiciones de la promo y paso a explicar los nuevos terminos ademas voy a poner un ejemplo para que tengan aqui el paso a paso de como realizarlo.\\r\\nSolo se puede pasar en 6 cuotas fijas y sin interes (recuerden poner el c\\u00f3digo 6 en vez de 16 en estos casos). Ya no acepta 12 cuotas y la devoluci\\u00f3n es de un 25% (ya no de 15%) hasta un tope de 3000 ( ya no de 1000)\\r\\nEl monto m\\u00e1ximo que vamos a pasar por transacci\\u00f3n es de 12000 (y se le devuelven 3000 por cada una que es el 25%).\\r\\nA\\u00d1O: Tendr\\u00e1 3 meses gratis mas 6 cuotas fijas y sin inter\\u00e9s. Pasamos  5 montos de 12000 (con c\\u00f3digo 6) y uno de 9600 )se devuelve 17400.\\r\\nSemestre: Tendr\\u00e1 casi 1 mes y medio gratis y 6 cuotas fijas y sin inter\\u00e9s. Pasamos 2 montos de 12000 y uno de 10800 y se le devolver\\u00e1 8700. Las devoluciones se hacen el primer mes, osea en el resumen de la tarjeta les saldran los pagos y las devoluciones el primer mes, como la devolucion es mas que el monto que van a pagar el primer mes les queda como saldo a favor. Me consultan por privado cualquier cosa\",\"vencimiento\":\"2023-07-28\"}', '2023-07-28 14:27:18', '2023-07-28 14:19:01', '2023-07-28 14:27:18'),
('d07a62ce-518f-4259-b82d-22363b224673', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 12, '{\"novedad_id\":344,\"sede\":\"concepcion\",\"mensaje\":\"Ya les hice el cobro, falta hacerle el cobro de los 10 mil de interes nada mas, 5m il por persona, cuando te paguen cobrales desde el perfil de medina santiago, en grupos familiares siempre a la cabeza de la flia le salen las deudas de los demas\",\"vencimiento\":\"2024-01-09\"}', NULL, '2024-01-09 13:05:45', '2024-01-09 13:05:45'),
('d08c78a9-693a-43a2-befd-360a4216f4c9', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":85,\"sede\":\"monteros\",\"mensaje\":\"La semana que viene se actualizan precios:\\r\\nMusculaci\\u00f3n 6600\\r\\nclases grupales 5500\\r\\npilates a confirmar\\r\\nLa promo de BNA: Pasaran 3 montos de 12mil y uno de 3600 en el semestre, por lo que se le devuelve a los clientes 9900 . A\\u00d1O: 6 montos de 12 mil y uno de 7200 en el a\\u00f1o, se le devuelve a los clientes 19800 (me consultan bien cualquier cosa) esta promo es solo hasta fin de mes, les confirmamos si se actualizan y siguen igual el mes que viene.\",\"vencimiento\":\"2023-08-01\"}', '2023-08-11 03:03:20', '2023-08-01 12:24:17', '2023-08-11 03:03:20'),
