('d17107eb-09ce-400b-8d1a-4504a8f795d0', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 18, '{\"novedad_id\":311,\"sede\":\"todas\",\"mensaje\":\"Tema remeras:<br>1_ Todas las perchas colgadas tienen que estar ennumeradas con un felpon o algo<br>2_ Todas las perchas colgadas siempre tienen que tener una remera, lo que haremos es poner una de cada modelo y talle y sexo, cada vez que vendan una, buscan en las cajas la misma para reponer (si se acaban me avisan asi llevo mas de esa)<br>3_ Todas las remeras colgadas tienen que tener una cinta de papel si es de hombre o mujer y separamos a la derecha hombre izquierda mujer con un espacio en el medio, siempre que&nbsp; cuelguen una le ponen la cinta (al finalizar cada turno, asi ayudamos tambien a su compa\\u00f1ero a que cuenta facilmente)&nbsp;<br>4_ El resto de remeras repetidas quedara en la caja, estas ya tienen su cinta especificando de que son\",\"vencimiento\":\"2023-12-21\"}', '2023-12-21 18:20:16', '2023-12-21 13:01:53', '2023-12-21 18:20:16'),
('d1721c5f-6ebd-475d-b388-0bc2ba923181', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 1, '{\"novedad_id\":330,\"sede\":\"todas\",\"mensaje\":\"A veces sucede que cuando seleccionan las fechas manualmente larga error, en este caso seleccionen las fechas desde el botoncito de calendario\",\"vencimiento\":\"2024-01-02\"}', NULL, '2024-01-02 13:05:10', '2024-01-02 13:05:10'),
