('d1b968c8-06fe-4f4f-aa00-d456e24fdea1', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 13, '{\"novedad_id\":85,\"sede\":\"monteros\",\"mensaje\":\"La semana que viene se actualizan precios:\\r\\nMusculaci\\u00f3n 6600\\r\\nclases grupales 5500\\r\\npilates a confirmar\\r\\nLa promo de BNA: Pasaran 3 montos de 12mil y uno de 3600 en el semestre, por lo que se le devuelve a los clientes 9900 . A\\u00d1O: 6 montos de 12 mil y uno de 7200 en el a\\u00f1o, se le devuelve a los clientes 19800 (me consultan bien cualquier cosa) esta promo es solo hasta fin de mes, les confirmamos si se actualizan y siguen igual el mes que viene.\",\"vencimiento\":\"2023-08-01\"}', '2023-08-24 19:10:10', '2023-08-01 12:24:18', '2023-08-24 19:10:10'),
