('d204456a-eb51-4429-8d3a-95dbf269191f', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 14, '{\"novedad_id\":275,\"sede\":\"concepcion\",\"mensaje\":\"El sabado iran a fumigar a las 6 menos 15\",\"vencimiento\":\"2023-11-28\"}', NULL, '2023-11-28 13:43:52', '2023-11-28 13:43:52'),
