('d828188f-e37a-471f-b85c-26a02b1058c3', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":301,\"sede\":\"concepcion\",\"mensaje\":\"No olviden que un cliente que no permita pasar el molinete por que tiene el contrato de cabina, es necesario que le venzan el mismo y le vayan activando cada vez que quiera hacer una sesion, por otro lado, no olviden vencer los contratos de cabina que ya se gastaron\",\"vencimiento\":\"2023-12-18\"}', NULL, '2023-12-18 12:43:20', '2023-12-18 12:43:20'),
('d861c409-4aa3-43bf-a6a9-a28b10fc2c56', 'App\\Notifications\\NewCv', 'App\\Models\\User', 21, '{\"postulante_id\":77,\"name\":\"Carlos Maximiliano Barrionuevo\",\"celular\":\"3814477948\",\"edad\":\"28\",\"puesto\":\"recepcionista\",\"sede\":\"monteros\"}', NULL, '2024-03-14 11:17:43', '2024-03-14 11:17:43'),
('d87be0f6-e514-4cc5-b010-ea6f33985f54', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 18, '{\"novedad_id\":134,\"sede\":\"monteros\",\"mensaje\":\"<p>POST EVENTO: Acomodar todas las cosas, dejar luces en oscar, guardar bandera, ornamentacion, bajar mesa de dj, acomodar prensa, banderin, cable dj, vasos, todo lo que haya a la bolsa negra y guardar en deposito.<br>Hacer papelitos con todos los uqe compartieron la historia y ponerlos dentro de la caja y hacer el&nbsp; sorteo, esta ma\\u00f1ana lo sorteamos. Tiene que haber un ganador para:<br>Zapatillas de GERF<br>Remera de hammer (si no hay talle se le da un mensual)<br>Cerveza de cb + cortes de pelo<br>Meriendas de Roma<br>No se si participo la rocio carrizo tambien&nbsp;<br>Trabajar en conjunto con nazareno para que les haga el flyer que diga GANADORES SORTEO ANIVERSARIO y abajo cada uno de los premios (etiquetar al local) y etiquetar al ganador en el costado.<br><\\/p>\",\"vencimiento\":\"2023-08-23\"}', '2023-08-25 19:24:30', '2023-08-23 05:16:36', '2023-08-25 19:24:30'),
