('d8d3f3f8-4519-4981-a1d9-58b150adcb98', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":179,\"sede\":\"concepcion\",\"mensaje\":\"Plan de 4 veces por semana (2 a la siesta y 2 a la ma\\u00f1ana) en promo a $8.900. Pueden ofrecerlo incluso a los mismo clientes ya que la diferencia es poca con el de dos veces.\",\"vencimiento\":\"2023-09-18\"}', '2023-10-06 14:32:30', '2023-09-18 12:09:26', '2023-10-06 14:32:30'),
