('d8ff5b39-73ea-4bfb-8deb-b1cb4ea46735', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 21, '{\"novedad_id\":393,\"sede\":\"todas\",\"mensaje\":\"Debemos mencionar en la historia que publicamos a los ganadores del sorteo, en sede concepcion loana si puede enviarle a brisa o adrian los perfiles para que etiqueten aqui. Por otro lado tenemos que preparar las tarjetitas de quechevere, gerf y lookfit, y una bolsita de hammer para colocar y entregar una remera. Le envian todos los mensajes a los ganadores tambien, cada sede se hace cargo de los suyos, y debe pedirle a los ganadores que descarguen la aplicacion para poder recibir el premio\",\"vencimiento\":\"2024-02-05\"}', NULL, '2024-02-05 03:15:31', '2024-02-05 03:15:31'),
('d919cf0f-3f9f-41db-8177-0f483f285e4b', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":298,\"sede\":\"todas\",\"mensaje\":\"Estan disponibles en recepci\\u00f3n, faltan las entradas VIP de Concepcion (pulseras) \\u00fanicamente, pero pueden ir vendiendo desde el perfil en sistema ya que figuran dentro de productos como FIESTA HAMMER CATERING (son las vips) y FIESTA HAMMER (las comunes). En caso que vendan a un no socio lo venden desde el perfil de Hammer (DNI: 8.888.888) con la observaci\\u00f3n del nombre de a quien le venden, sobre todo las vips ya que haremos lista.<br>\",\"vencimiento\":\"2023-12-11\"}', NULL, '2023-12-11 11:36:58', '2023-12-11 11:36:58'),
('d92bafec-104a-4d77-95af-f4c6516182e6', 'App\\Notifications\\NewLead', 'App\\Models\\User', 14, '{\"lead_id\":35,\"name\":\"rosario Bel\\u00e9n\",\"celular\":\"3815433111\",\"sede\":\"concepcion\",\"fecha\":\"2023-09-03T23:15:14.000000Z\"}', NULL, '2023-09-03 23:15:15', '2023-09-03 23:15:15'),
('d948bbd8-fe4c-4c0c-8411-2d6f2db4931c', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 19, '{\"novedad_id\":393,\"sede\":\"todas\",\"mensaje\":\"Debemos mencionar en la historia que publicamos a los ganadores del sorteo, en sede concepcion loana si puede enviarle a brisa o adrian los perfiles para que etiqueten aqui. Por otro lado tenemos que preparar las tarjetitas de quechevere, gerf y lookfit, y una bolsita de hammer para colocar y entregar una remera. Le envian todos los mensajes a los ganadores tambien, cada sede se hace cargo de los suyos, y debe pedirle a los ganadores que descarguen la aplicacion para poder recibir el premio\",\"vencimiento\":\"2024-02-05\"}', NULL, '2024-02-05 03:15:31', '2024-02-05 03:15:31'),
('d95ea803-1793-48d4-b8c3-048bfd7caa27', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":184,\"sede\":\"concepcion\",\"mensaje\":\"Organizar para que el turno ma\\u00f1ana complete los correos electronicos de las personas que estan inscriptas en estos ultimos 3 meses (aprox 300), hacer unos 20 por d\\u00eda e ir pasando para otra caja.\",\"vencimiento\":\"2023-09-20\"}', NULL, '2023-09-20 12:10:05', '2023-09-20 12:10:05'),
('d973cf3a-2df4-4868-bead-6fa71d51aa47', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":245,\"sede\":\"todas\",\"mensaje\":\"<span class=\\\"selectable-text copyable-text\\\">Se agrega <b>CONSULTAS DE INACTIVOS<\\/b>, para cuando venga un exsocio por mostrador o mande msj y le hagan una agenda, ya que no ten\\u00edamos como registrar eso porque solo registrabamos las CONSULTAS NUEVOS y los EXSOCIOS (inactivos) que agendabamos por protocolo de msj (30-60-90 d\\u00edas), en este caso la columna de CONSULTAS DE INACTIVOS es para cualquier tipo de exsocio que quiera volver por INICIATIVA PROPIA y pacte un d\\u00eda y le hagan una agenda para mas tarde o para los d\\u00edas futuros, o sea si vuelve en el momento no lo anoten.<\\/span>\",\"vencimiento\":\"2023-11-06\"}', NULL, '2023-11-06 12:59:56', '2023-11-06 12:59:56'),
