('e0011015-3bfa-4752-bbb0-bfae2db40b8e', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":390,\"sede\":\"todas\",\"mensaje\":\"Activamos una promo donde las personas pagaran 3 meses y le cargaremos cuatro, osea le regalamos un mes. Como tienen que pagar, desde su app BNA + es decir banco nacion, entran a \\\"MODO\\\", modo es un modo de pago que tiene el banco nacion donde en su cuenta vinculan sus tarjetas, entonces es como que pueden pagar con tarjeta pero desde su celu, no es necesaria la tarjeta fisica, pero como se la pasa por el posnet? Con un codigo QR, que se genera entrando a ventas, y dice generar codigo qr, me avisan si no lo encuentran. Ahora el monto maximo que pueden pasar por cada pago es de 12mil, por lo que uds tienen que hacer es calcular el pago total por ejemplo, en monteros sale 12400 x 4 = 49600 que es lo que tenemos que cobrarle (el mes que se le regala le regala el banco luego cuando le llega el resumen de su tarjeta, nosotros cobramos normal los 4 meses). Pero como podemos solo hacer cobros de 12000 tenemos que hacer 3 cobros de 12 mil (36mil) + un cobro de 13600 (ahi estarian en total los 49600). El codigo que tienen que usar siempre es 6 en este caso (no el 16), solo con el codigo qr usan el 6.<br><br>Obviamente tienen que explicarle a la gente que el mes que se le regala es en el resumen luego.\",\"vencimiento\":\"2024-02-02\"}', NULL, '2024-02-02 16:20:41', '2024-02-02 16:20:41'),
('e0042dbb-b16a-4b84-a1da-ce7eff995825', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":74,\"sede\":\"monteros\",\"mensaje\":\"PROMOCION BANCO NACION: A partir de esta semana largamos el convenio de banco nacion con tarjeta de cr\\u00e9dito (solo apto para tarjetas de credito banco nacion)\\r\\n\\r\\nComo es? SEMESTRE: Deben realizar el cobro del plan que carguen, semestre (solo es valido para semestres y anuales) en 4 montos de 6700 y uno de 8000 (son 5 recibos en total y suman los 34800)\\r\\nANUAL: Deben realizar el cobro del plan anual en 9 pagos de 6700 y uno de 9300. (69300 en total). \\r\\nCODIGO: 6 y 12, no usan los de ahora 12 que eran el 16 y 13, usan los codigos comunes, pero tengan cuidado que solo se puede hacer dia jueves y con tarjeta de credito de banco nacion.\\r\\nPor que hacemos los cobros asi? Por cada 6700 que nosotros cobramos, se le devuelven 1000 a los clientes, por lo que en el semestre al hacerlo en 5 pagos se le devuelve 5000 y en el anual 10000 porlo que para venderlos le dicen que ademas de las cuotas fijas y sin interes se le reintegran esos montos, es un poco engorroso hacer tantos cobros pero bueno. Esas devoluciones les llegaran en sus resumenes a fin de mes.\\r\\n\\r\\nMe consultan cualquier cosa\",\"vencimiento\":\"2023-07-18\"}', '2023-07-18 22:32:47', '2023-07-18 19:00:29', '2023-07-18 22:32:47'),
