('e3e8f2e9-d34f-4f72-a34d-0b8d27602de5', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":82,\"sede\":\"monteros\",\"mensaje\":\"PROMO BANCO NACION: Cambiaron las condiciones de la promo y paso a explicar los nuevos terminos ademas voy a poner un ejemplo para que tengan aqui el paso a paso de como realizarlo.\\r\\nSolo se puede pasar en 6 cuotas fijas y sin interes (recuerden poner el c\\u00f3digo 6 en vez de 16 en estos casos). Ya no acepta 12 cuotas y la devoluci\\u00f3n es de un 25% (ya no de 15%) hasta un tope de 3000 ( ya no de 1000)\\r\\nEl monto m\\u00e1ximo que vamos a pasar por transacci\\u00f3n es de 12000 (y se le devuelven 3000 por cada una que es el 25%).\\r\\nA\\u00d1O: Tendr\\u00e1 3 meses gratis mas 6 cuotas fijas y sin inter\\u00e9s. Pasamos  5 montos de 12000 (con c\\u00f3digo 6) y uno de 9600 )se devuelve 17400.\\r\\nSemestre: Tendr\\u00e1 casi 1 mes y medio gratis y 6 cuotas fijas y sin inter\\u00e9s. Pasamos 2 montos de 12000 y uno de 10800 y se le devolver\\u00e1 8700. Las devoluciones se hacen el primer mes, osea en el resumen de la tarjeta les saldran los pagos y las devoluciones el primer mes, como la devolucion es mas que el monto que van a pagar el primer mes les queda como saldo a favor. Me consultan por privado cualquier cosa\",\"vencimiento\":\"2023-07-28\"}', '2023-10-06 14:32:31', '2023-07-28 14:19:01', '2023-10-06 14:32:31'),
