('e645f99b-1a46-44f8-a141-729b3bd5023f', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 15, '{\"novedad_id\":311,\"sede\":\"todas\",\"mensaje\":\"Tema remeras:<br>1_ Todas las perchas colgadas tienen que estar ennumeradas con un felpon o algo<br>2_ Todas las perchas colgadas siempre tienen que tener una remera, lo que haremos es poner una de cada modelo y talle y sexo, cada vez que vendan una, buscan en las cajas la misma para reponer (si se acaban me avisan asi llevo mas de esa)<br>3_ Todas las remeras colgadas tienen que tener una cinta de papel si es de hombre o mujer y separamos a la derecha hombre izquierda mujer con un espacio en el medio, siempre que&nbsp; cuelguen una le ponen la cinta (al finalizar cada turno, asi ayudamos tambien a su compa\\u00f1ero a que cuenta facilmente)&nbsp;<br>4_ El resto de remeras repetidas quedara en la caja, estas ya tienen su cinta especificando de que son\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 13:01:53', '2023-12-21 13:01:53'),
