('e6a5e424-1ffe-4456-afd5-b10437eae0a1', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 12, '{\"novedad_id\":245,\"sede\":\"todas\",\"mensaje\":\"<span class=\\\"selectable-text copyable-text\\\">Se agrega <b>CONSULTAS DE INACTIVOS<\\/b>, para cuando venga un exsocio por mostrador o mande msj y le hagan una agenda, ya que no ten\\u00edamos como registrar eso porque solo registrabamos las CONSULTAS NUEVOS y los EXSOCIOS (inactivos) que agendabamos por protocolo de msj (30-60-90 d\\u00edas), en este caso la columna de CONSULTAS DE INACTIVOS es para cualquier tipo de exsocio que quiera volver por INICIATIVA PROPIA y pacte un d\\u00eda y le hagan una agenda para mas tarde o para los d\\u00edas futuros, o sea si vuelve en el momento no lo anoten.<\\/span>\",\"vencimiento\":\"2023-11-06\"}', NULL, '2023-11-06 12:59:56', '2023-11-06 12:59:56'),
('e6f6713b-c101-406e-a826-fb96d0c45cea', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 3, '{\"novedad_id\":310,\"sede\":\"todas\",\"mensaje\":\"Chicos no se olvide de dejar abierta siempre la pagina web por que les deje tareas recordatorios a cada uno programados en X horarios, como recordatorios para compartir fotos, para enviar agendas, clases de pruebas, hacer kpis, ver comprobantes etc. Hicimos una inversion grande para esta actualizacion en la pagina y es para ustedes, para que lo usen como recordatorio y alarma ustedes asi que por favor usenla y dejen abierta siempre la pagina. Gracias!\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 12:57:42', '2023-12-21 12:57:42'),
('e711e920-4bb4-440e-b4e3-a8ea089ddd03', 'App\\Notifications\\NewCv', 'App\\Models\\User', 21, '{\"postulante_id\":88,\"name\":\"Helena Sarmiento Abaca\",\"celular\":\"3865714289\",\"edad\":\"18\",\"puesto\":\"recepcionista\",\"sede\":\"concepcion\"}', NULL, '2024-03-14 21:26:26', '2024-03-14 21:26:26'),
('e75afcac-b784-4b2b-8279-91158b594bc0', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 1, '{\"novedad_id\":312,\"sede\":\"todas\",\"mensaje\":\"Chicos tengan muchisimo cuidado con los pendientes de deuda de los planes largos, la gente realmente no puede pasarse dias despues de los 30 ya tienen que pagar, por que si no, uds los dejan pasar, ellos se hacen los boludos y pasan 15 dias mas y eso implica que yo pierda en un mes 15 % de inflacion, en medio mes mas 22% en total, y nosotros solo le recargamos un 5%, no puedo vender en cuotas asi. Si alguien no lleva el primer dia le dicen que tiene que abonar si no se le aplicara recargo por la cantidad de dias que se demore y no puede seguir pasando con deuda (es un compromiso que ellos asumieton)<br>2_ Si en algun caso alguien adelanta su plan semestral por ejemplo igual tiene que pagar a los 30 dias, si no me van a adelantar 3 meses, pagaran la priemera cuota y la segunda recien a los 4 meses, super devaluado, no funciona asi, desde el primer dia que pagan a los 30 tienen que pagar la segunda, caiga cuando caiga<br><br>PD: Estos dos casos los anoto aqui por que en Concepcion sucedieron. Muchas gracias\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 13:06:22', '2023-12-21 13:06:22'),
