('f04e493a-f851-43c4-82e3-9bf5317b863c', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 14, '{\"novedad_id\":250,\"sede\":\"todas\",\"mensaje\":\"<p>Compartir primero las historias grupales, luego las fotos de mas calidad donde se vea la persona, por ultimo las de menor calidad. NO SE COMPARTEN:<br>- Historias muy borrosas de mala calidad<\\/p><p>- Gente sin remera<\\/p><p>- Historias de otro lugar salvo que se vea la persona (por ej. compartir gente sponsoreando en otro lado, pero no compartir la merienda de la estrella porque no tenemos ese producto)<\\/p><p>- Stories repetidas subidas por distintas personas o staff<\\/p>\",\"vencimiento\":\"2023-11-10\"}', NULL, '2023-11-10 11:50:25', '2023-11-10 11:50:25'),
