('f229f39e-9318-4df2-a86a-435561fb969e', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":253,\"sede\":\"concepcion\",\"mensaje\":\"-&gt; Se agrega turno a las 22:30 hs, veremos como se desenvuelve Mariano. LUCIANA: hacer una simulacion para ver si sabe vender bien y asignar el turno.<br>-&gt; Cremas: recordar que COBRIZZO es para acelerar el color, o sea un bronceado mas rapido, se recomienda en sesiones 1ra, 2da y 3ra, y EXPRESSO es para que dure mas el color (intensifica), se recomienda para fijar en las sesiones 4ta en adelante.\",\"vencimiento\":\"2023-11-14\"}', NULL, '2023-11-14 12:06:32', '2023-11-14 12:06:32'),
