('f25dd0a3-7b22-468e-87c6-07a047b0d3b6', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 12, '{\"novedad_id\":174,\"sede\":\"concepcion\",\"mensaje\":\"Se esta promocionando el video de Loana \\u00fanicamente para Concepci\\u00f3n y alrededores. La gente usar\\u00e1 el contacto por facebook messenger, por whatsapp (tienen el boton en la publicacion) o por comentarios, a esto ultimo Irina debe ingresar cada d\\u00eda y contestar los msjs generales (ubicacion, horarios), y los que sean info o precio se pone RESPONDIDO POR MD. La promo estar vigente por una semana. Proceder normalmente derivando a Irina los prospectos, pero estar\\u00eda bueno ir anotando cuantas personas se contactaron y los nombres para saber bien el resultado de la campa\\u00f1a. Armen una hojita donde puedan anotar todo: FECHA, NOMBRE, MEDIO DE CONTACTO, unicamente a la gente que provenga de esta campa\\u00f1a\",\"vencimiento\":\"2023-09-13\"}', NULL, '2023-09-13 16:28:00', '2023-09-13 16:28:00'),
('f27cae1d-3ba3-4875-be4a-3e5a03acdbd0', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":184,\"sede\":\"concepcion\",\"mensaje\":\"Organizar para que el turno ma\\u00f1ana complete los correos electronicos de las personas que estan inscriptas en estos ultimos 3 meses (aprox 300), hacer unos 20 por d\\u00eda e ir pasando para otra caja.\",\"vencimiento\":\"2023-09-20\"}', '2023-09-20 14:29:58', '2023-09-20 12:10:05', '2023-09-20 14:29:58'),
