('f73b6ceb-0016-4b64-aa44-b20d38924727', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":377,\"sede\":\"concepcion\",\"mensaje\":\"3863615978: Revisar chat y si se convirtio en cliente o no, de ultima consultale, si te dice que no ofrecele un 15% off hasta el lunes de la semana que viene<br><br>Carbelo Nestor: Falto en un chat hacerle una agenda, por lo que hay que revisar si al final vino o no y en caso que no preguntar que paso y ofrecer un 15% off hasta el lunes.&nbsp;<br><br>NOTA: Todos aquellos que acepten la promo se le tiene que devengar una bonificacion y poner VALIDO HASTA (fecha del lunes)\",\"vencimiento\":\"2024-01-25\"}', NULL, '2024-01-25 16:30:21', '2024-01-25 16:30:21'),
('f73bb72d-8919-43d9-ab77-2f1cce8ed763', 'App\\Notifications\\NewCv', 'App\\Models\\User', 12, '{\"postulante_id\":46,\"name\":\"Florencia micaela Zuleta\",\"celular\":\"3865452204\",\"edad\":\"26\",\"puesto\":\"recepcionista\",\"sede\":\"concepcion\"}', NULL, '2024-01-15 16:55:33', '2024-01-15 16:55:33'),
('f74ca693-c1d5-43af-8a7b-a62c7e1b7b6c', 'App\\Notifications\\NewCv', 'App\\Models\\User', 12, '{\"postulante_id\":27,\"name\":\"Robles Olivares Agust\\u00edn Marcelo\",\"celular\":\"3863573596\",\"edad\":\"18\",\"puesto\":\"recepcionista\",\"sede\":\"monteros\"}', NULL, '2023-08-08 03:17:17', '2023-08-08 03:17:17'),
('f7a4aa18-d482-4178-864d-efc12ea7509c', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 4, '{\"novedad_id\":134,\"sede\":\"monteros\",\"mensaje\":\"<p>POST EVENTO: Acomodar todas las cosas, dejar luces en oscar, guardar bandera, ornamentacion, bajar mesa de dj, acomodar prensa, banderin, cable dj, vasos, todo lo que haya a la bolsa negra y guardar en deposito.<br>Hacer papelitos con todos los uqe compartieron la historia y ponerlos dentro de la caja y hacer el&nbsp; sorteo, esta ma\\u00f1ana lo sorteamos. Tiene que haber un ganador para:<br>Zapatillas de GERF<br>Remera de hammer (si no hay talle se le da un mensual)<br>Cerveza de cb + cortes de pelo<br>Meriendas de Roma<br>No se si participo la rocio carrizo tambien&nbsp;<br>Trabajar en conjunto con nazareno para que les haga el flyer que diga GANADORES SORTEO ANIVERSARIO y abajo cada uno de los premios (etiquetar al local) y etiquetar al ganador en el costado.<br><\\/p>\",\"vencimiento\":\"2023-08-23\"}', '2023-10-06 14:32:31', '2023-08-23 05:16:36', '2023-10-06 14:32:31'),
