('f803f0b9-cd42-401a-b03b-e81c0f660148', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 15, '{\"novedad_id\":101,\"sede\":\"todas\",\"mensaje\":\"<p><b>NUEVA ACTUALIZACI\\u00d3N<\\/b><\\/p><p style=\\\"text-align: center; \\\">Tarea de muestra para verificar los cambios<\\/p><ol><li style=\\\"text-align: left;\\\">por favor marcar como <font color=\\\"#000000\\\" style=\\\"background-color: rgb(255, 255, 0);\\\">leido <\\/font>el mensaje para&nbsp;<\\/li><\\/ol>\",\"vencimiento\":\"2023-08-10\"}', NULL, '2023-08-11 02:57:07', '2023-08-11 02:57:07'),
('f85acada-084b-432a-87c5-415cf8a2f28d', 'App\\Notifications\\NewLead', 'App\\Models\\User', 1, '{\"lead_id\":59,\"name\":\"Erika\",\"celular\":\"3813953111\",\"sede\":\"monteros\",\"fecha\":\"2024-03-12T12:24:58.000000Z\"}', NULL, '2024-03-12 12:24:59', '2024-03-12 12:24:59'),
('f8621830-9e18-46fe-9d15-87650084e372', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 15, '{\"novedad_id\":74,\"sede\":\"monteros\",\"mensaje\":\"PROMOCION BANCO NACION: A partir de esta semana largamos el convenio de banco nacion con tarjeta de cr\\u00e9dito (solo apto para tarjetas de credito banco nacion)\\r\\n\\r\\nComo es? SEMESTRE: Deben realizar el cobro del plan que carguen, semestre (solo es valido para semestres y anuales) en 4 montos de 6700 y uno de 8000 (son 5 recibos en total y suman los 34800)\\r\\nANUAL: Deben realizar el cobro del plan anual en 9 pagos de 6700 y uno de 9300. (69300 en total). \\r\\nCODIGO: 6 y 12, no usan los de ahora 12 que eran el 16 y 13, usan los codigos comunes, pero tengan cuidado que solo se puede hacer dia jueves y con tarjeta de credito de banco nacion.\\r\\nPor que hacemos los cobros asi? Por cada 6700 que nosotros cobramos, se le devuelven 1000 a los clientes, por lo que en el semestre al hacerlo en 5 pagos se le devuelve 5000 y en el anual 10000 porlo que para venderlos le dicen que ademas de las cuotas fijas y sin interes se le reintegran esos montos, es un poco engorroso hacer tantos cobros pero bueno. Esas devoluciones les llegaran en sus resumenes a fin de mes.\\r\\n\\r\\nMe consultan cualquier cosa\",\"vencimiento\":\"2023-07-18\"}', NULL, '2023-07-18 19:00:29', '2023-07-18 19:00:29'),
