('f8a6d8bc-6205-4d16-a797-af3adf75186f', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 19, '{\"novedad_id\":321,\"sede\":\"concepcion\",\"mensaje\":\"Saco un adelanto de 49 mil, por lo que ella cobra:<br>-(menos)10.000 1semana (osea solo cobra 6200 de los 16200)<br>-10.000 2 semana<br>-12.200 3 semana&nbsp;<br>-16800 4 semana<br><br>el guion del principio significa menos, por lo que de los 16200 cobra solo 6200 las dos primeras semanas y asi hasta descontar en las 4 semanas el monto total.\",\"vencimiento\":\"2023-12-28\"}', NULL, '2023-12-28 13:47:46', '2023-12-28 13:47:46'),
