('f92a0110-70a9-49ea-a0ed-cb4dd39786d1', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 12, '{\"novedad_id\":313,\"sede\":\"todas\",\"mensaje\":\"Para hacer un descuento si o si deben estar agregados los perfiles y vinculados en un grupo familiar, no pueden hacerle la promo si no entran a su perfil y se fijan que esten activos los otros integrantes (recuerden que si no abonan el mismo dia solo se puede hacer un 10% de descuento asi sean 20, si quieren los descuentos grandes tienen que pagar juntos, si no solo le hacen el 10% a cada uno por pagar separado, pero igual deben entrar a su perfil y fijarse en \\\"GRUPO FAMILIAR\\\" acercan el raton a la fotito del otro y ahi ssale activo o inactivo, me mandan si no entienden\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 13:20:34', '2023-12-21 13:20:34'),
