('f9ca70a4-78bd-4e2c-87e0-c0711c329852', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":82,\"sede\":\"monteros\",\"mensaje\":\"PROMO BANCO NACION: Cambiaron las condiciones de la promo y paso a explicar los nuevos terminos ademas voy a poner un ejemplo para que tengan aqui el paso a paso de como realizarlo.\\r\\nSolo se puede pasar en 6 cuotas fijas y sin interes (recuerden poner el c\\u00f3digo 6 en vez de 16 en estos casos). Ya no acepta 12 cuotas y la devoluci\\u00f3n es de un 25% (ya no de 15%) hasta un tope de 3000 ( ya no de 1000)\\r\\nEl monto m\\u00e1ximo que vamos a pasar por transacci\\u00f3n es de 12000 (y se le devuelven 3000 por cada una que es el 25%).\\r\\nA\\u00d1O: Tendr\\u00e1 3 meses gratis mas 6 cuotas fijas y sin inter\\u00e9s. Pasamos  5 montos de 12000 (con c\\u00f3digo 6) y uno de 9600 )se devuelve 17400.\\r\\nSemestre: Tendr\\u00e1 casi 1 mes y medio gratis y 6 cuotas fijas y sin inter\\u00e9s. Pasamos 2 montos de 12000 y uno de 10800 y se le devolver\\u00e1 8700. Las devoluciones se hacen el primer mes, osea en el resumen de la tarjeta les saldran los pagos y las devoluciones el primer mes, como la devolucion es mas que el monto que van a pagar el primer mes les queda como saldo a favor. Me consultan por privado cualquier cosa\",\"vencimiento\":\"2023-07-28\"}', NULL, '2023-07-28 14:19:01', '2023-07-28 14:19:01'),
('f9dc734f-da12-4279-9a30-411ecb2c7ad9', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":210,\"sede\":\"todas\",\"mensaje\":\"Chicos es una novedad para probar las funciones de una nueva actualizaci\\u00f3n del sistema, solo pongan leer para comprobar que todo sigue funciondo bien\",\"vencimiento\":\"2023-10-04\"}', NULL, '2023-10-04 04:06:32', '2023-10-04 04:06:32'),
('f9dff214-08b1-4577-a76a-e617077c4e35', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":312,\"sede\":\"todas\",\"mensaje\":\"Chicos tengan muchisimo cuidado con los pendientes de deuda de los planes largos, la gente realmente no puede pasarse dias despues de los 30 ya tienen que pagar, por que si no, uds los dejan pasar, ellos se hacen los boludos y pasan 15 dias mas y eso implica que yo pierda en un mes 15 % de inflacion, en medio mes mas 22% en total, y nosotros solo le recargamos un 5%, no puedo vender en cuotas asi. Si alguien no lleva el primer dia le dicen que tiene que abonar si no se le aplicara recargo por la cantidad de dias que se demore y no puede seguir pasando con deuda (es un compromiso que ellos asumieton)<br>2_ Si en algun caso alguien adelanta su plan semestral por ejemplo igual tiene que pagar a los 30 dias, si no me van a adelantar 3 meses, pagaran la priemera cuota y la segunda recien a los 4 meses, super devaluado, no funciona asi, desde el primer dia que pagan a los 30 tienen que pagar la segunda, caiga cuando caiga<br><br>PD: Estos dos casos los anoto aqui por que en Concepcion sucedieron. Muchas gracias\",\"vencimiento\":\"2023-12-21\"}', '2023-12-21 15:03:55', '2023-12-21 13:06:22', '2023-12-21 15:03:55'),
