('fa1b7483-71bf-4c32-8f7b-1b9af90f3509', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":188,\"sede\":\"todas\",\"mensaje\":\"FERIADOS: El lunes por empleado de comercio abrimos solo de 14 a 22 hs. Hablar con Adrian e irina para que coordine los puestos. Con respecto a las clases ya subiremos los flyers asi ven de ahi la info tambien. Nazareno pasara la imagen asi colocamos ya nada mas en molinete<br><br>Evento Martes para dar bienvenida a la primavera: Haremos como siempre, jugos, galletas, sorteos, ornamentacion de primavera, DJ, trataremos que este disponible para todos los horarios. Si tienen ideas para complementar me avisan\",\"vencimiento\":\"2023-09-21\"}', '2023-09-21 14:46:09', '2023-09-21 12:47:06', '2023-09-21 14:46:09'),
('fa42f90c-b46d-4745-868a-b60770b46b98', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 10, '{\"novedad_id\":134,\"sede\":\"monteros\",\"mensaje\":\"<p>POST EVENTO: Acomodar todas las cosas, dejar luces en oscar, guardar bandera, ornamentacion, bajar mesa de dj, acomodar prensa, banderin, cable dj, vasos, todo lo que haya a la bolsa negra y guardar en deposito.<br>Hacer papelitos con todos los uqe compartieron la historia y ponerlos dentro de la caja y hacer el&nbsp; sorteo, esta ma\\u00f1ana lo sorteamos. Tiene que haber un ganador para:<br>Zapatillas de GERF<br>Remera de hammer (si no hay talle se le da un mensual)<br>Cerveza de cb + cortes de pelo<br>Meriendas de Roma<br>No se si participo la rocio carrizo tambien&nbsp;<br>Trabajar en conjunto con nazareno para que les haga el flyer que diga GANADORES SORTEO ANIVERSARIO y abajo cada uno de los premios (etiquetar al local) y etiquetar al ganador en el costado.<br><\\/p>\",\"vencimiento\":\"2023-08-23\"}', '2023-08-23 10:00:01', '2023-08-23 05:16:36', '2023-08-23 10:00:01'),
