('fc4927d7-8be0-463f-82c5-4e8fe8ec7b30', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 1, '{\"novedad_id\":235,\"sede\":\"todas\",\"mensaje\":\"Ya esta disponible la nueva APP de hammer. El beneficio que tiene la gente por ahora es poder visualizar su vencimiento de contrato (ya dejaremos de mandar los mensajes la semana que viene asi le explican a la gente). Van a poder renovar desde ahi e ir directamente a pagar en el gym. proximamente vamos a cargar rutinas y van a participar en competencias por premios\",\"vencimiento\":\"2023-10-31\"}', NULL, '2023-10-31 13:52:59', '2023-10-31 13:52:59'),
