('fed65469-d9ea-4b8e-9375-6e7606b0a35d', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 0, '{\"novedad_id\":235,\"sede\":\"todas\",\"mensaje\":\"Ya esta disponible la nueva APP de hammer. El beneficio que tiene la gente por ahora es poder visualizar su vencimiento de contrato (ya dejaremos de mandar los mensajes la semana que viene asi le explican a la gente). Van a poder renovar desde ahi e ir directamente a pagar en el gym. proximamente vamos a cargar rutinas y van a participar en competencias por premios\",\"vencimiento\":\"2023-10-31\"}', NULL, '2023-10-31 13:52:59', '2023-10-31 13:52:59'),
('fedbdbe1-89d2-475e-ac4c-6ccffebba2ae', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 2, '{\"novedad_id\":180,\"sede\":\"todas\",\"mensaje\":\"<p>Les dejo info de las cremas para cabina solar:<\\/p><p>Todas estan hechas de extractos de vegetales.<br>COBRIZZO: incrementa la velocidad del bronceado en un tono \\\"tipo cobre\\\" y estimulan la produccion de colageno (cuidado de la piel). Recomendado para las tres primeras sesiones.<br>EXPRESSO: adicional a lo anterior, tambi\\u00e9n permite un bronceado m\\u00e1s duradero al fijar el color. O sea es tipo mitad para cada cosa (velocidad y duraci\\u00f3n). Recomendado para la cuarta sesi\\u00f3n en adelante.<br><br>En ambos casos se recomienda usar esto porque se logra un bronceado mas eficiente y saludable.<\\/p><p>No se deben usar otro tipo de cremas no dise\\u00f1adas para la cabina solar porque se puede bloquear todo el bronceado (en caso de usar protectores) o bien da\\u00f1ar la piel (bronceadores para sol), salvo recomendaci\\u00f3n de un dermat\\u00f3logo.<br><br><br><\\/p>\",\"vencimiento\":\"2023-09-19\"}', '2023-10-04 03:59:18', '2023-09-19 12:24:16', '2023-10-04 03:59:18'),
('fef4b5bc-b64e-4a00-aad2-301e486618e3', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 12, '{\"novedad_id\":312,\"sede\":\"todas\",\"mensaje\":\"Chicos tengan muchisimo cuidado con los pendientes de deuda de los planes largos, la gente realmente no puede pasarse dias despues de los 30 ya tienen que pagar, por que si no, uds los dejan pasar, ellos se hacen los boludos y pasan 15 dias mas y eso implica que yo pierda en un mes 15 % de inflacion, en medio mes mas 22% en total, y nosotros solo le recargamos un 5%, no puedo vender en cuotas asi. Si alguien no lleva el primer dia le dicen que tiene que abonar si no se le aplicara recargo por la cantidad de dias que se demore y no puede seguir pasando con deuda (es un compromiso que ellos asumieton)<br>2_ Si en algun caso alguien adelanta su plan semestral por ejemplo igual tiene que pagar a los 30 dias, si no me van a adelantar 3 meses, pagaran la priemera cuota y la segunda recien a los 4 meses, super devaluado, no funciona asi, desde el primer dia que pagan a los 30 tienen que pagar la segunda, caiga cuando caiga<br><br>PD: Estos dos casos los anoto aqui por que en Concepcion sucedieron. Muchas gracias\",\"vencimiento\":\"2023-12-21\"}', NULL, '2023-12-21 13:06:22', '2023-12-21 13:06:22'),
