('ffbf61b5-4bf2-445d-92a3-3539585cb3f9', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 3, '{\"novedad_id\":85,\"sede\":\"monteros\",\"mensaje\":\"La semana que viene se actualizan precios:\\r\\nMusculaci\\u00f3n 6600\\r\\nclases grupales 5500\\r\\npilates a confirmar\\r\\nLa promo de BNA: Pasaran 3 montos de 12mil y uno de 3600 en el semestre, por lo que se le devuelve a los clientes 9900 . A\\u00d1O: 6 montos de 12 mil y uno de 7200 en el a\\u00f1o, se le devuelve a los clientes 19800 (me consultan bien cualquier cosa) esta promo es solo hasta fin de mes, les confirmamos si se actualizan y siguen igual el mes que viene.\",\"vencimiento\":\"2023-08-01\"}', '2023-08-08 11:58:44', '2023-08-01 12:24:18', '2023-08-08 11:58:44'),
('fff1921a-12e7-445d-8261-2d9af4f35c16', 'App\\Notifications\\NewNovedad', 'App\\Models\\User', 3, '{\"novedad_id\":184,\"sede\":\"concepcion\",\"mensaje\":\"Organizar para que el turno ma\\u00f1ana complete los correos electronicos de las personas que estan inscriptas en estos ultimos 3 meses (aprox 300), hacer unos 20 por d\\u00eda e ir pasando para otra caja.\",\"vencimiento\":\"2023-09-20\"}', NULL, '2023-09-20 12:10:05', '2023-09-20 12:10:05'),
