(11, 'todas', NULL, 'tarea test', 0, '2023-05-11', 1, '2023-05-11 01:04:02', '2023-05-11 07:03:09'),
(12, 'todas', NULL, 'Prueba, confirmar lectura', 0, '2023-05-11', 1, '2023-05-11 07:02:39', '2023-05-11 11:55:24'),
(13, 'todas', NULL, 'Recuerden:\r\n-Ser siempre los ultimos en responder los mensajes, terminamos con un \"gracias a vos\", \"te esperamos pronto\" \"gracias por elegirnos!\" Etc.\r\n- En planes mensuales el congelamiento ahora es de 10 dias a 30 dias', 0, '2023-05-12', 1, '2023-05-11 13:49:07', '2023-05-12 15:58:53'),
(14, 'todas', NULL, 'Las transferencias se podran realizar hasta dentro de los primeros 10 dias en los planes mensuales y pueden ser realizadas a cualquier persona. No solamente a personas que no sean socias o que no esten asistiendo (¡NUEVO!)', 0, '2023-05-12', 1, '2023-05-11 13:54:02', '2023-05-12 16:00:24'),
(15, 'todas', NULL, 'Descuento referidos queda en: 1 amigo: 10%, 2 amigos 25% y tres amigos 40%. En monteros seria 500 1250 y 2000. En concepción seria 600 .1500.2400', 0, '2023-05-12', 1, '2023-05-11 19:09:22', '2023-05-12 15:58:06'),
(16, 'monteros', NULL, 'Cambio de Congelamiento en pilates: Se realizara desde los 7 dias. Es el unico plan, los demas son desde los 10', 0, '2023-05-16', 1, '2023-05-15 15:45:55', '2023-05-16 14:20:08'),
(17, 'monteros', NULL, 'A todos los que esten etiquetados como \"campaña pilates\" les ponemos en el nombre \"(campaña pilates\") Asi en el futuro podamos recuperarlos con el nombre. De ahi contamos cuantos hay en total y anotalos (esas son las consultas totales que hubo, los etiquetados digamos), despues entra a socio plus sin el ux y filtra todos los prospectos cargados desde el posteo de la campaña hasta el viernes pasado y entrando uno por uno para ver quien hizo pilates y le editas el perfil y pones en \"CONVENIO\" campaña, una vez que los hagas con todos, entramos de nuevo a filtrar sin el ux pero ahora pone en convenio campaña asi salgan directamente los de la campaña. Eso seria prospectos no convertidos, despues tenemos que entrar en planilla de caja y ver todos los convertidos uno por uno, pero filtrar los nuevos y los rematriculados (serian los convertidos por la campaña digamos). Llamame cualquier cosa', 3, '2023-05-15', 1, '2023-05-15 16:15:41', '2023-05-16 14:20:32'),
(18, 'todas', NULL, 'Cuando hagamos campañas (como la que hicimos de pilates en Monteros) Vamos a notificar obviamente, pero todos los perfiles dados de alta (generalmente lo hara cada vendedor en su sede pero deben saber todos por si les toca dar de alta a alguien), cuando estan cargando el perfil en un apartado dice \"convenios\" ahi debemos poner \"CAMPAÑA\". Si alguien no lo entiende me manda un mensaje y se lo explico', 0, '2023-05-16', 1, '2023-05-15 16:24:26', '2023-05-16 11:51:57'),
(19, 'concepcion', NULL, 'Funcional al aire libre pasa a llamarse, CONVENIO PREPARACION FISICA PABLO. Cuesta 5200 como las clases grupales', 0, '2023-05-16', 1, '2023-05-16 18:35:47', '2023-05-18 12:25:53'),
(20, 'monteros', NULL, 'Para las clases de prueba de pilates. una vez finalizado le dan un dia a las personas para dejar una seña asi podemos guardarle los lugares, por que muchos no vuelven y perdemos los lugares.', 0, '2023-05-22', 1, '2023-05-19 16:15:29', '2023-05-22 18:33:54'),
(23, 'monteros', NULL, 'La nueva planilla impresa por brisa debe tener los motivos de deserción para que vayan anotando palitos, es muy importante, luego lo agregaremos al drive para poder conocer cuales son las situaciones que llevan a las personas a abandonar y poder realizar correcciones.', 3, '2023-05-22', 1, '2023-05-20 04:24:11', '2023-05-22 21:49:30'),
(24, 'concepcion', NULL, 'La nueva planilla impresa por brisa debe tener los motivos de deserción para que vayan anotando palitos, es muy importante, luego lo agregaremos al drive para poder conocer cuales son las situaciones que llevan a las personas a abandonar y poder realizar correcciones.', 14, '2023-05-22', 1, '2023-05-20 04:24:31', '2023-06-04 19:55:21'),
(25, 'todas', NULL, 'RECORDATORIO DE PROMOCIONES:\r\nPROMO FAMILIAR:  2 familiares 10%off a cada uno, 3 familiares medio mensual gratis, 4 un mensual gratis y 5 uno y medio gratis. El mensual gratis siempre se aplica al mas barato, es decir si tienen musculacion y otro pase por 8, se le hace al de pase por 8. Por otro lado taambien si quieren dividirse el descuento entre todos pueden hacerlo. Tienen que pagar el mismo dia, si no lo vienen haciendo por que uno ya pago y el otro se suma por ejemplo le hacen por priemra vez pero le dejan en claro que para la proxima se tienen que acomodar por favor. El codigo es FAM x2 (nombre del otro familiar) FAM x3 etc', 0, '2023-05-22', 1, '2023-05-20 04:28:05', '2023-05-22 09:51:13'),
(26, 'todas', NULL, 'Recordatorio de promociones:\r\nPROMO REFERIDOS: En esta promo el referente debe ser una persona que ya este yendo al gimnasio y el referido uno nuevo o que no asista hace 3 meses o mas. Este es el criterio. 3 meses minimo. El referido siempre tendra un 10% off y el referente tendra un descuento acumulable segun la cantidad de personas que refirio, ahora si o si el referido tiene que tener en como nos conocio el dni del referente, y SI O SI el referente cuando vaya a reclamar su descuento tienen que revisar que en \"REFERIDOS\" este la personita a quien refirio, en el caso que este todo ok ponen en comentarios \"(nombre del referido) usado\". El codigo es REF (nombre del referente) para el referido y para el referente que va a reclamar su descuento cuando renueva es REF x1 (x2, x3, etc) y los nombres de los referidos', 0, '2023-05-23', 1, '2023-05-20 04:31:20', '2023-05-23 09:49:08'),
(27, 'todas', NULL, 'PROMO AMIGOS INICIAL: Hacemos un 10% off a cada uno cuando comienzan de a 2, de a 3 etc, por ahí si van a comenzar de a 3 o 4 pueden decirles que hablaran con los dueños para ver que se puede hacer en caso de que no se convenzan con el 10% y vemos que hacemos. EL CODIGO es DESC INICIAL x2 (nombre de los amigos) por ejemplo.', 0, '2023-05-24', 1, '2023-05-20 04:32:40', '2023-05-24 14:01:32'),
(28, 'todas', NULL, 'Las promos no son acumulables una con otras solo el REFERENTE, Los convenios no tienen promociones. Luego tenemos otras promos como SIPROSA que deben ir con boleta de sueldo, PROMO judicial también, y la promo instructor que tiene un 10% off', 0, '2023-05-25', 1, '2023-05-20 04:35:02', '2023-05-25 14:29:05'),
(29, 'todas', NULL, 'Los prospectos captados por la pagina web como el que capto irina Luis Ramos, en ¿Como nos conocio? Ponemos \"pagina web\". En -Live Connect cuando lo etiquetemos tenemos la etiqueta \"prospecto pagina web\"', 0, '2023-05-23', 1, '2023-05-22 18:12:03', '2023-05-23 09:49:46'),
(30, 'todas', NULL, 'planes largos: Mando explicacion. En el caso que alguien no entienda mandeme un mensaje privado y les vuelvo a explicar. No tienen que quedar dudas sobre esto, esto dificil vender por lo que tienen que saberlo perfectamente. \r\nEn primer lugar lo que siempre tienen que remarcarle a las personas es que se van a comprometer a entrenar durante el periodo completo y que es necesario para obtener realmente los resultados, no se consiguen en un mes.\r\n\r\nSEMESTRAL: Puede pagar en efectivo o tarjeta, si paga en efectivo le queda 1 mes gratis, paga 5 y tiene 6. Si paga con tarjeta aquí les dejamos al mismo precio de hoy congelado por los 6 meses siguientes, para cobrarlo tienen que cargar el plan y el precio que dice ahi (no tiene nada que ver con el cliente, ni le digan) le hacen el recargo que dice la tabla (tampoco le digan por que si no los confunden y piensan que tiene un recargo cuando no es asi), ustedes solo digan que si el mensual hoy sale 6000 va a pagar 6000 durante 6 meses.\r\nANUAL: Si paga con efectivo tiene 3 meses gratis, si paga con tarjeta tiene un 15% de recargo (aqui aveces se confunden y piensan que hay que hacerle al precio de efectivo un 15% y no es asi, es del precio como si pagara normal, por ejemplo 6000 x 12 es 72000 a ese precio le hacemos el 15%). En realidad hacer un 15% anual no es nada, nadie vende asi asi que si es una promo tambien.\r\n\r\nPor ultimo, se puede pagar el semestre en 2 cuotas con efectivo, y el anual en 2 o 3 cuotas en efectivo tambien. Al pagar en 2 cuotas siempre hacen el 4% del monto que deberian pagar, le suman y dividen en 2 (eso seria cada cuota). Si tienen que pagar en 3 cuotas le hacen el 8%, suman y dividen en 3. Por ejemplo si el plan valiera 1000 pesos, el 8% es 1800 dividido en 3 serian 3 cuotas de 600 pesos. Me preguntan bien cualquier cosa, pero tenemos que ser claros para convencerlas a las personas :)', 0, '2022-05-24', 0, '2023-05-23 20:42:48', '2023-05-23 20:42:48'),
(31, 'concepcion', NULL, 'nuevo modulo de kpis: Completar el nuevo modulo Indicadores de actividades. Buscamos en la imagen enviada cada actividad con la cantidad de personas inscriptas. No hay mucho para explicar, en kids debemos sumar todas las actividades kids mensuales', 10, '2023-05-29', 1, '2023-05-29 03:10:36', '2023-05-29 13:35:28'),
(32, 'monteros', NULL, 'EN IMAGENES ENVIADAS AL GRUPO DE KPIS AL FINALIZAR EL TURNO DEBEN SER:\r\n1_ IMAGEN DE PANTALLA INICIAL, DESACTIVAS CLASES DE AMBAS SEDES, ACTUALIZAR VALORES, ACTIVAR CLASES NUEVAMENTE\r\n2_ EN SOCIOS ACTIVOS HACEMOS CLICK EN \"VER DETALLES\" CON CONTROL G Y LA RUEDITA PODEMOS HACER MAS CHICA LA IMAGEN PARA SACAR UNA FOTO Y QUE SE VEAN TODAS LAS ACTIVIDADES', 0, '2023-05-29', 1, '2023-05-29 03:13:50', '2023-05-29 18:01:23'),
(33, 'monteros', NULL, 'El lunes de la semana que viene actualizamos la cuota. Debemos colocar el cartelito en novedades sobre el molinete que diga, la fecha de actualización. El discurso debe ser que estamos actualizando cada dos meses para que el monto de la actualización sea menor, no queremos resignar calidad por lo que necesitamos mantenernos por el tema de los costos, además que también debemos actualizar el pago a los que trabajan. La opción que deben plantear es congelar los valores con los planes largos.', 0, '2023-06-05', 1, '2023-05-29 03:17:42', '2023-06-04 19:55:17'),
(34, 'todas', NULL, 'El dia de hoy a la tarde comenzamos con una campaña publicitada en facebook. A ponernos las pilas todos! Sobre todo los vendedores pero entre todos les colaboremos para trabajar en equipo. \r\n\r\nEtiqueta: Campaña agustin Concepcion Monteros (29.5). ES FUNDAMENTAL ETIQUETAR POR FAVOR. ¿A quien se etiquetara? A todos aquellos que se contacten desde la publicacion en facebook (nos envian vi esto en face), y a todos aquellos que realicen comentarios y nosotros nos contactemos\r\nCargar perfil: Al cargar el perfil en como nos conocio pondremos el medio como siempre y en area de interes pondremos \"campaña Agustín\" Esto es fundamental si no perderemos todas las estadisticas. Por favor', 0, '2023-05-29', 1, '2023-05-29 03:49:19', '2023-05-29 13:35:46'),
(35, 'monteros', NULL, 'Hablar con Nazareno para que complete la estadística de campaña Agustín. Si o si la tenemos que finalizar hoy', 4, '2023-06-26', 1, '2023-05-29 03:50:31', '2023-06-04 19:55:16'),
(36, 'monteros', NULL, 'recordatorio para realizar la lista de isaac. Enviamos el cuponcito de descuento valido hasta el otro lunes con el 20% off directamente, pero se aclara en el caso que vaya a entrenar con el\r\nFalta renata medina', 4, '2023-05-30', 1, '2023-05-29 18:23:07', '2023-06-02 10:06:23'),
(37, 'todas', NULL, 'MUSICA: ahora queda determinada por el turno mañana, no modificarla. Se reproducen únicamente las playlist con nombres:\r\nHAMMER LUNES\r\nHAMMER MARTES\r\nEtc\r\ny HAMMER INTERMEDIO 1 Y 2\r\n\r\nInstructivo para turno mañana:\r\nIniciar con la playlist de igual nombre que el día, ejemplo el lunes arrancamos con Hammer Lunes y seguir con el resto de los días agregando cada playlist a la COLA DE REPRODUCCION. Si arrancamos con Hammer Viernes sería: Hammer viernes, sabado, domingo, lunes, martes, etc (o sea vuelve a empezar).\r\nLas Hammer Intermedio 1 y 2 se pueden colocar al principio, medio o final de las otras, lo van haciendo a su criterio como les guste (ir variando el orden de estas dos cada día, ese es el sentido).', 0, '2023-06-05', 1, '2023-06-04 19:54:31', '2023-06-04 19:55:11'),
(38, 'concepcion', NULL, 'KPIS: completar los kpis de junio e ir día a día. En BAJAS DEL MES va el segundo valor, el que se acumula, porque el primero son BAJAS DEL DIA que no registramos.', 10, '2023-06-05', 1, '2023-06-04 21:02:09', '2023-06-05 10:14:48'),
(39, 'concepcion', NULL, 'TRANSFERENCIAS:\r\nSe cambia el nombre de TRANSFERENCIA BANCO NACION por TRANSFERENCIA BNA porque veo que se confunden. Transferencia BNA usarla para GYMPASS y los convenios que yo avise (hasta ahora solo ARCOR), ya que este CBU no esta exhibido al público y creo que lo venían confundiendo uds al egresar, no hay que usarlo nunca salvo para esto que les dije recién.\r\nTenemos UALA y Lemon para recibir y egresar, no importa si me mandan de UALA, BANCO NACION, BANCO MACRO, MERCADOPAGO, etc, sirve.', 0, '2023-06-06', 1, '2023-06-04 21:55:56', '2023-06-06 09:47:07'),
(40, 'monteros', NULL, 'Al hacer COBRO DE CAJA MARCELO o CHOCHO siempre poner en observaciones para que fue que te pedimos el dinero', 0, '2023-06-06', 1, '2023-06-04 23:26:50', '2023-06-06 17:56:54'),
