(46, 'todas', NULL, 'Planes largos en efectivo:\r\nSemestral: 1 cuota al precio que dice en socioplus\r\n2 cuotas: con un 5% de recargo. Para calcular por ejemplo si tenemos 50000, el 5% es 2500, hay que \"DEVENGAR\" dos veces, ponemos 1era cuota con un valor de 1250 y la segunda ponemos \"2da cuota\" y ponemos de nuevo 1250. En el primer pago harian el cobro de los 50000 como pago parcial (cobran 25000) y luego cobran una de las cuotas devengadas (es decir que en total cobran 26500), y la segunda vez que vayan a abonar la 2da  cuota harian el mismo proceso, cobrando los 25000 que faltan + los 1250 devengados.\r\nEn el anual el proceso es igual nada mas que tambien pueden hacerlo en 3 cuotas, esta tendra un 10% de recargo y devengarian 3 veces. (el 10% del monto total dividido en 3). \r\nSi alguien no entiende me manda un mensaje y les explico', 0, '2023-06-09', 1, '2023-06-09 00:08:19', '2023-06-09 10:03:55'),
