(50, 'concepcion', NULL, 'SPOTIFY: ingresar a CONFIGURACION: 1) AHORRAR DATOS: DESACTIVAR - 2) DESCARGAR SOLO EL AUDIO: ACTIVAR - 3) REPRODUCIR SOLO EL AUDIO: ACTIVAR - 4) COLOCAR CROSSFADE 2 SEGUNDOS - 5) SIN PAUSAS: DESACTIVAR -  6) AUTOMIX: DESACTIVAR - 7) CONTENIDO EXPLICITO: ACTIVAR - 8) NORMALIZAR VOLUMEN: ACTIVAR - 9) NIVEL DE VOLUMEN: NORMAL  - 10) AUDIO MONO: ACTIVAR - 11) MOSTRAR LO QUE ESCUCHAS: DESACTIVAR - 12) AUTOPLAY: DESACTIVAR - 13) CANVAS: DESACTIVAR - BAJAR DEL TODO E IR A 14) CALIDAD DE LAS DESCARGAS: ALTAS - 15) REPRODUCCION CON WIFI: ALTA', 10, '2023-06-15', 1, '2023-06-14 13:45:17', '2023-06-15 09:45:20'),
(51, 'monteros', NULL, 'FERIADOS: Trabajar conjuntamente con Nazareno desde el primer dia que el tenga la tarea \"feriados\" para utilizar todos los medios y canales de comunicacion. Es su responsabilidad que los chicos sepan y comuniquen (tanto naza en redes, como recepcionistas con los carteles) los feriados. Vi falencias en estos feriados ya que recien a partir del miercoles a la tarde pusimos los carteles (los puse yo) y subimos las historias cuando debiamos comenzar a subir desde el martes. Para la proxima podemos coordinar mejor', 3, '2023-06-16', 1, '2023-06-15 16:45:19', '2023-06-30 15:25:55'),
(52, 'concepcion', NULL, 'FERIADOS: Trabajar conjuntamente con Nazareno desde el primer dia que el tenga la tarea \"feriados\" para utilizar todos los medios y canales de comunicacion. Es su responsabilidad que los chicos sepan y comuniquen (tanto naza en redes, como recepcionistas con los carteles) los feriados. Vi falencias en estos feriados ya que recien a partir del miercoles a la tarde pusimos los carteles (los puse yo) y subimos las historias cuando debiamos comenzar a subir desde el martes. Para la proxima podemos coordinar mejor', 14, '2023-06-16', 1, '2023-06-15 16:45:31', '2023-06-27 12:31:01'),
(53, 'todas', NULL, 'Hoy es el evento en los gimnasios, pongamos la mejor actitud para que este todo en orden y para hacer que los clientes la pasen bien!', 0, '2023-06-21', 1, '2023-06-16 19:26:03', '2023-06-21 09:59:43'),
(54, 'todas', NULL, 'COMPROBANTES ELECTRONICOS: TENER CUIDADO CON LAS TRANSFERENCIAS (COSAS QUE PASARON YA): 1) ENVIAN UN COMPROBANTE DEL MES ANTERIOR PARA HACERLO PASAR COMO DE ESTE MES, POR LO QUE HAY QUE REVISAR LAS FECHAS. 2) LE TRANSFIEREN A OTRA PERSONA POR ERROR, POR LO QUE HAY QUE REVISAR EL NOMBRE (EJ. QUE DIGA CUENTA DESTINO GARCIA CARLOS). 3) EL COMPROBANTE NO DICE TRANSFERENCIA EXITOSA, SINO QUE QUEDA EN PENDIENTE, POR LO QUE DEBE QUEDAR CON LA DEUDA EL CLIENTE Y RECIEN CUANDO SE CONFIRME QUE MANDEN EL COMPROBANTE Y HACEMOS EL COBRO Y EGRESO. 4) EL COMPROBANTE DICE ENVIAR, EN VEZ DE ENVIADO, POR LO QUE NUNCA LO REALIZAN. 5) EL CLIENTE DICE QUE DESPUES MANDA EL COMPROBANTE Y NUNCA LA HACE, EN ESE CASO DEJAR LA DEUDA TAMBIEN POR MAS APURADO QUE ESTE. 6) EL CLIENTE HIZO LA TRANSFERENCIA AYER O UN DIA ANTERIOR, EN ESTE CASO NO HAY DRAMA, PERO AL EGRESAR PONGAN EN OBSERVACIONES QUE SE HIZO EN UNA FECHA ANTERIOR PARA QUE SE NOS FACILITE EL CONTROL CON BRISA Y LOANA. 7) RESPECTO AL POSNET REVISAR SIEMPRE QUE DIGA COBRO EXITOSO PORQUE A VECES LOS CLIENTES VAN SIN SALDO EN LAS TARJETAS.', 0, '2023-06-19', 1, '2023-06-17 21:08:42', '2023-06-19 11:35:57'),
(55, 'monteros', NULL, 'dsgadgasdgaasdgasdgasdgadg', 0, '2023-06-27', 1, '2023-06-27 05:35:13', '2023-06-27 05:36:00'),
(56, 'todas', NULL, 'El equipo que debemos ser:\r\n-	Ser conscientes de los puntos débiles y fuertes de los compañeros\r\n-	Cambiar el rol o papel que se les asigna si la situación lo amerita\r\n-	No permiten que las fricciones vayan aumentando bajo la superficie hasta explotar\r\n-	Hacer frente a la fricción antes que se convierta en un problema\r\n-	Celebran los logros de uno y de los demás y la pasan bien juntos\r\n-	Todos son conscientes de por qué su contribución es importante\r\n-	Tiempo suficiente para el trabajo\r\n-	Desconecta: Apagar el teléfono, limitar las pantallas, pasar mas tiempo conectando con los clientes', 0, '2023-06-29', 1, '2023-06-28 19:26:09', '2023-06-29 09:35:47'),
(57, 'concepcion', NULL, 'La semana que viene actualizamos los precios, colocar el cartel de novedades  a partir de hoy lunes..\r\n\r\n\"Actualizacion de precios a partir del lunes 10/7\"\r\n¡Congela tu cuota con planes largos durante esta semana!\r\n\r\nCualquiera lo puede poner, lo importante es que el lunes ya este informada la gente.\r\nLa respuesta que tenemos es que no estamos aumentando el precio, estamos actualizando por el aumento delos costos y queremos mantener la calidad del servicio, hemos sumado personal para atender a todas las necesidades y que les conviene contratar planes largos, tienen que saber de memoria como vender planes largos y los precios, si alguno no los sabe me avisa y los vemos de nuevo. Durante la semana les voy a preguntar para ver si saben asi que cualquier cosa prefiero que me pregunten antes asi lo vemos hasta que lo entiendan bien. ¡Buen comienzo de semana para todos!', 0, '2023-07-03', 1, '2023-06-28 19:29:39', '2023-06-30 15:13:14'),
(58, 'concepcion', NULL, 'UALA: damos de baja este alias para la gente (igual seguirá vigente por si alguien lo manda desde agenda, o sea que podrán cobrar y egresar) pero la idea es que de a poco lo dejemos de lado. Está vigente un alias nuevo \"hammer.concepcion\" con una cuenta a mi nombre de lemon y el movimiento en sistema para egresos (TRANSF LEMON CONCEPCION).', 0, '2023-06-03', 0, '2023-06-30 15:15:43', '2023-06-30 15:15:43'),
(59, 'monteros', NULL, 'Vacas de naza:          Hasta que naza vuelva de sus vacas hablar con adrian por que ambos tienen el timetree para ver quien puede subir los flyers porfavor', 4, '2023-07-03', 1, '2023-06-30 18:37:23', '2023-07-04 12:26:43'),
(60, 'concepcion', NULL, 'TAREA KPIS\r\nPor favor realizar los kpis dia a dia para facilitar la evaluacion en los momentos necesarios. No dejar acumular dias', 10, '2023-07-03', 1, '2023-06-30 18:53:25', '2023-07-03 09:41:22'),
(61, 'todas', NULL, 'Tenemos dos casos de clientes que quieren recuperar sus mensuales, aquellos que no asistieron y ya se les vencio y aquellos que estan activos aun pero tampoco asistieron y tambien quieren recuperar los dias. En estos casos lo que haremos es recuperarles la mitad de los dias perdidos, el discurso sera que renueven el mensual y le recuperamos los dias, asumiendo la falta de ellos por no ir y la falta nuestra por no motivarlos. (obviamente sera de manera exepcional con los clientes, no se repitira lo mismo en un mismo cliente en varias circunstancias). Luego me notifican para que corrijamos si hay que hacerlo y siempre lo aclaran en observaciones al por que no fue el cliente y por que le recuperaron. Cualquier cosa si no se entiende me mandan un mensaje y lo reveemos.', 0, '2023-07-03', 1, '2023-06-30 21:30:34', '2023-07-03 09:42:04'),
(62, 'todas', NULL, 'El mismo procedimiento tambien aplicaremos en caso de clientes que se quejen del servicio por mala atencion o malos profesores. Podemos tambien regalarles dos semanas gratis, cambiando de actividad y cambiando de profes, cada persona tendra seguramente una situacion particular por que la vemos en conjunto y decidimos juntos y de manera especifica para esa persona', 0, '2023-07-03', 1, '2023-06-30 21:33:27', '2023-07-03 09:42:21'),
(63, 'concepcion', NULL, 'Esta faltando colocarles las observaciones a los nuevos clientes, habla con los chicos para que cada cliente nuevo, tienen que completar entre lo que hablaron con lo que pusieron en objetivos en la planilla. Es necesario que sepas si venian entrenando o no, si hacian en otro gym, por que se cambiaron, toda esa info nos sirve luego en la recaptacion', 14, '2023-07-03', 1, '2023-06-30 22:01:29', '2023-07-04 12:26:34'),
(64, 'concepcion', NULL, 'FUNCIONAL KIDS: NO DISPONIBLE DESDE ESTA SEMANA, PASAMOS A LOS CHICOS A GIMNASIA KIDS', 0, '2023-07-05', 1, '2023-07-04 12:27:15', '2023-07-05 09:53:37'),
(65, 'concepcion', NULL, 'PRECIOS NUEVOS: MUSCULACION $7200, CLASES $6200, CONVENIO X3 $5900. Tambien sube planes cortos y todo lo que es convenios. Descuento con Instructor: $6500.', 0, '2023-07-06', 1, '2023-07-05 16:23:35', '2023-07-06 09:36:26'),
(66, 'concepcion', NULL, 'PLANES LARGOS: Se unifican lo que es SEMESTRE y ANUAL de musc, lib y clases en: SEMESTRE/AÑO PASE LIBRE. O sea ofreceremos solamente pases libres en planes largos al mismo precio que valía musculación, es como que va de regalo lo otro, los demás planes pasan a llamarse \"PLAN ANTERIOR\" SEMESTRE MUSCULACION, por ejemplo, para que a todo lo que diga plan anterior no lo vendan mas me explico? Esto es para simplificar la tarea de ventas.', 0, '2023-07-06', 1, '2023-07-05 16:25:53', '2023-07-06 09:36:24'),
(67, 'monteros', NULL, 'NUEVO KPI: Se agrego al tablero comercial, socios nuevos mes anterior/renovados durante este mes. Deben entrar a la pagina principal de socio plus, borrar el _ux del final, se abre otra pagina en la cual deben bajar del todo. Alli tenemos \"busqueda avanzada\". Completan los casilleros \"CATEGORIA\" poniendo socio individual, \"PERIODO DESDE Y HASTA\" colocando la fecha del 1 al ultimo dia del mes pasado, por ejemplo ahora estamos en julio deberian poner del 1 al 30/6 y en \"SEDE\" su sede correspondiente. Luego ponen buscar y les saldra un cuadro con todos los socios nuevos de ese mes, ponen control G y ponen \"inactivo\" ese numero que les salga ahi deben copiar en el kpi', 4, '2023-07-10', 1, '2023-07-07 19:20:39', '2023-07-10 16:34:42'),
(68, 'concepcion', NULL, 'NUEVO KPI: Se agrego al tablero comercial, socios nuevos mes anterior/renovados durante este mes. Deben entrar a la pagina principal de socio plus, borrar el _ux del final, se abre otra pagina en la cual deben bajar del todo. Alli tenemos \"busqueda avanzada\". Completan los casilleros \"CATEGORIA\" poniendo socio individual, \"PERIODO DESDE Y HASTA\" colocando la fecha del 1 al ultimo dia del mes pasado, por ejemplo ahora estamos en julio deberian poner del 1 al 30/6 y en \"SEDE\" su sede correspondiente. Luego ponen buscar y les saldra un cuadro con todos los socios nuevos de ese mes, ponen control G y ponen \"inactivo\" ese numero que les salga ahi deben copiar en el kpi', 10, '2023-07-10', 1, '2023-07-07 19:20:52', '2023-07-10 10:40:24'),
(69, 'monteros', NULL, 'CABINA SOLAR: PRECIOS actualizados un 50%, ya que los precios eran de fin de año. Si le pasaron el precio a alguien le mantienen hasta el lunes 10/7 maximo y packs de 6 sesiones o menos.', 0, '2023-07-10', 1, '2023-07-08 20:21:02', '2023-07-10 18:47:35'),
(70, 'concepcion', NULL, 'Alquiler: falta pagar el de la inmobiliaria de Orquera. Mandar a alguien el lunes mismo.', 10, '2023-07-10', 1, '2023-07-08 20:29:50', '2023-07-10 10:39:31'),
(71, 'concepcion', NULL, 'Ver planilla enviada: Son todos los clientes de clases grupales que no asistieron desde enero de 2022. Comenzar enviando desde abajo para arriba ya que es mas probable que vuelvan. Mensaje Hola! Nombre Soy Loana de hammer, queria preguntarte que paso que no te vimos por aqui en los ultimos meses (dias, etc revisar perfil), hubo algun motivo por el cual abandonaste tus entrenamientos? Ademas queria regalarte un cupon de dos semanas de entrenamiento en nuestras clases grupales, te gustaria regresar a entrenar con nosotros? :). En caso que contesten y se agenden, les cargas 2 semanas de invitacion socios (ya cree el plan). agendalos a todos por que cada uno que se convierta tendras el 10% de la cuota que abone para vos como premio. cualquier duda me consultas. Una vez que termines de enviar todo, me mandas la planilla y controlamos quienes usaron las dos semanas y pagaron', 10, '2023-07-13', 1, '2023-07-12 21:21:03', '2023-07-13 10:07:01'),
(72, 'concepcion', NULL, 'Querida Loana: Durante la semana terminala a la planilla de las clases grupales si es que salis de vacaciones la otra semana, asi vamos viendo si regresan, anda anotando todos los que te vayan respondiendo', 10, '2023-07-17', 1, '2023-07-13 23:36:17', '2023-07-17 16:38:38'),
(73, 'concepcion', NULL, 'Pase de invitacion 2 semanas creado', 10, '2023-07-17', 1, '2023-07-17 15:05:19', '2023-07-17 16:38:44'),
(74, 'monteros', NULL, 'PROMOCION BANCO NACION: A partir de esta semana largamos el convenio de banco nacion con tarjeta de crédito (solo apto para tarjetas de credito banco nacion)\r\n\r\nComo es? SEMESTRE: Deben realizar el cobro del plan que carguen, semestre (solo es valido para semestres y anuales) en 4 montos de 6700 y uno de 8000 (son 5 recibos en total y suman los 34800)\r\nANUAL: Deben realizar el cobro del plan anual en 9 pagos de 6700 y uno de 9300. (69300 en total). \r\nCODIGO: 6 y 12, no usan los de ahora 12 que eran el 16 y 13, usan los codigos comunes, pero tengan cuidado que solo se puede hacer dia jueves y con tarjeta de credito de banco nacion.\r\nPor que hacemos los cobros asi? Por cada 6700 que nosotros cobramos, se le devuelven 1000 a los clientes, por lo que en el semestre al hacerlo en 5 pagos se le devuelve 5000 y en el anual 10000 porlo que para venderlos le dicen que ademas de las cuotas fijas y sin interes se le reintegran esos montos, es un poco engorroso hacer tantos cobros pero bueno. Esas devoluciones les llegaran en sus resumenes a fin de mes.\r\n\r\nMe consultan cualquier cosa', 0, '2023-07-18', 1, '2023-07-18 19:00:29', '2023-07-19 18:00:00'),
(75, 'todas', NULL, 'Desde el lunes arrancamos con la promocion de planes largos monteros, luego lo haremos en concepcion, por lo que haremos de manera grupal primeros todos para monteros y luego concepcion. Si aun tienen mensajes de listas personales incompletas traten de terminarlas hasta este viernes asi no se acumulan, son 150 mensajes aproximadamente cada uno por lo que mandando unos 15 por dia cada uno en 10 dias lo terminamos (fecha de finalizacion viernes 4 de agosto).\r\nEL MENSAJE ES \"Hola! (nombre) Soy (nombre de vendedor obligatorio) y hoy te quiero mandar este mensaje para compartirte las promociones que tenemos con los planes largos, cualquier duda me consultas asi puedo asesorarte mejor y explicarte (si estas decidido a entrenar durante un periodo de tiempo mas largo) por que estos son los planes que mas te van a convenir! :). Muchas gracias por elegirnos para acompañarte en tus entrenamientos y quedo a disposición!\"\r\n\r\nLos envían desde whatsapp web, no desde el live, cualquier respuesta que nos vayan dando se las van transfiriendo al vendedor de monteros (ADRIAN)', 0, '2023-07-20', 1, '2023-07-19 18:54:14', '2023-07-20 17:11:19'),
(76, 'todas', NULL, 'Hoy arrancamos con las listas de promociones de planes largos chicos no se olviden! minimo 15 por dia, fecha de finalizacion el viernes 4 de la semana que viene', 0, '2023-07-24', 1, '2023-07-19 18:58:03', '2023-07-24 16:53:48'),
(77, 'todas', NULL, 'Hoy arrancamos con las listas de concepción, fecha de finalización dos semanas viernes 18 de agosto!', 0, '2023-08-07', 1, '2023-07-19 18:59:11', '2023-07-27 21:07:48'),
(78, 'monteros', NULL, 'NOTIFICAR A NAZARENITO: Comencemos con los prospectos de remarketing de la campaña de \"agustin\". Filtramos como lavez pasada todos los etiquetados \"campaña agustin\" y les enviamos el siguiente mensaje. Hola! (nombre) Soy Nazareno de hammer. Queria enviarte este video e invitarte y motivarte a formar parte de nuestre equipo!, aqui te presentamos nuestros servicios y actividades y por supuesto quedamos disponibles por este medio para cualquier consulta que nos quieras realizar! :)\r\n(enviar video por whatsapp web de hammer).\r\n\r\nLuego poner en chat oculto REMARKETING CAMPAÑA AGUSTIN \r\nNOTA: Recomiendo primero mandar  a todos los de whatsapp por que live connect te lo permite, y dejar todos los de facebook para el final por que esos hay que enviarles desde el face creo.\r\nNOTA2: Son 61 en monteros y 59 en concepcion por lo que hay que enviar bastantes por dia. No olvidar y colocando los numeros en las estadisticas enviados por dia e ir etiquetando a los que ya enviamos', 4, '2023-07-20', 1, '2023-07-19 21:28:44', '2023-07-20 11:30:44'),
(79, 'monteros', NULL, 'NAZARENITO: Recordar remarketing, releer la novedad anterior para no olvidar ningun detalle, fecha a finalizar este viernes', 4, '2023-07-24', 1, '2023-07-19 21:29:20', '2023-07-24 11:09:31'),
(80, 'monteros', NULL, 'Trabajo de remarketing finalizado, notificar a chocho resultados.', 4, '2023-07-28', 1, '2023-07-19 21:29:50', '2023-07-27 21:06:50'),
(81, 'monteros', NULL, 'PARA NAZA: No tengo publicado en las estadisticas la cantidad de videos enviados de remarketing de ayer, completar por favor', 4, '2023-07-21', 1, '2023-07-21 02:08:15', '2023-07-21 16:35:25'),
(82, 'monteros', NULL, 'PROMO BANCO NACION: Cambiaron las condiciones de la promo y paso a explicar los nuevos terminos ademas voy a poner un ejemplo para que tengan aqui el paso a paso de como realizarlo.\r\nSolo se puede pasar en 6 cuotas fijas y sin interes (recuerden poner el código 6 en vez de 16 en estos casos). Ya no acepta 12 cuotas y la devolución es de un 25% (ya no de 15%) hasta un tope de 3000 ( ya no de 1000)\r\nEl monto máximo que vamos a pasar por transacción es de 12000 (y se le devuelven 3000 por cada una que es el 25%).\r\nAÑO: Tendrá 3 meses gratis mas 6 cuotas fijas y sin interés. Pasamos  5 montos de 12000 (con código 6) y uno de 9600 )se devuelve 17400.\r\nSemestre: Tendrá casi 1 mes y medio gratis y 6 cuotas fijas y sin interés. Pasamos 2 montos de 12000 y uno de 10800 y se le devolverá 8700. Las devoluciones se hacen el primer mes, osea en el resumen de la tarjeta les saldran los pagos y las devoluciones el primer mes, como la devolucion es mas que el monto que van a pagar el primer mes les queda como saldo a favor. Me consultan por privado cualquier cosa', 0, '2023-07-28', 1, '2023-07-28 14:19:00', '2023-07-28 14:27:24'),
(83, 'concepcion', NULL, 'Terminar el control de comprobantes electronicos hasta el jueves para que este viernes veamos las ultimas 2 semanas', 10, '2023-07-01', 0, '2023-07-31 12:13:42', '2023-07-31 12:13:42'),
(84, 'todas', NULL, 'Movimientos de caja. Chicos cuando tengan egresos de mantenimiento, inversiones, eventos, marketing, cualquier tipo de egreso que sea fuera de lo comun me consultan para ver como lo sacan por que tengo varios movimientos cambiados (hacen un movimiento de mantenimiento y por ejemplo era de eventos). Muchas gracias', 0, '2023-08-01', 1, '2023-07-31 21:46:14', '2023-08-01 09:40:58'),
(85, 'monteros', NULL, 'La semana que viene se actualizan precios:\r\nMusculación 6600\r\nclases grupales 5500\r\npilates a confirmar\r\nLa promo de BNA: Pasaran 3 montos de 12mil y uno de 3600 en el semestre, por lo que se le devuelve a los clientes 9900 . AÑO: 6 montos de 12 mil y uno de 7200 en el año, se le devuelve a los clientes 19800 (me consultan bien cualquier cosa) esta promo es solo hasta fin de mes, les confirmamos si se actualizan y siguen igual el mes que viene.', 0, '2023-08-01', 1, '2023-08-01 12:24:17', '2023-08-01 13:23:38'),
(86, 'monteros', NULL, 'PRECIOS FINALES DESDE EL LUNES 07 (el domingo 06 ya figurarán los precios nuevos).\r\nAPARATOS 6600 - LIBRE 6900 - POR DIA 4900 - CLASES 5500 - PILATES sube 20% (hace 3 meses no subía) - CLASE 900', 0, '2023-08-02', 1, '2023-08-01 13:25:51', '2023-08-02 10:28:24'),
(87, 'concepcion', NULL, 'CABINA SOLAR. Procedimiento: cargar un plan nuevo con el nombre de CABINA SOLAR como si fuera un mensual, elegir cuantas sesiones contrata (hay packs de 3, 6, 10 o 15 sesiones). Dar turno para agotar un pase y marcar el presente (MUY IMPORTANTE ya que no vencen por tiempo). Entregar al cliente canasto: 1 toalla, algodon, cinta de papel. CONTROLAR QUE DEVUELVA EL CANASTO CON LAS 3 COSAS, sobre todo las toallas', 0, '2023-08-07', 1, '2023-08-02 15:25:24', '2023-08-07 10:32:18'),
(88, 'todas', NULL, 'GYMPASS Familiar: cada integrante tiene que hacer su checkin. Para nosotros no cambia nada. Además las dudas las deben consultar con su proveedor ya que cada empresa tiene sus convenios con Gympas (ej. hay empresas que te dan el mes gratis de gympass, otras medio mes, otras dan el mes para el empleado y un familiar, etc.). No depende de nosotros', 0, '2023-08-04', 1, '2023-08-03 16:13:40', '2023-08-04 09:35:20'),
(89, 'todas', NULL, 'NARANJA PLAN Z: se cobra con el código 11 en el POSNET y hacemos el 25% de recargo, vale solo para NARANJA común (la de color naranja), no sirven por ej la naranja master o visa.  Luego el cliente verá como lo paga (puede hacerlo en 1 o 3 cuotas al mismo precio que le pasamos el POSNET). Ejemplo un mensual de 100 pesos le cobra 125, luego el cliente puede pagar su resumen en 1 pago de 125, o 3 pagos de 41,66 pesos, eso lo arregla con NARANJA en la página web. Cualquier duda hay una tabla en recepción con los recargos y códigos para cada tarjeta.', 0, '2023-08-07', 1, '2023-08-04 13:31:02', '2023-08-07 10:34:35'),
(90, 'concepcion', NULL, 'CIERRE DE LOTE POSNET: Hacer todas las noches para que se puedan emitir los pagos y contar que coincidan los tickets abrochados con la cantidad de operaciones.', 13, '2023-08-04', 0, '2023-08-04 13:32:16', '2023-08-04 13:32:16'),
(91, 'concepcion', NULL, 'Mando un excel para ser imprimido, es para darle a la vanina, ella tiene que colocar los nombres de todas las personas que fueron a su clase, luego luciana le paga segun la cantidad de personas, 600 menos de 10, de 10 a 15 $800 y mas de 15 $1000. Luego tiene que entrar a accesos poner control g que es el buscador y corroborar que realmente esa persona haya ido, eso lo hace luego de pagarle y que vanina se vaya, si hay algun error me notifican. Si no se entiende el proceso me hablan y lo vemos, te mando la planilla por whatsapp asi imprimis unas 20 hojas y le mandas a marcelo luego que imprima mas, le explicas a vanina y a luciana asi desde hoy lunes lo comenzamos a hacer.', 14, '2023-08-07', 1, '2023-08-05 18:36:06', '2023-08-07 23:31:23'),
(92, 'monteros', NULL, 'Tareas Brisa para el lunes:\r\n- Factura ARCOR cargar\r\n- Actualizar en el DRIVE los precios de Ades, Cepita y Speed nada mas (lo demás hace Loana). Avisarme si algo esta menos del 60% de margen en ultima columna\r\n- Agregar COBRIZZO y EXPRESSO al drive, pedir precios a Marcelo\r\n- Subir los precios de: GASEOSA 400, POWER 450, POWER GRANDE 700 (ver precios que puse en el DRIVE)', 4, '2023-08-07', 1, '2023-08-06 20:46:36', '2023-08-07 11:46:43'),
(93, 'todas', NULL, 'REMERA \"Entrena X\": Precio $7.000, para socios queda en $6.000 (bonificar y aclarar). Son dos stock, una por sexo', 0, '2023-08-08', 1, '2023-08-08 11:33:11', '2023-08-08 11:58:38'),
(94, 'concepcion', NULL, 'Cabina Solar: Arranca el lunes, es con turno, los primeros turnos debemos dar en los horarios de Irina para que recepción (o si estan saturadas subirá Irina) acompañe al cliente y explique como funciona la cabina. A los clientes que ya conozcan el proceso les pueden dar turnos a futuro a la siesta. Hay un papelito pegado en recepción que dice todo lo que tiene que tener el canasto que entreguen. Si falta algo debe estar en el botiquin. Se colocan una ficha para 8 min y dos para 12. Las primeras dos sesiones se recomienda hacer 8 minutos, la cabina es FUERTE, no es como cuando estaba en Celeste Solarium. Verifiquen que los clientes devuelvan las cosas entregadas.', 0, '2023-08-11', 0, '2023-08-08 13:32:13', '2023-08-08 13:32:13'),
(95, 'concepcion', NULL, 'Cabina Solar: recordar que es con turnos, los dan a la primera vez de cada cliente de 8:30 a 12:30, y 17 a 21 hs. A los que conozcan a futuro les daremos en los demas horarios para que hagan solos. Los turnos duran 30 minutos. Si va alguien sin turno le deben dar turno en el momento, sujeto a disponibilidad.', 0, '2023-08-14', 0, '2023-08-08 13:34:09', '2023-08-08 13:34:09'),
(96, 'concepcion', NULL, 'hacer imprimir las copias de ayer, avisar a irina asi les entrega a vanina en el primer turno', 10, '2023-08-09', 1, '2023-08-08 22:43:35', '2023-08-09 10:12:30'),
(97, 'concepcion', NULL, 'a vanina le entregamos unas planillas, esas tiene que completarlas todos los dias con los nombres de las personas que asisten a su clase, esa planilla despues cuando te la devuelva hay que hacer un chequeo con los accesos, osea se le paga segun lo que ella anoto, no hay problema pero luego se corrobora con sistema que este todo bien y si alguna vez falla algo me avisas.  Entras a accesos pones control g y vas  escribiendo los nombres, es rápido y tildando a la par de cada uno', 13, '2023-08-09', 1, '2023-08-08 22:49:37', '2023-08-09 19:18:52'),
(98, 'concepcion', NULL, 'CABINA SOLAR: Hay dos tipos de planes: \r\n- CABINA SOLAR X12 MIN y\r\n- CABINA SOLAR X8 MIN.\r\nDentro de cada plan hay varios precios segun cuantos pases tiene...\r\nEl de 12MIN tiene pack de 1 sesión, 3, 6, 10 y 15 sesiones. Son INDIVIDUALES y vencen en todo el año. En caso de querer compartir entre 2 personas solo se puede con el pack de 15...\r\nEl de 8MIN solo tiene 1 sesión, 3 y 6 sesiones. Si alguien quiere por ej el de 10 que compren el de 12MIN y hagan 8, expliquen que esos packs grandes son precios unicos sea que hagan 8 o 12, porque son casi iguales los precios', 0, '2023-08-14', 0, '2023-08-09 12:29:09', '2023-08-09 12:29:09'),
(99, 'todas', NULL, 'Recordar de terminar de cobrar los productos fiados hasta el viernes.', 0, '2023-08-15', 0, '2023-08-10 12:20:19', '2023-08-10 12:20:19'),
(100, 'todas', NULL, 'RESPUESTAS RAPIDAS: En el live connect tienen agregado a respuestas rapidas la info + imagenes con los precios y planes de las cabinas solares planes largos, promos familiares y promo referidos. Es para que cuando le consulten directamente puedan responder con esas respuestas y no tengan que escribir todo', 0, '2023-08-11', 0, '2023-08-10 15:47:44', '2023-08-10 15:47:44'),
