(107, 'concepcion', NULL, '<p><b>LOANA Y LU: </b>Hasta el viernes de la semana que viene ya deberian estar todos los mensajes enviados de las planilals de prospeccion&nbsp; de mayo a julio. Tildan los enviados, tildan de nuevo los agendados y luego hacemos un 3 tilde para los convertidos, ya que no pusimos los titulos hagamos asi. Luego a fin de mes vemos la situacion de todos y cobran las comisiones. Les recomiendo que hagan pocos mensajes por dia y los sigan bien asi aumentan el porcentaje de conversion&nbsp;</p>', 0, '2023-08-16', 0, '2023-08-15 19:19:28', '2023-08-15 19:19:28'),
(108, 'concepcion', NULL, '<p><b>LOANA Y LU: </b>Continuar con la prospeccion</p>', 0, '2023-08-21', 0, '2023-08-15 19:24:09', '2023-08-15 19:24:09'),
(109, 'concepcion', NULL, '<p><b>LOANA Y LU:</b>&nbsp;Enviar foto de la planilla de prospeccion ya completada</p>', 0, '2023-08-25', 0, '2023-08-15 19:24:49', '2023-08-15 19:24:49'),
(110, 'concepcion', NULL, '<p><b>LOANA Y LU: </b>Mandarme mensaje asi revisamos las conversiones y comienzan a cobrar las comisiones de los prospectos</p>', 0, '2023-08-31', 0, '2023-08-15 19:25:26', '2023-08-15 19:25:26'),
(111, 'concepcion', NULL, '<p><b>KPIS : </b>Completar todos los kpis faltantes</p>', 10, '2023-08-16', 0, '2023-08-15 19:26:18', '2023-08-15 19:26:18'),
(112, 'monteros', NULL, '<p>Llamar a arnet, asi podemos terminar de solucionar el tema del wifi de los clientes, que manden un tecnico para que vea por que se no se conecta digamos</p>', 3, '2023-08-16', 0, '2023-08-15 19:36:59', '2023-08-15 19:36:59'),
(113, 'todas', NULL, '<p><b>ORGANIZACION PLANILLAS DE INSCRIPCION: </b>Comenzaremos a organizar las planillas de inscripción, por sede habrá 9 cajas&nbsp;<span style=\"background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">AB_CD_EF_GHI_JKL_MNÑ_OPQR_STU_VWXYZ, ahi pondremos según&nbsp;el APELLIDO de la persona en cada una las fichas, además&nbsp;se comprara una carpeta (las que ya vienen divididas por nombres) y en esas carpetas iremos poniendo las del mes, a fin de mes las pasamos fácilmente&nbsp;a las cajas y vamos renovando todos los meses. En concepcion pondremos unas nuevas fichas de cabina solar, esas irán&nbsp;en una caja aparte que sea solo para cabina solar, a todas las personas que vayan yendo siempre les preguntan si ya llenaron la planilla de la cabina, habrá&nbsp;que preguntar siempre por que si no no sabrán&nbsp;si ya las llenaron o no</span></p>', 0, '2023-08-17', 0, '2023-08-15 19:54:01', '2023-08-15 19:54:01'),
(114, 'concepcion', NULL, '<p>PLANILLA DE VISITAS: explicar a loana que te complete con las visitas del día y luego ir agregando las visitas que se sumen. Al final del día el coordinador completará los presentes y observaciones.</p>', 14, '2023-08-16', 0, '2023-08-16 11:55:33', '2023-08-16 11:55:33'),
(115, 'monteros', NULL, '<p>Arranca nuevo entrenador en funcional. Tomas Poli</p>', 0, '2023-08-17', 0, '2023-08-16 17:57:17', '2023-08-16 17:57:17'),
(116, 'monteros', NULL, '<p>coordinar feriados con profes, pablo no dara, los demas no se tienen que confirmar esta mañana para que naza haga ya los flyers y subamos ahi, y pongamos las novedades en molinete, abriremos de 9 a 22 hs</p>', 3, '2023-08-17', 0, '2023-08-16 19:43:02', '2023-08-16 19:43:02'),
(117, 'concepcion', NULL, '<p>lunes abrimos de 9 a 22 hs, los coordinadores trabajaran en turno tarde de 5 a 22, hablar con los profes asi confirmen esta mañana si dictaran clases para pedirle a nazareno que haga los flyers y pongan el cartel de novedades en el molinete. Tiene que estar finalizado todo hasta antes del mediodia</p>', 14, '2023-08-17', 0, '2023-08-16 19:44:20', '2023-08-16 19:44:20'),
(118, 'monteros', NULL, '<p><b>BOMBEROS VOLUNTARIOS:</b> Chicos, con los bomberos voluntarios tenemos un convenio, pueden venir 2 chicos por mes a entrenar en horarios de la mañana, y de 17 a 19 horas, son los dos horarios nada mas que tienen disponible</p><p>ahi le cargue a alvarez milagros que era la chica del otro dia, el plan arranca del 1 al 30 de cada mes, todos lso meses se renueva y se le bonifica con la observacion \"BOMBEROS VOLUNTARIOS\" siempre y cuando sigan yendo obviamente, les comento por si vienen el 10 por ejemplo de septiembre le cargan el contrato desde el 1 de septiembre</p><p>ahora iba a comenzar la otra chica, asi que cuando vaya diciendo que es de los bomberos llena la planilla&nbsp; y le cargan el contrato desde el 1 de agosto, le explican los horarios y le explican lo del profe, no tienen profe</p><p>si va otro de parte de los bomberos le dicen que ya nos pasaron la&nbsp; lista completa de los cupos de este mes, que hable con sergio garcia cualquier cosa</p>', 0, '2023-08-18', 0, '2023-08-17 15:35:21', '2023-08-17 15:35:21'),
(119, 'todas', NULL, '<p><b>REMERAS</b> NUEVOS PRECIOS:</p><p>8500 NO SOCIOS</p><p>7200 SOCIOS (15% OFF)</p>', 0, '2023-08-21', 0, '2023-08-17 15:53:01', '2023-08-17 15:53:01'),
(120, 'todas', NULL, '<p><span style=\"background-color: var(--bs-card-bg); color: var(--bs-modal-color); font-family: var(--bs-body-font-family); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\"><b>Cabina solar</b></span><span style=\"background-color: var(--bs-card-bg); color: var(--bs-modal-color); font-family: var(--bs-body-font-family); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">:&nbsp;</span>Nuevos precios. Se anula la venta de packs de 15.</p>', 0, '2023-09-01', 0, '2023-08-17 16:14:04', '2023-08-17 16:14:04'),
(121, 'monteros', NULL, '<p><b>PILATES:</b> extender el contrato un dia mas (no es un dia mas siempre, por ejemplo si una chica se le suspendio la clase de ayer jueves pero recien tenia de nuevo el martes que viene hay que extenderle 5 dias por ejemplo, osea tenemos que extender hasta que pueda hacer una clase mas segun su turno, si no se entiende me mandas un whatsapp. A todos los del turno tarde del dia de ayer jueves por que soraire suspendio la clase</p>', 4, '2023-08-18', 0, '2023-08-17 18:23:10', '2023-08-17 18:23:10');
INSERT INTO `novedades` (`id`, `sede`, `titulo`, `mensaje`, `user`, `vencimiento`, `estado`, `created_at`, `updated_at`) VALUES
(122, 'monteros', NULL, '<p><b>EVENTO! </b>Mañana<b>&nbsp;</b>es el aniversario, avisarles a todos los profes que y colaboradores que deben venir con la remera naranja. Se colocara ornamentacion y habra DJ de 18 a 22 hs + jugos a la mañana y tarde noche. Deben avisarle a toda la gente que lea el cartelito de la entrada que pondremos asi participan por un monton de sorteos, incluidas unas zapatillas de GERF. Ponerle buena onda y mucha felicidad&nbsp;</p>', 0, '2023-08-21', 0, '2023-08-17 20:31:01', '2023-08-17 20:31:01'),
(123, 'monteros', NULL, '<p>KPIS Simplificados: registrar solo PROSPECTOS MOSTRADOR Y REDES Y REFERIDOS y los PROSPECTOS NO CONVERTIDOS</p>', 4, '2023-08-18', 0, '2023-08-18 00:05:13', '2023-08-18 00:05:13'),
(124, 'concepcion', NULL, '<p>KPIS Simplificados: registrar solo PROSPECTOS MOSTRADOR Y REDES Y REFERIDOS y los PROSPECTOS NO CONVERTIDOS<br></p>', 10, '2023-08-18', 0, '2023-08-18 00:05:36', '2023-08-18 00:05:36'),
(125, 'monteros', NULL, '<p><b>KPIS VENTAS: </b>Cambiamos AGENDAS conseguidas por VISITAS PACTADAS (viene a abonar o clase/semana de prueba). Tambien vamos a registrar en ETIQUETAS PROSPECTOS LIVECONNECT las etiquetas de prospectos redes (PROSPECTOS LC) + las etiquetas de prospectos mostrador, que son aquellos que fueron primero por mostrador y al otro día se contactan para coordinar una visita.</p>', 3, '2023-08-18', 0, '2023-08-18 00:10:32', '2023-08-18 00:10:32'),
(126, 'concepcion', NULL, '<p><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-weight: bolder;\">KPIS VENTAS:&nbsp;</span>Cambiamos AGENDAS conseguidas por VISITAS PACTADAS (viene a abonar o clase/semana de prueba). Tambien vamos a registrar en ETIQUETAS PROSPECTOS LIVECONNECT las etiquetas de prospectos redes (PROSPECTOS LC) + las etiquetas de prospectos mostrador, que son aquellos que fueron primero por mostrador y al otro día se contactan para coordinar una visita.<br></p>', 14, '2023-08-18', 0, '2023-08-18 00:10:44', '2023-08-18 00:10:44'),
(127, 'todas', NULL, '<p><b>ETIQUETAS LC: </b>Se agrega PROSPECTOS CABINA SOLAR y SOCIOS CABINA SOLAR, les pido si algun socio de gimnasio pregunta por cabina lo etiqueten tambien como prospecto cabina solar, ayuda despues a hacerlas campañas de remarketing.</p>', 0, '2023-08-18', 0, '2023-08-18 00:12:06', '2023-08-18 00:12:06'),
(128, 'todas', NULL, '<p><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-weight: bolder;\">TARJETAS:&nbsp;</span>Cambian los intereses, revisar nuevas tablas:<br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">AHORA 3: 25%, AHORA 6: 40%, AHORA 12: 80%. Lo demás sigue igual (debito, credito, naranja plan Z). Ya pasaremos instrucciones para planes largos.<br></p>', 0, '2023-08-22', 0, '2023-08-18 16:36:44', '2023-08-18 16:36:44'),
(129, 'concepcion', NULL, '<p><b>INSCRIPCION CABINA SOLAR: </b>Fichas similares a la de SOCIOS NUEVOS, pero es importante que lo firme la gente porque es el desligue de responsabilidad por parte de Hammer. Incluso los que son socios de gimnasio y sea la primera vez que hagan cabina tienen que completar el nombre, DNI y firma al menos. Tiene los datos necesarios para dar de alta en el sistema también</p>', 0, '2023-08-21', 0, '2023-08-19 20:44:38', '2023-08-19 20:44:38'),
(130, 'concepcion', NULL, '<p>Corregir KPIS lo de SS NUEVOS MES ANTERIOR/NO RENOVADOS, ya lo pedí el viernes y me hubiera gustado que se corrija ese día.</p>', 10, '2023-08-21', 0, '2023-08-20 20:17:49', '2023-08-20 20:17:49'),
(131, 'monteros', NULL, '<p>Revisar KPIS (Brisa): Prospectos most+redes+ref debería ser mayor a Prospectos NO Convertidos, ya que representa el total de prospectos. Ejemplo: tengo 10 mostrador, 15 redes y 3 referidos, son 28 prospectos TOTALES, de ahí no convertidos podrían ser 15 y convertidos 13. Siempre es menor no convertidos a la suma de los otros 3 (prosp. totales). Lo que puede estar pasando es que no estemos registrando todos los prospectos</p>', 4, '2023-08-21', 0, '2023-08-20 20:20:44', '2023-08-20 20:20:44'),
(132, 'monteros', NULL, '<p><b>KPIS VENTAS: </b>Recordar que en KPIS, la parte de VISITAS PACTADAS es solo si lograron una agenda con VIENE A ABONAR o CLASE DE PRUEBA SOCIO, no las demas agendas random como \"se enfermó y le escribiremos el mes que viene\". Y luego a la derecha del todo en VISITAS DEL DIA son las visitas de socioplus (prospectos). No mezclar conceptos.</p>', 3, '2023-08-23', 0, '2023-08-20 22:10:22', '2023-08-20 22:10:22'),
(133, 'concepcion', NULL, '<p><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-weight: bolder;\">KPIS VENTAS:&nbsp;</span>Recordar que en KPIS, la parte de VISITAS PACTADAS es solo si lograron una agenda con VIENE A ABONAR o CLASE DE PRUEBA SOCIO, no las demas agendas random como \"se enfermó y le escribiremos el mes que viene\". Y luego a la derecha del todo en VISITAS DEL DIA son las visitas de socioplus (prospectos). No mezclar conceptos.<br></p>', 14, '2023-08-23', 0, '2023-08-20 22:10:35', '2023-08-20 22:10:35'),
(134, 'monteros', NULL, '<p>POST EVENTO: Acomodar todas las cosas, dejar luces en oscar, guardar bandera, ornamentacion, bajar mesa de dj, acomodar prensa, banderin, cable dj, vasos, todo lo que haya a la bolsa negra y guardar en deposito.<br>Hacer papelitos con todos los uqe compartieron la historia y ponerlos dentro de la caja y hacer el&nbsp; sorteo, esta mañana lo sorteamos. Tiene que haber un ganador para:<br>Zapatillas de GERF<br>Remera de hammer (si no hay talle se le da un mensual)<br>Cerveza de cb + cortes de pelo<br>Meriendas de Roma<br>No se si participo la rocio carrizo tambien&nbsp;<br>Trabajar en conjunto con nazareno para que les haga el flyer que diga GANADORES SORTEO ANIVERSARIO y abajo cada uno de los premios (etiquetar al local) y etiquetar al ganador en el costado.<br></p>', 0, '2023-08-23', 0, '2023-08-23 05:16:35', '2023-08-23 05:16:35'),
(135, 'concepcion', NULL, '<p><b>PROSPECCION</b>: Háganme un reporte de como van con los mensajes de prospectos que les pase, este viernes había que terminar ya.</p>', 10, '2023-08-23', 0, '2023-08-23 05:17:27', '2023-08-23 05:17:27'),
(136, 'concepcion', NULL, '<p><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-weight: bolder;\">PROSPECCION</span>: Háganme un reporte de como van con los mensajes de prospectos que les pase, este viernes había que terminar ya.<br></p>', 13, '2023-08-23', 0, '2023-08-23 05:17:39', '2023-08-23 05:17:39'),
(137, 'monteros', NULL, '<p><b>RECAPTACION</b>: Hay que ponernos las pilas estos tres dias para terminar con las listas este viernes&nbsp;</p>', 3, '2023-08-23', 0, '2023-08-23 05:18:17', '2023-08-23 05:18:17'),
(138, 'monteros', NULL, '<p><b>KPIS VENTAS</b>: Se cambia VISITAS AUSENTES por VISITAS PRESENTES (lo pueden sacar al dato de la planilla que mandan foto, de paso chequean que los ausentes de su planilla coincidan con los que quedaron ausentes en amarillo del programa SPlus). </p><p>Recordar también que en la parte de ETIQUETAS LIVECONNECT van las ETIQUETAS REDES y ETIQUETAS MOSTRADOR que obtengan del programa.&nbsp;</p>', 3, '2023-09-01', 0, '2023-08-23 12:48:11', '2023-08-23 12:48:11'),
(139, 'concepcion', NULL, '<p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\"><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-weight: bolder;\">KPIS VENTAS</span>: Se cambia VISITAS AUSENTES por VISITAS PRESENTES (lo pueden sacar al dato de la planilla que mandan foto, de paso chequean que los ausentes de su planilla coincidan con los que quedaron ausentes en amarillo del programa SPlus).</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Recordar también que en la parte de ETIQUETAS LIVECONNECT van las ETIQUETAS REDES y ETIQUETAS MOSTRADOR que obtengan del programa.&nbsp;</p>', 14, '2023-09-01', 0, '2023-08-23 12:48:35', '2023-08-23 12:48:35'),
(141, 'todas', 'GYMPASS CHECKINS', 'El cliente debe SOLICITAR el CHECKIN en su celu y directamente poner su GYMPASS ID en el molinete. El sistema solo valida el checkin y carga la clase. Los egresos de dinero se harán a fin de mes por cuenta mia asi que no toca la caja. Si el cliente desea se puede cambiar el ID GYMPASS por el DNI pero se modifica desde CHIP/CODIGO DE BARRAS y NO desde Nº DE DOCUMENTO.', 0, '2023-08-28', 0, '2023-08-25 12:22:29', '2023-08-25 12:22:29'),
(142, 'todas', 'PROMO BNA', 'Este jueves, y solo por este jueves tenemos la promo de bna, consiste en realizar un reintegro de un 25% en los planes semestrales y anuales para todos aquellos que abonen con tarjeta de credito de banco nacion y en 6 cuotas (Recuerden que solo en este caso usarian el codigo 6 y solamente se puede usar 6 cuotas no 12 tanto para el anual como semestral). Si hay alguien que no recuerde bien como realizar el cobro y como explicarle a la gente el por que de las muchas facturas me manda un mensaje y lo vemos nuevamente las veces que sea necesario. El otro mes confirmamos si continuamos con la promo', 0, '2023-08-28', 0, '2023-08-28 12:54:08', '2023-08-28 12:54:08'),
(143, 'monteros', 'KPIS PROSPECTOS LIVECONNECT', 'No continuaremos realizandolo desde estadisticas de uso ya que estan mal desde aqui, para poder filtrar vamos a tener que entrar a HISTORIAL, luego seleccionamos las ultimas 24 hs y veremos los del dia anterior, de todas maneras podemos seleccionar por ejemplo ultimos 7 dias e iran saliendo con su fecha cada una de las conversaciones. ¿Cual es el problema? Que por ejemplo si alguien manda el 20, lo etiquetamos y luego volvemos a conversar el 21 saldra con fecha del 21, por lo que tenemos que entrar a conversacion por conversacion para ver que sea de ese dia efectivamente, es decir entramos a una conversacion que nos sale el 21 por ejemplo, y cuando leemos vemos que la misma comenzo el 20 la descartamos (se supone que cuando hicimos las estadisticas del 20 ya la pusimos ahi). Cualquier cosa me consultan si no entienden, les recomiendo que los hagan de manera diaria para que no se acumulen conversaciones y sean pocas', 4, '2023-08-30', 0, '2023-08-29 19:20:22', '2023-08-29 19:20:22'),
(144, 'concepcion', 'KPI CONSULTAS LIVE CONNECT', 'No continuaremos realizandolo desde estadisticas de uso ya que estan mal desde aqui, para poder filtrar vamos a tener que entrar a HISTORIAL, luego seleccionamos las ultimas 24 hs y veremos los del dia anterior, de todas maneras podemos seleccionar por ejemplo ultimos 7 dias e iran saliendo con su fecha cada una de las conversaciones. ¿Cual es el problema? Que por ejemplo si alguien manda el 20, lo etiquetamos y luego volvemos a conversar el 21 saldra con fecha del 21, por lo que tenemos que entrar a conversacion por conversacion para ver que sea de ese dia efectivamente, es decir entramos a una conversacion que nos sale el 21 por ejemplo, y cuando leemos vemos que la misma comenzo el 20 la descartamos (se supone que cuando hicimos las estadisticas del 20 ya la pusimos ahi). Cualquier cosa me consultan si no entienden, les recomiendo que los hagan de manera diaria para que no se acumulen conversaciones y sean pocas', 10, '2023-08-30', 0, '2023-08-29 19:20:51', '2023-08-29 19:20:51'),
(145, 'todas', 'ACTUALIZACION CUOTA', 'Notificar en molinete la actualización de la cuota el lunes 11/9. Poner \"Consulta por tus planes largos\".&nbsp;', 0, '2023-09-04', 0, '2023-08-29 20:15:57', '2023-08-29 20:16:53'),
(146, 'concepcion', 'ORGANIZAR PLANILLAS', 'Hay que usar las cajas que estan en recepcion para organizar las planilals de inscripcion por orden alfabetico, tal vez tome algunos sabados, hay que marcarlas a las cajas con felpon : ABC - DEF- GHIJ- KLMN- OPQR- STU - VWXYZ y vamos poniendo las planilals adentro de cada una', 19, '2023-09-02', 0, '2023-08-29 20:19:06', '2023-08-29 20:19:06'),
(147, 'concepcion', 'NOVEDAD EN MOLINETE', 'Colocar que abrimos el sabado de 15 30 a 20 hs por tareas de remodelacion', 0, '2023-08-30', 0, '2023-08-29 20:19:38', '2023-08-29 20:19:38'),
(148, 'concepcion', 'YOGA NUEVO HORARIO', 'Enviar el siguiente mensaje: \"Hola! Como estas? Soy LUCIANA de Hammer y queria comentarte que a partir de la semana que viene comenzaremos a armar un nuevo grupo para el horario de la mañana a 8.30 hs , el cual contara con una disponibilidad de 12 cupos! Envianos un mensaje si estas interesad@ asi te guardamos tu lugar :). Muchas gracias! Aguardo tu respuesta :)<br><br><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"80\" style=\"width: 60pt;\"><colgroup><col width=\"80\" style=\"width:60pt\"></colgroup><tbody>\r\n <tr height=\"20\" style=\"height:15.0pt\">\r\n  <td height=\"20\" align=\"right\" style=\"height:15.0pt\"><span style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-weight: bolder; text-align: start;\">LUCIANA&nbsp;<br></span>5983100</td>\r\n </tr>\r\n <tr height=\"20\" style=\"height:15.0pt\">\r\n  <td height=\"20\" align=\"right\" style=\"height:15.0pt\">10014247</td>\r\n </tr>\r\n <tr height=\"20\" style=\"height:15.0pt\">\r\n  <td height=\"20\" align=\"right\"