INSERT INTO `novedades` (`id`, `sede`, `titulo`, `mensaje`, `user`, `vencimiento`, `estado`, `created_at`, `updated_at`) VALUES
(150, 'todas', 'PROMO BNA', 'La promocion de BNA sigue durante todo este mes, la idea es activarla, siempre preguntenle a la gente si tiene tarjeta nacion, si no tienen no les digan nada, si es que tienen le ofrecen para los jueves. como le pusimos interes ya a los planes largos con tarjeta de 10% al semestre y 35% al anual, seguramente ya no compren tanto, asi que habra que activar efectivo y esta', 0, '2023-09-01', 0, '2023-08-31 21:19:24', '2023-08-31 21:19:24'),
(151, 'monteros', 'VISITAS', 'Por favor no te olvides de enviar los mensajes de visitas de la mañana y de hacer las agendas, las dos de ayer que no vinieron&nbsp;<br>Flores Mariana alejandra y Apud Camila no vinieron, Apud nos mando ella esta bien pero Alejandra no tenia cargada la agenda de dia despues osea que no te saldra hoy y ademas no tenia el mensaje de visitas enviado temprano, eso es lo mas importante, por que al menos despues con la agenda los podemos recuperar.', 3, '2023-09-01', 0, '2023-09-01 00:30:13', '2023-09-01 00:30:13'),
(152, 'concepcion', 'YOGA', '<p>                ARRANCA NUEVO TURNO YOGA MIERCOLES VIERNES 8.30 AM</p><p><br></p>', 0, '2023-09-01', 0, '2023-09-01 16:11:57', '2023-09-04 18:38:50'),
(153, 'monteros', 'KPIS', '<p>Modificación: no contaremos más los SOCIOS RENOVADOS ni REMATRICULADOS.</p><p>Chequeo: controlar los socios nuevos al final de la tabla de la columna NUEVOS, que coincida con la foto que mandó Jessi, sumatoria de nuevos.</p>', 4, '2023-09-04', 0, '2023-09-02 18:51:24', '2023-09-02 18:51:24'),
(154, 'concepcion', 'KPIS', '<p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Modificación: no contaremos más los SOCIOS RENOVADOS ni REMATRICULADOS.</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Chequeo: controlar los socios nuevos al final de la tabla de la columna NUEVOS, que coincida con la foto que mandó Jessi, sumatoria de nuevos.</p>', 10, '2023-09-04', 0, '2023-09-02 18:51:46', '2023-09-02 18:51:46'),
(155, 'monteros', 'KPIS', '<p>Empezar a llevar exactas las estadísticas de KPIS, diferenciar ventas con recaptación, si son presentes/no contesta/o se reprograman etc, cualquier duda consultar. Mandar foto todos los días para ir chequeando.&nbsp;</p><p>Recordar: las visitas son con contratación cargada de clases de prueba o viene a abonar (son prospectos). Las agendas (son recaptaciones) deben decir en observaciones: clase de prueba socio o viene a abonar socio para poder diferenciar claramente de las demás agendas.</p>', 3, '2023-09-04', 0, '2023-09-02 19:14:21', '2023-09-02 19:14:21'),
(156, 'concepcion', 'KPIS', '<p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Empezar a llevar exactas las estadísticas de KPIS, diferenciar ventas con recaptación, si son presentes/no contesta/o se reprograman etc, cualquier duda consultar. Mandar foto todos los días para ir chequeando.&nbsp;</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Recordar: las visitas son con contratación cargada de clases de prueba o viene a abonar (son prospectos). Las agendas (son recaptaciones) deben decir en observaciones: clase de prueba socio o viene a abonar socio para poder diferenciar claramente de las demás agendas.</p>', 14, '2023-09-04', 0, '2023-09-02 19:14:38', '2023-09-02 19:14:38'),
(157, 'monteros', 'KPIS Modif', 'Ahora en VISITAS son VISITAS PRESENTES en vez de AUSENTES, la deben calcular de su planilla manual o indirectamente de sistema que muestra los ausentes. Corregir si hicieron al reves los primeros dias del mes.', 3, '2023-09-04', 0, '2023-09-02 19:17:07', '2023-09-02 19:17:07'),
(158, 'concepcion', 'KPIS Modif', 'Ahora en VISITAS son VISITAS PRESENTES en vez de AUSENTES, la deben calcular de su planilla manual o indirectamente de sistema que muestra los ausentes. Corregir si hicieron al reves los primeros dias del mes.', 14, '2023-09-04', 0, '2023-09-02 19:17:26', '2023-09-02 19:17:26'),
(159, 'concepcion', 'yoga', 'al final seria miercoles viernes', 0, '2023-09-05', 0, '2023-09-04 20:12:08', '2023-09-04 20:12:08'),
(160, 'concepcion', 'ALQUILER ORQUERA', 'Pagar en la financiera hoy al mediodía (puede ir irina 10 min antes de terminar el turno)', 10, '2023-09-07', 0, '2023-09-06 15:43:29', '2023-09-06 15:43:29'),
(161, 'concepcion', 'ALQUILER ORQUERA', 'Pagar en la financiera hoy al mediodía (puede ir irina 10 min antes de terminar el turno)', 14, '2023-09-07', 0, '2023-09-06 15:43:47', '2023-09-06 15:43:47'),
(162, 'todas', 'CAMBIOS DE PLANES', 'Cambio de plan: Hemos incorporado en\r\nel contrato vigente del socio, la\r\nposibilidad de realizar un cambio de\r\nplan.\r\nAl hacer clic sobre dicha opción el\r\nsistema procese a mostrar la misma\r\npantalla de “Nuevo contrato”, para que\r\nseleccione el nuevo plan comercial a\r\ncontratar, quedando vinculados ambos\r\nplanes con el nuevo icono de referencia, TENGAN CUIDADO CON LAS FECHAS, DEBE RESPETARSE LA FECHA DE VENCIMIENTO SIEMPRE, Y PONGAN OBSERVACIONES', 0, '2023-09-07', 0, '2023-09-06 19:51:05', '2023-09-06 19:51:05'),
(163, 'todas', 'ACTUALIZACION CUOTA', 'Nueva cuota a partir de hoy, hablar con nazareno para que envie los archivos asi imprimen las nuevas cartillas.<br><br>', 0, '2023-09-11', 0, '2023-09-08 20:02:10', '2023-09-08 20:02:10'),
(164, 'todas', 'VIDEO PROMOCIONAL', 'Subimos nuevamente el video de Loana, esten atentos a responder todos los stickers, en cada apertura y cierre de turno revisan, son 6 personas para revisar lo mismo, no pueden quedar mensajes sin responder. Buen lunes!', 0, '2023-09-11', 0, '2023-09-08 20:02:57', '2023-09-08 20:02:57'),
(165, 'todas', 'VIDEOS PROMOCIONALES', 'REVISAR HISTORIAS Y ESTAR ATENTOS', 0, '2023-09-18', 0, '2023-09-08 20:06:16', '2023-09-08 20:06:16'),
(166, 'concepcion', 'MARIANO', 'Cuando toque pagar a Mariano DESCONTAR 300 pesos de dos barritas que vendio mal el viernes pasado por no saber usar el programa.', 13, '2023-09-15', 0, '2023-09-09 20:28:25', '2023-09-09 20:28:25'),
(167, 'concepcion', 'BARRAS', 'al finalizar turno entregar el mostrador con las barras totalmente lleno (organizarse para dejarlo lleno al mediodia o cuando haya menos movimiento. entregar tambien llena la heladera al turno siguiente', 10, '2023-09-11', 0, '2023-09-09 20:49:01', '2023-09-09 20:49:01'),
