(169, 'concepcion', 'CHICO DEL DNI', 'Mandarle msj al vaguito que le dio la cana Azul que le prestaba el DNI (no el que fue a la tarde sino el que le dio el DNI el sabado temprano), avisarle si sabia del suceso para pedirle a sus amigos que no lo repitan, ya que los planes se pagan por persona.', 14, '2023-09-12', 0, '2023-09-11 00:00:31', '2023-09-11 00:00:31'),
(172, 'todas', 'DESCUENTO INSTRUCTOR', '<p>Concepción 800 (queda en 7900)</p><p>Monteros 700 (queda en 6800)</p><p>El resto de las cosas siguen siendo porcentual como antes, si no hay vuelto lo dejan saldo a favor&nbsp;</p>', 0, '2023-09-12', 0, '2023-09-11 18:10:33', '2023-09-11 18:10:33'),
(173, 'todas', 'PRECIOS REMERAS', 'Actualizan a partir del lunes a 9300 (para los socios 8300)', 0, '2023-09-29', 0, '2023-09-12 13:40:47', '2023-09-12 13:40:47'),
(174, 'concepcion', 'PUBLICIDAD FACE', 'Se esta promocionando el video de Loana únicamente para Concepción y alrededores. La gente usará el contacto por facebook messenger, por whatsapp (tienen el boton en la publicacion) o por comentarios, a esto ultimo Irina debe ingresar cada día y contestar los msjs generales (ubicacion, horarios), y los que sean info o precio se pone RESPONDIDO POR MD. La promo estar vigente por una semana. Proceder normalmente derivando a Irina los prospectos, pero estaría bueno ir anotando cuantas personas se contactaron y los nombres para saber bien el resultado de la campaña. Armen una hojita donde puedan anotar todo: FECHA, NOMBRE, MEDIO DE CONTACTO, unicamente a la gente que provenga de esta campaña', 0, '2023-09-13', 0, '2023-09-13 16:27:59', '2023-09-13 16:27:59'),
(175, 'concepcion', 'PRECIOS (recien puedo subir la novedad)', 'MUSCULACION 8700<br>CLASES 7500<br>PASE LIBRE 9000<br>PASE LIBRE POR DIA 6900<br>YOGA&nbsp;6600<br>KIDS&nbsp;5500<br>AEROBIC&nbsp;5500<br>DIA 1000<br>SEMANA 3200<br>QUINCENA 5200<div style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; max-height: 40px;\">AEROBIC actualiza el 18 de septiembre,&nbsp;<span style=\"background-color: var(--bs-card-bg); color: var(--bs-modal-color); font-family: var(--bs-body-font-family); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">KIDS/TELA a confirmar si el 18 o 25</span></div><div><br></div>', 0, '2023-09-13', 0, '2023-09-13 16:32:18', '2023-09-13 16:32:18'),
(176, 'monteros', 'FRASES GERF', 'Al entregar las zapas pensar una frase (Adrian) y consultar otra (Marcelo/Chocho) para escribir en una nota al hacer la entrega del presente a los miembros del staff, para que quede mejor.', 3, '2023-09-18', 0, '2023-09-14 12:13:23', '2023-09-14 12:13:23'),
(177, 'monteros', 'PROFES', '<p>Coordinar lo de Tommy para que vaya al turno tarde.</p><p>Coordinar lo del turno 14 hs quien quedaría.</p>', 3, '2023-09-14', 0, '2023-09-14 12:14:07', '2023-09-14 12:14:07'),
(178, 'todas', 'SEMESTRE', '<p class=\"selectable-text copyable-text iq0m558w g0rxnol2\" dir=\"ltr\"><span class=\"selectable-text copyable-text\">Como vender un plan semestral (ejemplo), pueden usar lo siguiente o modificarlo. Si desean lo agregan a respuestas rápidas de liveconnect:<br><br>TEXTO:<br>El plan semestral se puede abonar de las siguientes maneras:<br></span><span style=\"background-color: var(--bs-card-bg); color: var(--bs-modal-color); font-family: var(--bs-body-font-family); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">- 1 cuota en efectivo (obtenes el sexto mes gratuito)<br></span><span style=\"background-color: var(--bs-card-bg); color: var(--bs-modal-color); font-family: var(--bs-body-font-family); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">- 2 cuotas en efectivo (con un recargo administrativo&nbsp;</span><span style=\"background-color: var(--bs-card-bg); color: var(--bs-modal-color); font-family: var(--bs-body-font-family); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">del 5%, también te regalamos el sexto mes)<br></span><span class=\"selectable-text copyable-text\" style=\"background-color: var(--bs-card-bg); color: var(--bs-modal-color); font-family: var(--bs-body-font-family); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">- 3 cuotas sin interés&nbsp;</span><span style=\"color: var(--bs-modal-color); font-family: var(--bs-body-font-family); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align); background-color: var(--bs-card-bg);\">con tarjeta de credito<br></span><span style=\"background-color: var(--bs-card-bg); color: var(--bs-modal-color); font-family: var(--bs-body-font-family); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">- 6 cuotas con solo un 10% de recargo<br><br><br>Se puede agregar las opciones de congelamiento.</span></p><p class=\"selectable-text copyable-text iq0m558w g0rxnol2\" dir=\"ltr\"><span class=\"selectable-text copyable-text\"><br></span></p>', 0, '2023-09-15', 0, '2023-09-14 15:58:58', '2023-09-14 15:58:58'),
(179, 'concepcion', 'YOGA', 'Plan de 4 veces por semana (2 a la siesta y 2 a la mañana) en promo a $8.900. Pueden ofrecerlo incluso a los mismo clientes ya que la diferencia es poca con el de dos veces.', 0, '2023-09-18', 0, '2023-09-18 12:09:25', '2023-09-18 12:09:25'),
(180, 'todas', 'CREMAS (info)', '<p>Les dejo info de las cremas para cabina solar:</p><p>Todas estan hechas de extractos de vegetales.<br>COBRIZZO: incrementa la velocidad del bronceado en un tono \"tipo cobre\" y estimulan la produccion de colageno (cuidado de la piel). Recomendado para las tres primeras sesiones.<br>EXPRESSO: adicional a lo anterior, también permite un bronceado más duradero al fijar el color. O sea es tipo mitad para cada cosa (velocidad y duración). Recomendado para la cuarta sesión en adelante.<br><br>En ambos casos se recomienda usar esto porque se logra un bronceado mas eficiente y saludable.</p><p>No se deben usar otro tipo de cremas no diseñadas para la cabina solar porque se puede bloquear todo el bronceado (en caso de usar protectores) o bien dañar la piel (bronceadores para sol), salvo recomendación de un dermatólogo.<br><br><br></p>', 0, '2023-09-19', 0, '2023-09-19 12:24:16', '2023-09-19 12:24:16'),
(181, 'concepcion', 'CENTENO', 'Descontar del sueldo medio mes de musculacion. Se hace el egreso de sueldo normal (completo) y luego le cobras de su perfil bonificando la mitad y devolves a caja la mitad del valor del mes para que quede todo bien registrado. No olvidar descontar los productos que debía el viernes pasado por si es que no se hizo aun', 13, '2023-09-22', 0, '2023-09-19 16:30:11', '2023-09-19 16:30:11'),
(182, 'todas', 'PLANES LARGOS', 'Cuando sean momentos de actualizacion de cuota, sobre todo en la ultima semana, es el mejor momento para vender los planes largos por que es cuando las personas van a preguntar los nuevos precios y se les puede dar la solucion de venderles el plan largo, lo que si tienen que tener en cuenta que ahi es cuando lo podemos apurar que son los ulitmos dias para que tome una decision rapida y no racional', 0, '2023-09-20', 0, '2023-09-19 19:55:29', '2023-09-19 19:55:29'),
(183, 'monteros', 'PILATES', 'Antes de eliminar a un ex cliente de la planilla pilates les mandemos un msj para que nos aseguremos que no continuaria asistiendo, de esta manera tambien podemos aprovechar para recaptar algunos clientes que no querran perder sus turnos, es necesario que todos los viernes controlen a todos los vigentes, la brisa en el turno mañana y siesta y jessi tarde y noche', 0, '2023-09-20', 0, '2023-09-19 19:56:40', '2023-09-19 19:56:40'),
(184, 'concepcion', 'CORREOS ELECTRONICOS', 'Organizar para que el turno mañana complete los correos electronicos de las personas que estan inscriptas en estos ultimos 3 meses (aprox 300), hacer unos 20 por día e ir pasando para otra caja.', 0, '2023-09-20', 0, '2023-09-20 12:10:05', '2023-09-20 12:10:05'),
(185, 'monteros', 'BUSINESS SUITE', '<p>Ante la posibilidad de que se caigan en LC las plataformas de FB e IG, hay que abrir el Business Suite. Pasos:<br>- Ingresar en facebook<br>- Usuario \"hammergimnasio@gmail.com\", contraseña \"hammer123=\"<br>- Ir a la izquierda donde dice Hammer Fitness &amp; Gym (en acceso directos o páginas)<br>- Ir a la izquierda donde dice Mas Herramientas<br>- Abrir el Meta Business Suite</p><p>Desde allí pueden monitorear en bandeja de entrada ademas de los chats, los comentarios.&nbsp;<br>Por otro lado al comentar desde ahí les aparecerá como HAMMER y no como Cesar Robles.</p>', 3, '2023-09-20', 0, '2023-09-20 12:26:24', '2023-09-20 12:26:24'),
