(187, 'concepcion', 'TRANSFERENCIAS CBU NUEVO', 'Usar el CBU de Personal Pay exhibido en recepcion. Se egresa como TRANSF PERSONAL PAY. Poner horarios, ej, de 2 a 6 tratar de usar el de personal y de 6 a 10 el de diego.', 13, '2023-09-20', 0, '2023-09-20 13:26:52', '2023-09-20 13:26:52'),
(188, 'todas', 'FERIADOS Y EVENTO', 'FERIADOS: El lunes por empleado de comercio abrimos solo de 14 a 22 hs. Hablar con Adrian e irina para que coordine los puestos. Con respecto a las clases ya subiremos los flyers asi ven de ahi la info tambien. Nazareno pasara la imagen asi colocamos ya nada mas en molinete<br><br>Evento Martes para dar bienvenida a la primavera: Haremos como siempre, jugos, galletas, sorteos, ornamentacion de primavera, DJ, trataremos que este disponible para todos los horarios. Si tienen ideas para complementar me avisan', 0, '2023-09-21', 0, '2023-09-21 12:47:06', '2023-09-21 12:47:06'),
(189, 'monteros', 'COMPARTIR HISTORIAS', 'Por favor agreguen una alarma para compartir las historias de la tarde, no cuesta mucho y simplificamos asi no se olvidan, de paso cuando compartan den una revisada a los chats asi vemos que no este filtrado ninguno. Luciana 18 hs. Jessi compartira a las 22 las que falten. Muchas gracias', 18, '2023-09-21', 0, '2023-09-21 12:49:25', '2023-09-21 12:50:32'),
(190, 'concepcion', 'COMPARTIR HISTORIAS', 'Por favor agreguen una alarma para compartir las historias de la tarde, no cuesta mucho y simplificamos asi no se olvidan, de paso cuando compartan den una revisada a los chats asi vemos que no este filtrado ninguno. Luciana 18 hs. Jessi compartira a las 22 las que falten. Muchas gracias', 13, '2023-09-21', 0, '2023-09-21 12:49:48', '2023-09-21 12:49:48'),
(191, 'concepcion', 'RAMON', 'Tiene que hacer dos días en horario extendido, sumamos de 4:30 a 6:00 pm los lunes y miercoles, ya que enzo va de 4 a 5 los martes y jueves. Viernes no iría nadie en ese horario después de Braian. Tener en cuenta entonces en el salario semanal esas 3 hs adicionales en total.', 13, '2023-09-22', 0, '2023-09-21 14:52:20', '2023-09-21 14:52:20'),
(192, 'concepcion', 'MARIANO', '- Restar 300 que debe de 2 monsters que cobró mal<br>- Pagar y recobrar productos que debe.<br>- Yo ya le bonifiqué el resto del mensual (hay que hacerlo así para la prox, o sea se cobra la mitad y la mitad se pone en bonificación)', 13, '2023-09-29', 0, '2023-09-25 15:57:04', '2023-09-25 15:57:04'),
(193, 'monteros', 'EVENTO DEL POLI', '<p>Recuperar remeras:<br>- FIORELLA: cargar en perfil de Marcelo&nbsp;<br>- VICKY CAST: escribir así la devuelve (ya le ofrezco yo las bonificaciones: le diré 30% mes Mont y 2 sesiones de cabina y 1 mes en tuc). En caso que desee comprar la remera le hacemos 50% OFF (esto si ofrecele vos).<br>- CAMI CARDOZO y ORIANA: ofrecer 30% de descuento y 2 sesiones de cabina a c/u, indicarle que si hacen las cabinas que saquen una foto comun y etiqueten al gimnasio (IMPORTANTE: avisar que no deben poner GRACIAS, porque despues la gente piensa que andamos regalando a las minas las sesiones). Si la Cami no puede hacer cabina ofrecele que pueda utilizar a cambio un 50% off en la remera.<br>- SANTI, SEVERO, NICANOR, TOTO: ofrecerle 30% gimnasio nada mas y 50% off en la remera.<br>Mandar estos 7 mensajes y veamos como resolvemos el stock de las remeras con las que trajimos de concep:&nbsp;<span style=\"background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">hombre 10,&nbsp;</span><span style=\"background-color: var(--bs-card-bg); color: var(--bs-modal-color); font-family: var(--bs-body-font-family); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">mujer 9. Habría que devolver la mitad que trajimos aprox y al resto darle ingreso a medida que vayan devolviendola. A mi me dio una creo que Severo y no se si a Chocho tmb.</span></p>', 3, '2023-09-26', 0, '2023-09-25 16:07:30', '2023-09-25 16:07:30'),
(194, 'todas', 'EVENTO', 'Hoy hacemos evento por primavera, a ponerle buena onda asi la gente la pase bien ;)', 0, '2023-09-26', 0, '2023-09-25 19:40:53', '2023-09-25 19:40:53'),
(195, 'monteros', 'BANDERA DE HAMMER SENSACIONES POSITIVAS', 'Pedirle a Adrian que le digas a los chicos que cuelgue la bandera de hammer para el evento igual que la otra vez, de paso que quede ahi para no perderla. Ademas los banderines colocarlos bien, hay que mover la prensa para poner la mesa de dj, todo igual que la vez pasada.', 4, '2023-09-26', 0, '2023-09-25 20:09:24', '2023-09-25 20:09:24'),
(196, 'todas', 'POST EVENTO', 'Reacomodar todo si es que corrimos de lugar algunas cosas para el evento. Guardar las mesas de los dj, guardar todo el cotillon utilizado en cajas para que sean retirados esta tarde y guardados en deposito de monteros. Gracias!', 0, '2023-09-27', 0, '2023-09-25 20:10:20', '2023-09-25 20:10:20'),
(197, 'concepcion', 'GEMSA', 'Preguntar por favor loana si esq ue ya esta el papel', 10, '2023-09-26', 0, '2023-09-25 20:13:34', '2023-09-25 20:13:34'),
(198, 'todas', 'GIFT CARDS', 'A los que vayan con tarjetas de cambio, por ejemplo sponsor, sorteos, eventos como lo de cabron o la semana del estudiante, pongan en como nos conocio GIFT CARDS, esto seria en el caso de que haya que cargarlo como prospecto nuevo obviamente, o&nbsp; cliente si es un descuento.', 0, '2023-09-26', 0, '2023-09-25 21:28:06', '2023-09-25 21:28:06'),
(199, 'concepcion', 'Heladera', 'Porfa dejarle la heladera completa y el estante de barritas cargado al turno tarde. El stock conviene que sea manejo del turno mañana por una cuestión de organización. Ayer fui y estaba medio vacío. Graciass', 10, '2023-09-28', 0, '2023-09-27 12:00:24', '2023-09-27 12:00:24'),
(200, 'concepcion', 'kpi', 'Ponernos al dia, tengo hasta el 20 realizado', 10, '2023-09-28', 0, '2023-09-27 20:59:01', '2023-09-27 20:59:01'),
(201, 'concepcion', 'YOGA', '<p>no continuar vendiendo mensuales, solo venderemos quincenas a mitad de precio, ya que es muy probable que no consigamos un nuevo profe para reemplazar a mayra. asi que por ahora venderemos solo el plan quincenal, explicar a la gente</p><p><br></p>', 0, '2023-09-28', 0, '2023-09-27 21:11:56', '2023-09-27 21:11:56'),
(202, 'monteros', 'bandera', 'cuelguen la bandera de hamemr en algun lado, para que quede colgada mejor que guardada, donde sea, si esta sucia la llevamos a lavar', 4, '2023-09-28', 0, '2023-09-27 21:51:12', '2023-09-27 21:51:12'),
(203, 'monteros', 'NUEVA CUENTA PARA TRANSFERENCIAS', '<p>                Tendremos dos cuentas, la que veniamos usando de personal play, y una cuenta nueva cuyo alias es monteroshammer, esta escrito ahi en el acrilico, y el movimiento para egresar es TRANSFERENCIA MERCADOPAGO MARTA, en egresos electronicos. Usemos las dos, lo ideal seria que hagan mitad y mitad digamos, de ultima a la gente de mas confianza le pasamos la de personal pay que seria de adrian, y a los de menos confianza le damos la de monteroshammer. cualquier cosa me preguntan. Tengan cuidado como egresan por que el mercadopago marcelo es de el, no hacen muchas transferencias a ese, nada mas que hay algunas personas que lo tienen guardado y por eso lo dejamos, por las dudas</p><p><br></p>', 0, '2023-10-03', 0, '2023-10-04 02:03:13', '2023-10-04 02:14:31'),
(204, 'todas', 'compartir historias', 'no se olviden de compartir las historias 18 hs luciana 22 hs jessi porfa!', 0, '2023-10-04', 0, '2023-10-04 02:35:16', '2023-10-04 02:35:16'),
(205, 'monteros', 'cajas super', 'si podes bri pregunta si hay cajitas&nbsp; al mediodia', 4, '2023-10-04', 0, '2023-10-04 02:35:36', '2023-10-04 02:35:36'),
(206, 'concepcion', 'cajas', 'ver el tema de la caja de la plata y el canastito para los utiles porfa!', 10, '2023-10-04', 0, '2023-10-04 02:36:00', '2023-10-04 02:36:00'),
(207, 'todas', 'TIEMPO DE CONGELAMIENTO Y DEUDAS', 'Recuerden que las deudas solo duran 7 dias y ya no deja pasar, no ofrezcan abonar asi, solo cuando el cliente manifiesta falta de dinero o algo por el estilo<br>Recuerden que los congelamientos son entre 10 y 30 dias', 0, '2023-10-03', 0, '2023-10-04 02:53:05', '2023-10-04 04:08:49'),
(208, 'concepcion', 'AEROBICS', 'Corregi el tema de la transferencia, corregirle a la chica hoy!', 13, '2023-10-04', 0, '2023-10-04 02:53:26', '2023-10-04 02:53:26'),
(209, 'monteros', 'BENJA', 'Le pagaremos a benja como si fuera que tiene la clase llena solo el turno de las 19 hs. Durante dos semanas, esta y la semana que viene, hoy tenes que pagarle la diferencia de la clase de ayer digamos', 18, '2023-10-04', 0, '2023-10-04 02:55:41', '2023-10-04 02:55:41'),
(210, 'todas', 'NOVEDAD DE PRUEBA ACTUALIZACION 04-10 edit', 'Chicos es una novedad para probar las funciones de una nueva actualización del sistema, solo pongan leer para comprobar que todo sigue funciondo bien- <b>edit</b>', NULL, '2023-10-04', 0, '2023-10-04 04:06:32', '2023-10-04 04:08:00'),
(211, 'monteros', 'PILATES TURNOS', '<p>TURNO 14 hs LUN-MIE-VIE con AMIR, habilitado.</p><p>TURNO 22 hs LUN-MAR-VIE con AMIR, para habilitar recién cuando haya dos personas.</p>', NULL, '2023-10-06', 0, '2023-10-04 22:38:55', '2023-10-06 11:55:31'),
