(215, 'monteros', 'BANDERA', 'Colocarla con adrian en algun lugar porfa', NULL, '2023-10-10', 0, '2023-10-09 17:21:58', '2023-10-09 17:21:58'),
(216, 'monteros', 'TURNOS CABINA', 'Ahora que empezara a hacer calor, no hay que sacar turnos de 2 a 4 y 8 a 10 en cabina al menos que ese dia haga frio, por que en esos horarios vamos a prender el aire acondicionado y no podemos usar ambas al mismo tiempo, no se olviden, no anulo los turnos por que no todos los dias hara calor', NULL, '2023-10-10', 0, '2023-10-09 18:07:11', '2023-10-09 18:07:11'),
