(226, 'monteros', 'VIDEO', '<div>Ver video de LIDERAZGO (10 am a 12 pm o el horario que les sirva en tranqulidad, tienen 2 horas):<br>https://www.youtube.com/watch?v=6I9TNj5MUOo<br><br>TAREAS:</div><div>1) Anotar 3 acciones que sientan que son las mas importantes que un lider debe aplicar (del VIDEO: lista de jefe VS lider)</div><div>2) Anotar 1 caso en que hayan estado comportándose como lider (de la misma lista)&nbsp;</div><div>3) Anotar 1 caso en que hayan estado haciendo lo contrario (comportamiento de JEFE en vez de LIDER)</div><div>4) Clasificar los lideres, ¿que tipo de lider se consideran? EJEMPLAR, VISIONARIO, etc.</div><div>5) ¿De cuales elementos para crear inteligencia emocional creen que están dotados y cuales no? (al menos 3 de cada uno) (del VIDEO: lista de elementos claves para crear inteligencia emocional colectiva). Ej. empatía, autocontrol, influencia, etc.</div><div>6) ¿Cuáles elementos sienten que Hammer transmite y cuáles faltan? (al menos 3 de c/u)</div><div>7) Puesta en práctica sobre RETROALIMENTACION, elegir 2 empleados que sientan que no estan brindando su mayor potencial, pensar 3 cosas buenas a destacar y 1 a corregir. Realizar charla y analizar resultados a la semana siguiente.</div><div>8) 2 frases que les haya impactado del video. Yo aporto 1. Pegaremos las frases en el mostrador.</div><div>9) Realizar encuesta y sacar foto a los resultados. Abajo poner \"free results\" y analizar el TOP 3 arriba de atributos como persona, y el TOP 3 abajo, anotar. Reflexionar.</div>', NULL, '2023-10-20', 0, '2023-10-17 16:18:38', '2023-10-17 16:18:38'),
