backdrop-sepia: ;\">7) Puesta en práctica sobre RETROALIMENTACION, elegir 2 empleados que sientan que no estan brindando su mayor potencial, pensar 3 cosas buenas a destacar y 1 a corregir. Realizar charla y analizar resultados a la semana siguiente.</div><div style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">8) 2 frases que les haya impactado del video. Yo aporto 1. Pegaremos las frases en el mostrador.</div><div style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">9) Realizar encuesta y sacar foto a los resultados. Abajo poner \"free results\" y analizar el TOP 3 arriba de atributos como persona, y el TOP 3 abajo, anotar. Reflexionar.</div>', NULL, '2023-10-20', 0, '2023-10-17 16:18:55', '2023-10-17 16:18:55'),
(228, 'monteros', 'protocolo', 'hablarme para que veamos el aumento', NULL, '2023-11-06', 0, '2023-10-19 20:54:53', '2023-10-19 20:54:53'),
(229, 'monteros', 'REPONER SOBRE', 'Hoy debemos saldar el sobre que estaba faltando, revisar en la conversacion cuanto era el monto, Mandarme un msj cuando este listo', NULL, '2023-10-19', 0, '2023-10-19 20:55:42', '2023-10-19 20:55:58'),
(230, 'todas', 'PRECIOS REMERAS', 'Precio para todos: 9300', NULL, '2023-10-23', 0, '2023-10-21 20:33:46', '2023-10-21 20:33:46'),
(231, 'concepcion', 'TRANSFERENCIAS', 'Que manden al CBU de Diego preferentemente. Tengo muy alta las ventas con el mio (Marcelo)', NULL, '2023-10-23', 0, '2023-10-22 00:08:35', '2023-10-22 00:08:35'),
(232, 'todas', 'PROMO BNA', '<p>                Solo queda activo el semesrtal, el anual queda desactivado hasta nuevo aviso. (EN LA PROMO BNA)</p><p><br></p>', NULL, '2023-10-23', 0, '2023-10-23 13:12:42', '2023-10-23 13:12:54'),
(233, 'todas', 'preguntas frecuentes', 'leer todas las preguntas para despejar dudas, me avisan si falta algo&nbsp;', NULL, '2023-10-25', 0, '2023-10-24 14:03:45', '2023-10-24 14:03:45');
INSERT INTO `novedades` (`id`, `sede`, `titulo`, `mensaje`, `user`, `vencimiento`, `estado`, `created_at`, `updated_at`) VALUES
(234, 'todas', 'PROSPECTOS', '<p>A partir de ahora se cargan directamente desde nueva visita en el panel principal.</p><p><img src=\"data:image/png;base64,\" style=\"width: 397px;\" data-filename=\"image.png\"></p>', NULL, '2023-10-25', 0, '2023-10-25 11:45:36', '2023-10-25 11:45:36'),
(235, 'todas', 'APP', 'Ya esta disponible la nueva APP de hammer. El beneficio que tiene la gente por ahora es poder visualizar su vencimiento de contrato (ya dejaremos de mandar los mensajes la semana que viene asi le explican a la gente). Van a poder renovar desde ahi e ir directamente a pagar en el gym. proximamente vamos a cargar rutinas y van a participar en competencias por premios. Ademas obviamente que se notificaran todos los feriados y horarios.', NULL, '2023-10-31', 0, '2023-10-31 13:52:58', '2023-10-31 13:53:24'),
(236, 'todas', 'MENSAJES DE APP', '<p>A partir de hoy comenzamos a enviar el siguiente mensaje a los clientes hay que terminar esta semana.<br>¡Hola! Soy nombre de HAMMER. Siempre intentamos mejorar la comunicacion y tu experiencia con nosotros, por lo que queria comentarte y con mucha satisfaccion que ya tenes disponible nuestra app por la cual vas a poder enterarte de todas nuestras novedades, promociones, horarios en dias feriados, eventos, controlar la vigencia de tu plan para que sepas cuando renovar, y reservar los turnos de tus clases (En sede Monteros). Para descargarla hace click en el siguiente enlace <a href=\"https://play.google.com/store/apps/details?id=com.hammerx&amp;hl=es_AR&amp;gl=US\" target=\"_blank\">https://play.google.com/store/apps/details?id=com.hammerx&amp;hl=es_AR&amp;gl=US</a> ¡Cualquier duda consultanos!<br><br></p>', NULL, '2023-10-31', 0, '2023-10-31 14:43:08', '2023-10-31 14:44:51'),
(237, 'monteros', 'MENSAJES DE PROTOCLO', 'Los vencimientos de contrato esta semana, hay que agregar:<br>Además quería comentarte que estamos muy contentos de anunciarte que a partir de la siguiente semana este mensaje ya no sera reenviado, ya que desde hoy tenes disponible nuestra APP HAMMERX para que puedas visualizar el vencimiento de tu contrato por este medio y todas nuestras novedades!<br><br>Descargala del siguiente enlace!&nbsp;https://play.google.com/store/apps/details?id=com.hammerx&amp;hl=es_AR&amp;gl=US', NULL, '2023-10-31', 0, '2023-10-31 14:47:15', '2023-10-31 14:47:15');
INSERT INTO `novedades` (`id`, `sede`, `titulo`, `mensaje`, `user`, `vencimiento`, `estado`, `created_at`, `updated_at`) VALUES
(238, 'todas', 'VENCIMIENTO DE CONTRATO', 'A partir de la semana que viene ya no se le enviara a los clientes el vencimiento, si nos consultan o se enojan o algo se les dice que pueden observar en su aplicacion las fechas de sus contrataciones y vencimientos', NULL, '2023-10-31', 0, '2023-10-31 14:48:08', '2023-10-31 14:48:08'),
(239, 'todas', 'carteles de app', 'controlar que esten los plastificados colocados en el portahojas en recepcion', NULL, '2023-11-01', 0, '2023-10-31 14:50:40', '2023-10-31 14:50:40'),
(241, 'todas', 'PRECIOS CREMAS', '<span style=\"color: rgb(0, 0, 0); font-family: ui-monospace, SFMono-Regular, Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 18px; font-weight: 700;\">Se actualizan precios de las cremas de bronceado +$100</span>', NULL, '2023-11-03', 0, '2023-11-02 18:41:37', '2023-11-02 18:41:37'),
(242, 'concepcion', 'ALQUILER', 'Pagar el de orquera durante la mañana y avisar a Lu para que deje plata para pagar mañana el de la Bety', NULL, '2023-11-07', 0, '2023-11-03 16:25:49', '2023-11-03 16:25:49'),
(243, 'concepcion', 'SEPARADORES PARA AZUL', 'Comprar separadores de color, lo que se pone entre las hojas para que anote las letras de las fichas de inscripcion', NULL, '2023-11-06', 0, '2023-11-04 18:12:27', '2023-11-04 18:12:27'),
(244, 'monteros', 'PLANILLAS INSCRIPCION', '¿Donde quedaron las planillas de inscripcion?', NULL, '2023-11-06', 0, '2023-11-04 18:48:06', '2023-11-04 18:48:06'),
(245, 'todas', 'KPIS VENTAS', '<span class=\"selectable-text copyable-text\">Se agrega <b>CONSULTAS DE INACTIVOS</b>, para cuando venga un exsocio por mostrador o mande msj y le hagan una agenda, ya que no teníamos como registrar eso porque solo registrabamos las CONSULTAS NUEVOS y los EXSOCIOS (inactivos) que agendabamos por protocolo de msj (30-60-90 días), en este caso la columna de CONSULTAS DE INACTIVOS es para cualquier tipo de exsocio que quiera volver por INICIATIVA PROPIA y pacte un día y le hagan una agenda para mas tarde o para los días futuros, o sea si vuelve en el momento no lo anoten.</span>', NULL, '2023-11-06', 0, '2023-11-06 12:59:55', '2023-11-06 12:59:55'),
(246, 'concepcion', 'PRECIO ACROBACIAS', 'Se actualizan los precios de acrobacias y kids.', NULL, '2023-11-06', 0, '2023-11-06 13:00:53', '2023-11-06 13:00:53'),
(247, 'concepcion', 'ACOMODAR', '<p>Guardar la mesa con el cable del DJ, guardarlo en una bolsa, ponerle el nombre con una cinta de cable y ponerlo dentro de la mesa</p><p><br></p>', NULL, '2023-11-07', 0, '2023-11-06 22:21:16', '2023-11-06 22:21:16'),
(248, 'concepcion', 'REVISAR CAMARAS', 'Revisar el dia de la primavera, despues de que toco el dj que hicieron el cable, alguien se tiene que haber acercado y romperlo, por que supuestamente al otro dia guardaron y ya nadie tuvo acceso.ñ P^regntar a diego como ver las camaras', NULL, '2023-11-07', 0, '2023-11-06 22:23:54', '2023-11-06 22:23:54'),
(249, 'todas', 'CANAL YOUTUBE', 'Ya tenemos listo nuestro canal de youtube, donde pasamos info y propagandas, es necesario que lo dejen en automatico todo el dia todos los dias en todos los teles, hasta que alguien les pida que pongan algo obviamente, pero si no esta pasando nada que la gente quiera ver, lo dejan en automatico (en vez de estar apagado lo dejamos al canal). Le mandan a nazareno temprano para que les enseñe como hacerlo', NULL, '2023-11-10', 0, '2023-11-09 16:11:40', '2023-11-09 16:11:40'),
(250, 'todas', 'STORIES', '<p>Compartir primero las historias grupales, luego las fotos de mas calidad donde se vea la persona, por ultimo las de menor calidad. NO SE COMPARTEN:<br>- Historias muy borrosas de mala calidad</p><p>- Gente sin remera</p><p>- Historias de otro lugar salvo que se vea la persona (por ej. compartir gente sponsoreando en otro lado, pero no compartir la merienda de la estrella porque no tenemos ese producto)</p><p>- Stories repetidas subidas por distintas personas o staff</p>', NULL, '2023-11-10', 0, '2023-11-10 11:50:24', '2023-11-10 11:50:24'),
(251, 'todas', 'CABINA SOLAR', '<p>Precios actualizados</p><p>Recordar que los packs son individuales. Tienen 2 semanas por cada sesión contratada, ej un pack de 6 sesiones dura 12 semanas para poder usarlo (3 meses).</p>', NULL, '2023-11-13', 0, '2023-11-11 20:20:22', '2023-11-11 20:20:22'),
(252, 'todas', 'CAJA PARALELA', 'En caso que el gimnasio esté muy lleno para cobrar en caja los vendedores pueden asistir a los recepcionistas. Simplemente empiezan a cobrar y cuando deseen hacen un movimiento que en vez de cierre se llama&nbsp;TRANSFERENCIA DE CAJA, el movimiento está en movimientos varios dentro del rubro CIERRE DE CAJA, solo cambia el concepto al final. Se hace + y la plata sale de caja, o sea es un egreso. Luego le entregan la plata al recepcionista que debe hacer el movimiento de RECEPCION DE CAJA, dentro del rubro APERTURA DE CAJA. Se recomienda usar cuando hay mas de 3 o 4 personas esperando unicamente.', NULL, '2023-11-13', 0, '2023-11-12 20:16:10', '2023-11-12 20:16:10'),
(253, 'concepcion', 'CABINA SOLAR INFO', '-&gt; Se agrega turno a las 22:30 hs, veremos como se desenvuelve Mariano. LUCIANA: hacer una simulacion para ver si sabe vender bien y asignar el turno.<br>-&gt; Cremas: recordar que COBRIZZO es para acelerar el color, o sea un bronceado mas rapido, se recomienda en sesiones 1ra, 2da y 3ra, y EXPRESSO es para que dure mas el color (intensifica), se recomienda para fijar en las sesiones 4ta en adelante.', NULL, '2023-11-14', 0, '2023-11-14 12:06:31', '2023-11-14 12:06:31'),
(254, 'todas', 'ACTUALIZACION CUOTA', 'Lunes 20', NULL, '2023-11-14', 0, '2023-11-14 13:33:47', '2023-11-14 13:33:47'),
(255, 'todas', 'ACTUALIZACION CUOTA', '<p>                Precios actualizados a partir de hoy. Revisar como queda la promo BNA. Revisar como queda la promo instrcutor. Revisar los precios nuevos de la nueva cartilla de planes largos y tirar la anterior (eso tiene que estar listo esta mañana)</p><p><br></p>', NULL, '2023-11-20', 0, '2023-11-16 14:26:29', '2023-11-17 13:39:57'),
(256, 'todas', 'PAPELES', 'Chicos tendremos que comenzar a contar los papeles en las sedes por que no esta funcionando el metodo con el sistema, agregamos en la planilla de stock higienicos y rollos, todos los dias hay que contarlos. Brisa y Loana haran los pedidos', NULL, '2023-11-17', 0, '2023-11-16 14:39:44', '2023-11-16 14:39:44'),
(257, 'todas', 'lunes feriado', 'Se trabaja de 9 a 22 horas, hablar con coordinadores para consultar clases disponibles', NULL, '2023-11-17', 0, '2023-11-16 14:54:28', '2023-11-16 14:54:28'),
(258, 'todas', 'APP', 'La gente puede renovar desde la app, tiene hasta dos dias solamente, por que cuando renuevan desde ahi, se renueva desde el dia que se le vencio el contrato, por eso solamente dejo hasta dos dias. Cuando se le venza a la gente en el mostrador, osea no sepa porque ya no mandaremos mensajes, les avisan que ya esta disponible la APP para que la descarguen, vean su fecha de vencimiento y para que renueven desde ahi pero le explican que tienen dos dias. De esa manera hacemos que la gente se descargue la APP, ademas de que por ahi notificaremos todos los feriados y demas.<br>Necesito que la tengan descargadas a la app para que sepan mostrarle a la gente', NULL, '2023-11-16', 0, '2023-11-16 15:06:05', '2023-11-16 15:10:58'),
(259, 'monteros', 'Convenios', 'Escribir a Arcor y Citromax para actualizar los precios a partir de 01 Diciembre con los valores nuevos. Sería una actualización del 10,5% respecto a los valores anteriores, pasarle cuanto queda como valor final. Cualquier cosa consultar con Marcelo', NULL, '2023-11-21', 0, '2023-11-16 23:57:04', '2023-11-16 23:57:04'),
(260, 'monteros', 'PRECIOS 20/11', 'Musculacion $9500<br>Clases Grupales $8100<br>Pase Libre $9900<br>Pilates x2 $8400<br>Pilates x3 $10500<br>Pilates x5 $12500', NULL, '2023-11-17', 0, '2023-11-17 11:20:38', '2023-11-17 11:20:38'),
(261, 'concepcion', 'PRECIOS 20/11', 'MUSCULACION $10900 (DESC. INSTRUCTOR 1000)<br>CLASES GRUPALES $9400<br>PASE LIBRE $11400<br>CONVENIO X3 $8900<br>PASE X8 CLASES $7900', NULL, '2023-11-17', 0, '2023-11-17 11:24:50', '2023-11-17 11:24:50'),
(262, 'monteros', 'LLAVE DEPOSITO', 'Chicos no se encontrba la llave del deposito, busquenla y confirmenme si la encuentran por favor', NULL, '2023-11-21', 0, '2023-11-19 20:20:16', '2023-11-19 20:20:16'),
(263, 'monteros', 'Ramiro', 'Debemos hacer un proyecto con ramiro para ver y evaluar como esta funcionando, tenemos que pasarle unas 10 clases de prueba y anotar los nombres, guardar la planilla una vez que lleguemos a 10 y lo evaluamos dentro de un mes uno por uno, anoto la novedad para hoy, y en cada semana asi vamos recordando', NULL, '2023-11-22', 0, '2023-11-19 20:21:31', '2023-11-19 20:21:31'),
(264, 'monteros', 'RAMIRO', 'Continuar planilla', NULL, '2023-11-27', 0, '2023-11-19 20:21:49', '2023-11-19 20:21:49'),
(265, 'monteros', 'ramiro', 'continuar', NULL, '2023-11-19', 0, '2023-11-19 20:22:13', '2023-11-19 20:22:53'),
(266, 'monteros', 'ramiro', 'tenemos que presentar los resultaods de los 10 prospectos hoy', NULL, '2023-12-11', 0, '2023-11-19 20:22:36', '2023-11-19 20:22:36'),
(267, 'monteros', 'SERVICIOS', 'Separar SERVICIOS - LUZ: $192.980<br><br>Adrian debe pagar el día 28/11. Servicio 645954 (Ruiz Mor)', NULL, '2023-11-27', 0, '2023-11-21 11:46:50', '2023-11-21 11:46:50'),
(268, 'monteros', 'LUZ', 'Pagar hasta hoy: <br>1. Servicio 645954 (Ruiz Mor) $192980<br>2. Servicio 89812 (Becerra) $175760', NULL, '2023-11-28', 0, '2023-11-21 11:48:23', '2023-11-21 11:48:23'),
(269, 'concepcion', 'LUZ', 'Separar sobre para Luz (Egresar como servicios) la cantidad de $175.800<br>Escribir \"Luz - *monto* - Serv: 89812\".<br>Notificar a Marcelo/Chocho para que lleven el sobre a Monteros.', NULL, '2023-11-27', 0, '2023-11-21 11:51:09', '2023-11-21 11:51:09'),
