(273, 'todas', 'SILLAS', 'Cada vez que algún cliente se levante deben ordenar las sillas por favor. Son parte de la vista del gimnasio cuando ingresa un cliente.', NULL, '2023-11-23', 0, '2023-11-22 11:51:43', '2023-11-22 11:51:43'),
(274, 'concepcion', 'NUEVO ALIAS', 'Reemplazar el de Molina Diego de Lemon provisoriamente por este hasta que resolvamos un asunto.<br><br>CBU 0000076500000017999258<br>ALIAS: hammer.jc<br>Personal Pay<br>Cancino Jessica<br><br>Lo dejamo escrito en recepción ya. Se egresa como Transf Personal Pay<br><br><br>', NULL, '2023-11-27', 0, '2023-11-27 14:41:07', '2023-11-27 15:08:48'),
(275, 'concepcion', 'FUMIGACION', 'El sabado iran a fumigar a las 6 menos 15', NULL, '2023-11-28', 0, '2023-11-28 13:43:51', '2023-11-28 13:43:51'),
(276, 'todas', 'ACTIVIDADES', 'Agregue preguntas frecuentes \"actividades\", ahi esta tal cual tienen que presentar las diferentes actividades, o sea su explicacion. Eso lo mandan antes de ofrecer la clase de prueba. Ademas agregue en preguntas frecuentes el modulo \"VENTAS\" donde tienen toda la informacion acerca de como vender por redes', NULL, '2023-11-29', 0, '2023-11-28 23:22:05', '2023-11-28 23:22:05'),
(277, 'todas', 'PROMO BNA', '<p>Se modifica, ya no se aplica a aquellos que pagan con tarjeta de credito en posnet en \"MODO\" del banco nacion. Les dejo un link del video de como deberian hacer las personas&nbsp;<a href=\"https://www.youtube.com/watch?v=xhDJ0ZLyW-I\" target=\"_blank\">https://www.youtube.com/watch?v=xhDJ0ZLyW-I</a>&nbsp;<br>Durante la semana se pondran los codigos QR en el gym</p>', NULL, '2023-11-30', 0, '2023-11-30 15:16:16', '2023-11-30 15:16:16'),
(278, 'concepcion', 'MATIAS DOMINGUEZ', 'Se lo da de baja como staff, cargarle contrato y que pague todo lo que debe en productos tambien, tiene una semana o se le bloquea el molinete. Haganle 20% off en el mensual y pongan DESC MARCELO (desc. fijo le dejaremos)', NULL, '2023-12-04', 0, '2023-12-02 20:40:36', '2023-12-02 20:40:36'),
(279, 'todas', 'FIESTA HAMMER!', 'Vamos a organizar la fiesta de despedida de año, cree un producto que se llama FIESTA HAMMER Y FIESTA HAMMER CATERING Con dos precios. El precio mas económico $2000 . Esta será para la fiesta en si, pero temprano haremos con servicio de catering para la gente que quiera compartir una comida con sorteos, esta tendrá un valor de 7000. Las fiestas seran el dia 15 en Monteros (MYSTICO) y sabado 16 en Concepcion (LA ESTRELLA). Pueden ir vendiendo y recibiendo la plata, luego les entregamos las tarjetitas', NULL, '2023-12-04', 0, '2023-12-03 19:20:10', '2023-12-03 19:43:57'),
(280, 'concepcion', 'CHOCHO', 'No se a que hora ira flor zuleta a llevarme unos yogur, preguntenle cuanto es asi le abonan . GRACIAS!', NULL, '2023-12-04', 0, '2023-12-03 20:04:14', '2023-12-03 20:04:14'),
(281, 'monteros', 'KPIS BAJAS', 'Jessi: Bajas del mes se estaba computando mal en kpis, el valor es el de la derecha que es el acumulado de bajas.', NULL, '2023-12-04', 0, '2023-12-04 01:17:59', '2023-12-04 01:17:59'),
(282, 'concepcion', 'VENENO', 'Que la Fabi eche 2 veces por semana ya que estamos gastando mas de 30.000 pesos por mes. Tambien averiguar el nombre del veneno y enviar a Marcelo para ver si se consigue por internet', NULL, '2023-12-04', 0, '2023-12-04 01:37:19', '2023-12-04 01:37:19'),
(283, 'monteros', 'ALQUILER SAPO', 'Pedirle 35.500 que iba a dar el sábado ya que el ultimo finde subió (antes era 10.000 y debía 2 findes, ahora es 15.500 y debe el ultimo)', NULL, '2023-12-04', 0, '2023-12-04 12:07:47', '2023-12-04 12:07:47'),
(284, 'monteros', 'ALQUILER', 'Egresar como ALQUILER lo que haya (solo dejar caja justa para el dia siguiente) y hacer un sobre que diga por ejemplo MIE 06: $100.000 y guardar para el día siguiente, o el monto que sea. Se debe llegar hasta el viernes a $295.000', NULL, '2023-12-06', 0, '2023-12-04 16:05:09', '2023-12-04 16:05:09'),
(285, 'monteros', 'ALQUILER', 'Sumar al sobre de ayer (abrir el mismo) y poner JUE 07: ej $50.000 o $200.000 o lo que haya', NULL, '2023-12-07', 0, '2023-12-04 16:06:05', '2023-12-04 16:06:05'),
(286, 'monteros', 'ALQUILER', 'Completar los $295.000. Si falta notificar Marcelo para que complete. Avisar a Adrian para que coordine el pago con chaca.', NULL, '2023-12-08', 0, '2023-12-04 16:08:08', '2023-12-04 16:08:08'),
(287, 'concepcion', 'ALQUILER', 'Separar lo de BETY BARRIONUEVO, consultar Loana el monto o a Marcelo. Avisarle a Bety asi pase a cobrar, su nro es 3865 448251. Dejar listo dos recibos iguales, uno para ella y otro dejarlo firmado en el talonario para nosotros.', NULL, '2023-12-11', 0, '2023-12-04 16:11:30', '2023-12-04 16:11:30'),
(288, 'concepcion', 'ALQUILER', 'Consultar temprano el monto a la inmobiliaria ya que actualizaba, debería ser alrededor de un 150% el anual, si es mas avisar a Marcelo. Pagar o avisar para que dejen la plata separada para pagar el viernes', NULL, '2023-12-07', 0, '2023-12-04 16:13:09', '2023-12-04 16:13:09'),
(289, 'concepcion', 'ALQUILER', 'Pagar la mitad del alquiler de Becerra en el turno tarde (Luciana), consultar a Loana el monto. Avisarle a Becerra para que retire. Avisarle a Marcelo (Garcia el querido jefe) para que transfiera la otra mitad a Becerra.', NULL, '2023-12-12', 0, '2023-12-04 16:16:13', '2023-12-04 16:16:13'),
(290, 'monteros', 'PAGOFACIL', 'Codigo: 679 9020 7453 (Monto $90.338)<br>Egresar $45200 inversiones comandera + herram y completar con el sobre de Concep', NULL, '2023-12-06', 0, '2023-12-05 13:47:02', '2023-12-05 13:47:02'),
(291, 'monteros', 'PAGOFACIL', 'Dejar al menos 45200 en caja para mañana (no egresar, sino dejarla como cierre de caja) para que paguen los chicos en pagofacil', NULL, '2023-12-05', 0, '2023-12-05 13:47:48', '2023-12-05 13:47:48'),
(292, 'todas', 'FERIADOS', 'Notifiquen a los chicos, los horarios de las clases, del gim (coordinen quienes irian) y notifiquen sobre todo los horarios de los instrcutores, para que sepan que decir en recepcion porfavor.&nbsp;', NULL, '2023-12-06', 0, '2023-12-05 14:25:41', '2023-12-05 14:25:41'),
(293, 'concepcion', 'cambios en cierre y aperturas', 'chicos venimos con algunos problemas con el tema de cierres de cajas y aperturas hace algunos dias. Para solucionarlo vamos a trabajar de la siguiente manera, el ultimo turno en cerrar es el de la noche, a las 22 hs, el que cierre ese turno cierra su caja y anota en la planilla que dejara al dia siguiente el monto que dejo. El que haga el turno de 22 a 23 hs no ingresa ni egresa nada sistema, si debe hacer movimientos los cobra y deja la plata separada sobre la planilla del dia siguiente, y pondra ahi que movimientos hay que hacer, con el DNI de la persona, el producto o plan y el monto. ( Por ejemplo: 38249522 power 500 $600, 38249522 agua villa fiado). y al otro dia Loana debe abrir con la caja que le dejo el turno que cerro a las 22 (lo dejo anotado obviamente). Y hace todos los movimientos que le dejo anotado mariano', NULL, '2023-12-06', 0, '2023-12-05 18:44:02', '2023-12-05 18:44:02'),
(294, 'todas', 'DJ', 'Hoy vendran los dj a monteros y concepcion a partir de las 18:30. Dejar todo preparado temprano (A la mañana), la mesa y controlar que el cable este bien, enchufado para que el dj llegue y solo enchufe', NULL, '2023-12-11', 0, '2023-12-07 14:20:25', '2023-12-07 14:20:25'),
(295, 'todas', 'EVENTO DE AYER', 'Guardar la mesa y guardar el cable en una bolsa y guardarlo en recepcion arriba de la consola (ese sera el lugar para guardarlo). Dejar todo listo a la mañana', NULL, '2023-12-12', 0, '2023-12-07 14:21:20', '2023-12-07 14:21:20'),
(296, 'concepcion', 'LUZ', 'No olvidar egresar los sobres y notificar a Marcelo para que lo traiga y a adrian para que pague al dia siguiente', NULL, '2023-12-13', 0, '2023-12-07 15:49:01', '2023-12-07 15:49:01'),
(297, 'monteros', 'LUZ', 'Terminar de pagar', NULL, '2023-12-14', 0, '2023-12-07 15:49:21', '2023-12-07 15:49:21'),
(298, 'todas', 'Entradas Fiesta', 'Estan disponibles en recepción, faltan las entradas VIP de Concepcion (pulseras) únicamente, pero pueden ir vendiendo desde el perfil en sistema ya que figuran dentro de productos como FIESTA HAMMER CATERING (son las vips) y FIESTA HAMMER (las comunes). En caso que vendan a un no socio lo venden desde el perfil de Hammer (DNI: 8.888.888) con la observación del nombre de a quien le venden, sobre todo las vips ya que haremos lista.<br>', NULL, '2023-12-11', 0, '2023-12-11 11:36:58', '2023-12-11 11:36:58'),
(299, 'todas', 'PROMO BNA', 'Se deshabilita. No realizamos mas promo BNA', NULL, '2023-12-13', 0, '2023-12-12 15:41:47', '2023-12-12 15:41:47'),
(300, 'todas', 'ACTUALIZACION CUOTA', 'Nuevos precios&nbsp; a partir del miercoles 20.12. Intenten convencer a la gente de contratar planes largos', NULL, '2023-12-18', 0, '2023-12-18 12:41:31', '2023-12-18 12:41:31'),
(301, 'concepcion', 'Vencimientos cabinas', 'No olviden que un cliente que no permita pasar el molinete por que tiene el contrato de cabina, es necesario que le venzan el mismo y le vayan activando cada vez que quiera hacer una sesion, por otro lado, no olviden vencer los contratos de cabina que ya se gastaron', NULL, '2023-12-18', 0, '2023-12-18 12:43:19', '2023-12-18 12:43:19'),
(302, 'todas', 'AGENDAS DE CONTACTO', 'Ya se encuentra corregido las agendas que aparecen en la pantalla inicio, se visualiza el \"tipo de agendamiento\" por lo que no hace falta repetir lo que poniamos antes en observaciones, podemos poner cosas diferentes', NULL, '2023-12-19', 0, '2023-12-19 03:26:05', '2023-12-19 03:26:05'),
(303, 'concepcion', 'TAREAS PENDIENTES DE AYER', '- Enviarme un msj con los chats que quedamos en buscar, en que terminaron<br>- Enviarme las solicitudes de los dos que tenian el semestral<br>- Enviar el msj a faralle explicando todo sobre la promo familiar', NULL, '2023-12-19', 0, '2023-12-19 03:44:01', '2023-12-19 03:44:01'),
(304, 'todas', 'NUEVA SECCION EN PAGINA WEB', '<p>Habilitamos la seccion de tareas programadas</p><p>jessi y luciana les saldra a las 18 y 22 hs que compartan historias<br>loana y jessi les saldra que completen los kpis a las 9 am y 15 hs respectivamente<br>fran y azul los sabados para organizar planillas de inscripcion<br>adrian e irina para que envien clases de prueba (loana y brisa tendran tambien activos para ayudarlos a recordar y ademas hacerlo en caso que falte alguien)</p>', NULL, '2023-12-20', 0, '2023-12-19 23:13:26', '2023-12-19 23:13:26'),
