(309, 'todas', 'HORARIOS FERIADOS', 'Sabado normal<br>Viernes de 8 a 12 hs y 15 a 21 (coordinar con adrian e irina para ver como cubriremos los horarios)<br>Lunes cerrado', NULL, '2023-12-20', 0, '2023-12-20 13:29:35', '2023-12-20 13:29:35'),
(310, 'todas', 'TAREAS', 'Chicos no se olvide de dejar abierta siempre la pagina web por que les deje tareas recordatorios a cada uno programados en X horarios, como recordatorios para compartir fotos, para enviar agendas, clases de pruebas, hacer kpis, ver comprobantes etc. Hicimos una inversion grande para esta actualizacion en la pagina y es para ustedes, para que lo usen como recordatorio y alarma ustedes asi que por favor usenla y dejen abierta siempre la pagina. Gracias!', NULL, '2023-12-21', 0, '2023-12-21 12:57:42', '2023-12-21 12:57:42'),
(311, 'todas', 'REMERAS', 'Tema remeras:<br>1_ Todas las perchas colgadas tienen que estar ennumeradas con un felpon o algo<br>2_ Todas las perchas colgadas siempre tienen que tener una remera, lo que haremos es poner una de cada modelo y talle y sexo, cada vez que vendan una, buscan en las cajas la misma para reponer (si se acaban me avisan asi llevo mas de esa)<br>3_ Todas las remeras colgadas tienen que tener una cinta de papel si es de hombre o mujer y separamos a la derecha hombre izquierda mujer con un espacio en el medio, siempre que&nbsp; cuelguen una le ponen la cinta (al finalizar cada turno, asi ayudamos tambien a su compañero a que cuenta facilmente)&nbsp;<br>4_ El resto de remeras repetidas quedara en la caja, estas ya tienen su cinta especificando de que son', NULL, '2023-12-21', 0, '2023-12-21 13:01:52', '2023-12-21 13:01:52'),
(312, 'todas', 'DEUDAS!', 'Chicos tengan muchisimo cuidado con los pendientes de deuda de los planes largos, la gente realmente no puede pasarse dias despues de los 30 ya tienen que pagar, por que si no, uds los dejan pasar, ellos se hacen los boludos y pasan 15 dias mas y eso implica que yo pierda en un mes 15 % de inflacion, en medio mes mas 22% en total, y nosotros solo le recargamos un 5%, no puedo vender en cuotas asi. Si alguien no lleva el primer dia le dicen que tiene que abonar si no se le aplicara recargo por la cantidad de dias que se demore y no puede seguir pasando con deuda (es un compromiso que ellos asumieton)<br>2_ Si en algun caso alguien adelanta su plan semestral por ejemplo igual tiene que pagar a los 30 dias, si no me van a adelantar 3 meses, pagaran la priemera cuota y la segunda recien a los 4 meses, super devaluado, no funciona asi, desde el primer dia que pagan a los 30 tienen que pagar la segunda, caiga cuando caiga<br><br>PD: Estos dos casos los anoto aqui por que en Concepcion sucedieron. Muchas gracias', NULL, '2023-12-21', 0, '2023-12-21 13:06:21', '2023-12-21 13:06:21'),
(313, 'todas', 'PROMOS FAMILIARES', 'Para hacer un descuento si o si deben estar agregados los perfiles y vinculados en un grupo familiar, no pueden hacerle la promo si no entran a su perfil y se fijan que esten activos los otros integrantes (recuerden que si no abonan el mismo dia solo se puede hacer un 10% de descuento asi sean 20, si quieren los descuentos grandes tienen que pagar juntos, si no solo le hacen el 10% a cada uno por pagar separado, pero igual deben entrar a su perfil y fijarse en \"GRUPO FAMILIAR\" acercan el raton a la fotito del otro y ahi ssale activo o inactivo, me mandan si no entienden', NULL, '2023-12-21', 0, '2023-12-21 13:20:33', '2023-12-21 13:20:33'),
(314, 'todas', 'REMERAS de staff', 'Chicos durante la semana pasada estuve viendo que muchos no usaron las remeras, no olviden que la remera es una obligacion, marca presencia y profesionalismo y desde hammer siempre intentamos ser los mas profesionales posibles. Necesito que usen las remeras sobre todo en recepcion y exijan al resto del personal ponerse la remera. Me avisan si alguien no la usa', NULL, '2023-12-26', 0, '2023-12-23 15:08:40', '2023-12-23 15:08:40'),
(315, 'concepcion', 'VARIOS', 'Enviar msj al hombre que tuvo el ACV para preguntarle como va con la recuperación y desear feliz año.', NULL, '2023-12-27', 0, '2023-12-24 23:28:55', '2023-12-24 23:28:55'),
(316, 'monteros', 'VARIOS', 'Enviar msj a la chica que tuvo el accidente de ligamentos en la rodilla para preguntarle como va con la recuperación y desear feliz año.', NULL, '2023-12-27', 0, '2023-12-24 23:29:28', '2023-12-24 23:29:28'),
(317, 'monteros', 'REMERA', 'Buscar una remera M negra para Gustavo, el novio de Daniela Saig, y enviarle msj. No le dieron el otro día porque Jessi dice que solo había L. Sino avisar a Marcelo/Chocho para que repongan.', NULL, '2023-12-27', 0, '2023-12-24 23:42:19', '2023-12-24 23:42:19'),
(318, 'monteros', 'PROSPECTO', 'Enviar MSJ a ALISON GRANDE AYBAR para que empiecen pesas o funcional 18 hs con la amiga. Querían ir hoy. El nro esta en el chat con Marcelo o pedir de nuevo.', NULL, '2023-12-26', 0, '2023-12-24 23:46:56', '2023-12-24 23:46:56'),
(319, 'todas', 'feriado', 'el dia 1 no abrimos, el resto de los dias se abre en horario normal', NULL, '2023-12-27', 0, '2023-12-26 12:56:11', '2023-12-26 12:56:11'),
(320, 'todas', 'MONKYS', '<p>Escribir en un cartel a mano sobre el estante de las barritas una promo para las monkys que se vencen en enero. Sería 1 x $700 (normal) y 2 x $1150. En sistema egresar bonificando con el codigo PROMO MONKS<br><br>Loana: chequear el nuevo precio de compra con los proveedores.</p><p><br></p>', NULL, '2023-12-27', 0, '2023-12-26 18:50:48', '2023-12-26 18:50:48'),
(321, 'concepcion', 'FABI', 'Saco un adelanto de 49 mil, por lo que ella cobra:<br>-(menos)10.000 1semana (osea solo cobra 6200 de los 16200)<br>-10.000 2 semana<br>-12.200 3 semana&nbsp;<br>-16800 4 semana<br><br>el guion del principio significa menos, por lo que de los 16200 cobra solo 6200 las dos primeras semanas y asi hasta descontar en las 4 semanas el monto total.', NULL, '2023-12-28', 0, '2023-12-28 13:47:45', '2023-12-28 13:47:45');
