(326, 'todas', '¡FELIZ AÑO!', 'Tareas para el 2024:<br>- Portarse bien<br>- No hacer renegar a Marcelo y Chochito<br>- No pelearse entre uds por comida<br>- No gorrear a sus novi@s<br>- Ir a todas las juntadas de Hammer<br>- Ser felices<br>- Cuidar a sus seres queridos<br>- Ser el mejor staff de comercio que podamos tener ;)', NULL, '2023-12-30', 0, '2023-12-30 19:30:36', '2023-12-30 19:31:32'),
(328, 'concepcion', 'FUTBOL', '<span style=\"color: rgb(0, 0, 0); font-family: ui-monospace, SFMono-Regular, Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 18px; font-weight: 700;\">No está permitido que los chicos menores esten jugando a la pelota, ya que rompieron un ventilador y algun dia romperan un espejo, puede ser molesto para los socios y peligroso para todos, incluso los menores deben estar en recepción, no pueden entrar. Pedir a los instructores que colaboren con el tema. Si algun padre se molesta tienen que explicarle la situación de que hay vidrios y espejos, ademas se puede caer una mancuerna o disco</span>', NULL, '2024-01-02', 0, '2023-12-30 19:35:26', '2023-12-30 19:35:26'),
(329, 'concepcion', 'SACHETTI MELISA', 'Tiene cargo solo funcional, ella dice que pago el pase libre, enviame un msj explicandome que paso para ver como le solucionamos', NULL, '2024-01-02', 0, '2024-01-02 12:39:08', '2024-01-02 12:39:08'),
(330, 'todas', 'PROBLEMAS CON CONGELAMIENTOS', 'A veces sucede que cuando seleccionan las fechas manualmente larga error, en este caso seleccionen las fechas desde el botoncito de calendario', NULL, '2024-01-02', 0, '2024-01-02 13:05:10', '2024-01-02 13:05:10'),
(331, 'concepcion', 'agendas', 'enviame un msj lu de las agendas que habiamos quedado en la semana pasada por favor, los que tenias que enviarles un msj y avisarme si logaste reagendarlos', NULL, '2023-01-02', 0, '2024-01-02 13:24:47', '2024-01-02 13:24:47'),
(332, 'todas', 'CUOTAS EN EFECTIVO PLANES LARGOS', 'Se modifican las cuotas en efectivo, antes era 5 y 10% ahora son 13% y 27%, ya solicite que modifiquen la planilla por las dudas revisen y si estan usando algun flyer para mandar desde live connect no lo usen hasta que lo corrijamos', NULL, '2023-01-02', 0, '2024-01-02 16:08:04', '2024-01-02 16:08:04'),
(333, 'todas', 'PLANES LARGOS EFECTIVO EN CUOTA', 'Se modifican los intereses, antes era 5 y 10% ahora 13 y 27%, ya solicite que corrijan las cartillas y si estan cargadas imagenes en liveconnect pro ahora no las usen hasta que las corrijamos', NULL, '2024-01-02', 0, '2024-01-02 16:09:47', '2024-01-02 16:09:47'),
(334, 'todas', 'PROMO BNA', 'Recordatorio:<br>Promo BNA (la que tenía la devolución de $3000 cuando cobrabamos $12000), ahora no esta disponible para cobrar con el posnet, solo disponible con el celu mediante la app MODO vinculando el Nanco Nación y vinculando las tarjetas de crédito del Banco Nación. O sea son casos muy especificos pero bueno si alguien tiene MODO vinculado al banco podemos venderle el semestral o anual consultando antes con Marcelo o Chocho', NULL, '2024-01-04', 0, '2024-01-03 13:12:20', '2024-01-03 13:12:20'),
(335, 'concepcion', 'PABLO FUNCIONAL', 'Queda desactivada la clase, por ahora pablo solo podra trabajar con sus alumnos como personalizado como el resto de los clientes', NULL, '2023-01-03', 0, '2024-01-03 13:28:33', '2024-01-03 13:28:33'),
(336, 'concepcion', 'PABLO FUNCIONAL', 'Recuerden que ya no existe su clase', NULL, '2024-01-08', 0, '2024-01-06 19:31:44', '2024-01-06 19:31:44'),
(337, 'todas', 'PREMIOS', 'Muy probablemente el dia dehoy comencemos con un sistema de competencia mensual de los clientes, en los cuales los clientes entraran a la APP y tendras una lista actualizada de como van del 1 al 20 en asistencias mensuales, los 10 que mas asistencias tengan en el mes se sorteara entre 4 premios, zapatillas, calzas, remeras, etc, cualquier cosa lo posteremos a instagram, esto se hara mes a mes la idea es que los motiven y les cuenten a los clientes asi se descargan la APP. Tienen que tener descargadas su APP\r\n            <br><br>El requisito para ganar es tener la APP descargada', NULL, '2024-01-08', 0, '2024-01-06 20:05:21', '2024-01-08 00:36:25'),
(338, 'todas', 'venta de publicidad', 'nuevo concepto creado, cuando reciban dinero de publicidad por ejemplo de juan rubio en monteros, o zelaya en concepcion, lo ingresan como marketing venta de publicidad', NULL, '2024-01-08', 0, '2024-01-06 20:23:29', '2024-01-06 20:23:29'),
(339, 'todas', 'DEUDAS', 'Chicos no olviden saldar todos las deudas esta semana&nbsp;', NULL, '2023-01-08', 0, '2024-01-08 00:07:24', '2024-01-08 00:07:24'),
(340, 'todas', 'deudas', 'Chicos no olviden saldar deudas esta semana', NULL, '2024-01-08', 0, '2024-01-08 00:31:11', '2024-01-08 00:31:11'),
(341, 'todas', 'TAREAS', '1 No olviden tener la pagina abierta para que sea su recordatorio de las tareas a realizar<br>2 Colocar los pendrive en los teles', NULL, '2024-01-08', 0, '2024-01-08 00:51:11', '2024-01-08 00:51:11'),
(342, 'concepcion', 'HISTORIAS', 'No olvidar compartir historias. Deja abierta la pagina web para que te salga la tarea recordatoria', NULL, '2024-01-09', 0, '2024-01-09 12:16:59', '2024-01-09 12:16:59'),
(343, 'monteros', 'BANDAS ELASTICAS', 'Llegaran 5 bandas, dos para monteros y ponganle una cinta de papel a las otras 3 que diga \"concepcion\"', NULL, '2024-01-10', 0, '2024-01-09 12:50:59', '2024-01-09 12:50:59'),
(344, 'concepcion', 'MEDINAS', 'Ya les hice el cobro, falta hacerle el cobro de los 10 mil de interes nada mas, 5m il por persona, cuando te paguen cobrales desde el perfil de medina santiago, en grupos familiares siempre a la cabeza de la flia le salen las deudas de los demas', NULL, '2024-01-09', 0, '2024-01-09 13:05:45', '2024-01-09 13:05:45'),
(345, 'todas', 'DEUDAS', 'Recuerden saldar deudas hasta el dia viernes&nbsp;', NULL, '2024-01-10', 0, '2024-01-09 13:13:38', '2024-01-09 13:13:38'),
(346, 'todas', 'deudas', 'Deudas saldadas hasta el dia de hoy', NULL, '2024-01-12', 0, '2024-01-09 13:13:59', '2024-01-09 13:13:59'),
(347, 'todas', 'venta de publicidad', 'Nuevo movimiento, se ingresara como ingresos adicionales, rubro venta de&nbsp; publicidad, concepto ponen quien le entro, zelaya, rubio el que sea', NULL, '2024-01-10', 0, '2024-01-09 16:05:23', '2024-01-09 16:05:23'),
(348, 'todas', 'RECIBOS', 'Pedir recibo o factura en todas las compras que le den plata a alguien, ej cosas de mantenimiento, limpieza, etc. Para que se cotejen por protocolo y quede el respaldo. Si no les llevan al menos que le manden la foto.', NULL, '2024-01-10', 0, '2024-01-10 04:28:54', '2024-01-10 04:28:54'),
(349, 'todas', 'CABINA SOLAR', 'Los planes contratados siempre tendran un dia, esto para evitar el conflicto que se genera con dos planes simultaneos, le van extendiendo los dias hasta el dia que pide el turno solamente, recuerden que todos deben poner el dni en molinete por mas que ya se encuentren adentro del gimnasio si no no queda registrado el turno', NULL, '2024-01-11', 0, '2024-01-10 20:33:54', '2024-01-10 20:33:54'),
(350, 'monteros', 'AGREGAR RPTA RAPIDA', '<p>Agregar al liveconnect el link de respuestas rapidas para bajar la App:</p><p><a href=\"https://linktr.ee/hammer.ok\" target=\"_blank\">https://linktr.ee/hammer.ok</a></p><p>Notificar para que cree la tarea (Marcelo) para que sepan todos los chicos que esta el link.</p>', NULL, '2024-01-15', 0, '2024-01-12 14:33:10', '2024-01-12 14:34:29'),
(351, 'monteros', 'SERVICIOS ASANA', 'Actualizar desde este mes:<br>SEGURO: queda 1400 c sede<br>SPOTIFY: queda 3300 c sede<br>POSNET: +35%&nbsp;<br>', NULL, '2024-01-14', 0, '2024-01-12 14:44:32', '2024-01-12 14:44:32'),
(353, 'todas', 'NUEVA ACTIVIDAD', '<p>Actividad nueva \"Funcional Kids Luciano\". Es un convenio que se dara en la sala de arriba de 10:30 a 11:30 Lunes miercoles y viernes. El valor es 10000 pero la primera semana tendra un valor de 8000, lo bonifican y ponen \"Descuento de lanzamiento\"</p><p><br></p>', NULL, '2024-01-15', 0, '2024-01-14 19:06:37', '2024-01-14 19:06:37'),
(354, 'concepcion', 'COMUNICARSE CON CHOCHO', '1_ Para ver salarios<br>2_ Tenes que entrar a agendas, \"agendas de contactos\" y filtrar las agendas de hoy de la luciana, para enviar los mensajes que tiene programados ella', NULL, '2024-01-15', 0, '2024-01-14 20:21:24', '2024-01-14 20:21:24'),
(355, 'monteros', 'ACTUALIZACION CUOTA', 'NOTA: <br><span style=\"color: rgb(0, 0, 0); font-family: ui-monospace, SFMono-Regular, Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 18px; font-weight: 700;\">- En cuotas de efectivo en 2 cuotas sera un 13 y 3 cuotas un 27%</span><br>-El semestre en tarjeta sera un 15% no un 10%. Recuerden tambien q esta el anual en 6 cuotas, sin interes<br>- Recuerden no tener en cuenta cuando vendan los planes largos el precio de socioplus, ni calcular de ninguna tabla de porcentajes, se cobra lo que dice la tabla que imprimimos nosotros. En el caso de los planes largos que no dice el monto total y dice el monto de cada cuota lo unico que tienen que hacer es multiplicar la cantidad de cuotas por el valor que dice ahi, eso es lo que le tienen que cobrar, repito no guiarse de socio plus en planes largos con tarjeta<br>De la siguiente tabla el precio REDONDEADO es el que cobran<br><div style=\"text-align: center;\"><font color=\"#000000\" face=\"Calibri\"><span style=\"font-size: 14.6667px;\"><br></span></font></div><div style=\"text-align: center;\"><google-sheets-html-origin style=\"color: rgb(0, 0, 0); font-size: medium; text-align: start;\"><table xmlns=\"http://www.w3.org/1999/xhtml\" cellspacing=\"0\" cellpadding=\"0\" dir=\"ltr\" border=\"1\" data-sheets-root=\"1\" style=\"table-layout: fixed; font-size: 11pt; font-family: Calibri; width: 0px; border: none;\"><colgroup><col width=\"113\"><col width=\"63\"><col width=\"63\"><col width=\"63\"></colgroup><tbody><tr style=\"height: 20px;\"><td data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;PLAN&quot;}\" data-sheets-numberformat=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;0&quot;,&quot;3&quot;:1}\" style=\"border-width: 1px; border-color: rgb(0, 0, 0); border-image: initial; overflow: hidden; padding: 0px 3px; vertical-align: bottom; text-align: center;\">PLAN</td><td data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;ANTES&