(359, 'monteros', 'SALARIO PROTOCOLO', '21000 POR SEDE: 42000', NULL, '2024-01-15', 0, '2024-01-15 01:28:14', '2024-01-15 01:28:14'),
(360, 'todas', 'INFO SOBRE ACTUALIZACION CUOTA', 'Buenos dias chicos, quiero dejarles esta notificacion para remarcarles el hecho de que estamos en un contexto muy dificil, la demanda y la cantidad de clientes cayo mucho uno por la situacion economica y por otro lado las vacaciones. Estamos haciendo un esfuerzo de intentar actualizar la cuota y asumiendo un riesgo muy grande para tambien poder actualizarles a ustedes asi que les pido el mayor compromiso para intentar mantener a los clientes actuales y atraer a nuevos clientes, (remarcando la importancia de la atencion tanto en el mostrador como en las redes llevando a cabo los protocolos que ya estan elaborados y todos conocemos) ya que en caso contrario los meses siguientes dificilmente podamos continuar actualizando. Somos un equipo y trabajar por el bien general permitirá mejorar el contexto individual de cada uno de ustedes. ¡Buen comienzo de semana!', NULL, '2024-01-15', 0, '2024-01-15 01:33:39', '2024-01-15 01:33:39'),
(361, 'todas', 'REMERAS Y CABINA', '<p>Precios nuevos:<br>REMERAS A PARTIR DE ESTA SEMANA</p><p>CABINA A PARTIR DE LA SEMANA PROXIMA (DEL 22/01)</p>', NULL, '2024-01-16', 0, '2024-01-15 13:00:08', '2024-01-15 13:00:08'),
(362, 'concepcion', 'CLASE DE PRUEBA FUNCIONAL KIDS', 'DADA DE ALTA HORA 10 30 AM', NULL, '2024-01-16', 0, '2024-01-15 21:38:25', '2024-01-15 21:38:25'),
(363, 'concepcion', 'recordatorio marcelo', 'Fijarse en la planilla fecha 11/01 dos cobros de semestres si es que estan bien en AHORA 6 o hicieron 6 comunes. Avisar Marcelo', NULL, '2024-01-17', 0, '2024-01-17 05:26:58', '2024-01-17 05:26:58'),
(364, 'monteros', 'CLASE 22HS', 'Al final si estara dada de alta, benja hablo con los chicos y le dijeron que si iran', NULL, '2024-01-17', 0, '2024-01-17 12:27:01', '2024-01-17 12:27:01'),
(365, 'todas', 'RETROALIMENTACION', 'Completar esta semana 3 personas con las planillas para revisar el próximo lunes.', NULL, '2024-01-21', 0, '2024-01-17 15:08:25', '2024-01-17 15:08:25'),
(366, 'todas', 'CAMPAÑA RECAPTACION', 'Comenzamos con nuestra campaña de recaptacion.&nbsp;<br>Arranquemos la semana con los mensajes de las listas para terminarlos entre lunes y martes, MIERCOLES JUEVES VIERNES lo que haremos es entrar a LC: Filtrar las etiquetas \"prospectos LC\" y vamos a buscar todos aquellos que no llegaron a pasar los datos, la fecha es desde el 1 de noviembre hasta el 31 de enero. En una planilla aparte en excel me van poniendo el nombre y numero o insta de todas las personas que salgan, a la par me ponen enviado o no enviado (motivo, por ejemplo ya era socio), y le van haciendo el seguimiento. Vamos a ofrecerle un 15% de descuento durante una semana, en dos semanas presentamos la lista. ¡A trabajar y recuperar los clientes!', NULL, '2024-01-29', 0, '2024-01-18 13:24:01', '2024-01-18 13:24:01'),
(367, 'todas', 'CAMPAÑA RECAPTACION', 'Ultima semana para terminar la campaña , el viernes presentamos el excel', NULL, '2024-02-05', 0, '2024-01-18 13:24:30', '2024-01-18 13:24:30');
INSERT INTO `novedades` (`id`, `sede`, `titulo`, `mensaje`, `user`, `vencimiento`, `estado`, `created_at`, `updated_at`) VALUES
(368, 'todas', 'PRESENTAR LISTA', 'Mañana presentamos Excel', NULL, '2024-02-08', 0, '2024-01-18 13:24:56', '2024-01-18 13:24:56'),
(369, 'todas', 'PRESENTAR EXCEL', 'Me envian los resultados', NULL, '2024-02-11', 0, '2024-01-18 13:25:19', '2024-01-18 13:25:19'),
(370, 'todas', 'ALQUILERES', 'Si deben abonar algun alquiler, lo egresan como ALQUILER DE LOCAL \"egreso por pago de alquiler\" en concepcion deben firmar recibo y lo envian al grupo de facturas.<br>Si deben recibir el pago de alquiler (Para sede MONTEROS que alquilamos el local de la par) esta el movimiento \"Alquiler local\" \"ingreso por cobro de alquiler\".<br>Si por algun motivo alquilamos algunos de los salones (MONTEROS Y CONCEP) tenemos el concepto, \"ingresos adicionales\" \"alquiler de salon\", ya que estos no son alquileres fijos', NULL, '2024-01-19', 0, '2024-01-18 20:57:49', '2024-01-18 20:57:49'),
(371, 'todas', 'CLASES DE PRUEBA Y AGENDAS', 'Cuando estemos ocupando el&nbsp; turno de otra persona, o no esten presentes adrian o irina que son los encargados de enviar los mensajes de clases de prueba, deben ocuparse de sus actividades, serian:<br>1_ Enviar las clases de prueba a los prospectos, enviar al grupo de clases de prueba&nbsp;<br>2_ Enviar las agendas, para esto vamos a entrar en inicio a la izquierda, \"agendas\" filtran el nombre del compañero al cual deben enviarle las agendas y el dia correspondiente (dia de hoy) y luego entran perfil por perfil ponen \"agendas\" y leerán la agenda que tenia programada para el dia. Envian el mensaje al cliente o prospecto', NULL, '2024-01-22', 0, '2024-01-19 12:24:54', '2024-01-19 12:24:54'),
(372, 'monteros', 'SORAIRE SALARIO', 'No cobra esta semana, ya tiene todo saldado<br>Los horarios de los profes son: Brenda lunes miercoles viernes a la mañana<br>Amir lunes a la tarde y martes todo el dia<br>Soraire miercoles y viernes turno tarde jueves todo el dia', NULL, '2024-01-22', 0, '2024-01-22 00:24:20', '2024-01-22 00:24:20'),
(373, 'concepcion', 'ramon adelanto', 'Ramon saco un adelanto de 16 mil, por lo que esta semana deben descontarle cuando le abonen el semanal, no olvidarse', NULL, '2024-01-22', 0, '2024-01-22 00:25:06', '2024-01-22 00:25:06'),
