(377, 'concepcion', 'REVISAR SOCIOS', '3863615978: Revisar chat y si se convirtio en cliente o no, de ultima consultale, si te dice que no ofrecele un 15% off hasta el lunes de la semana que viene<br><br>Carbelo Nestor: Falto en un chat hacerle una agenda, por lo que hay que revisar si al final vino o no y en caso que no preguntar que paso y ofrecer un 15% off hasta el lunes.&nbsp;<br><br>NOTA: Todos aquellos que acepten la promo se le tiene que devengar una bonificacion y poner VALIDO HASTA (fecha del lunes)', NULL, '2024-01-25', 0, '2024-01-25 16:30:20', '2024-01-25 16:30:20'),
