(380, 'monteros', 'DJ HOY', 'Hoy a las 6.30 - 7 ira a tocar Eneas, dejemos todo preparado arriba con el banderin de hammer a la par de la cabina, buscar, enchufar y probar el cable que largue señal', NULL, '2024-01-29', 0, '2024-01-27 13:46:59', '2024-01-27 13:46:59'),
