(382, 'monteros', 'HACER LISTA DE CLIENTES PARA MARATON', 'Releer lo que te habia mandado la vez pasada explicandote como se haria, fijate si lo entendes si no avisame y lo revemos. Tiene que ser cargado si o si esta mañana para que giuliano actualice los flyers esta tarde. Una vez realizado cargar en timetree con la fecha de hoy y avisar a giuliano', NULL, '2024-01-29', 0, '2024-01-28 23:35:06', '2024-01-28 23:35:06'),
(383, 'todas', 'FERIADOS 12 Y 13 FEBRERO', '<span style=\"color: rgb(255, 255, 255); font-family: -apple-system, BlinkMacSystemFont, HelveticaNeue, &quot;Helvetica Neue&quot;, TeXGyreHerosBold, Helvetica, Tahoma, Geneva, Arial, &quot;Hiragino Sans&quot;, &quot;ヒラギノ角ゴ ProN W3&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meryo, メイリオ, Osaka, Verdana, &quot;ＭＳ Ｐゴシック&quot;, &quot;MS P Gothic&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; letter-spacing: 0.16px; white-space-collapse: preserve; background-color: rgb(231, 59, 59);\">LUNES 12\r\nApertura y cierre: 8 a 12 hs - 15 a 22 hs \r\nMARTES 13: ¡Horario normal!</span>', NULL, '2024-01-30', 0, '2024-01-29 13:41:43', '2024-01-29 13:41:43'),
(384, 'monteros', 'FILTRAR GANADORES', '<p>                Filtrar los ultimos 3 dias que quedaban y anotar en timetree del dia lunes. Ademas tienen que hacer un video haciendo el sorteo. Pasale a iirna tambien los 10 primeros asi hace el video del sorteo en concepcion. Giuliano el lunes tiene que publicar todo</p><p><br></p>', NULL, '2024-02-01', 0, '2024-01-29 15:11:34', '2024-01-29 15:15:19'),
(385, 'monteros', 'POST', 'Recordarme para que haga el posteo hoy', NULL, '2024-01-29', 0, '2024-01-29 15:44:06', '2024-01-29 15:44:06'),
(386, 'todas', 'PUBLICIDAD VIDEO AGUSTIN', '<p>Se esta pagando una publicidad en las redes sociales, originalmente es un video de fb:<br><a href=\"https://fb.watch/pTKqxZjPvE/?mibextid=Nif5oz\" target=\"_blank\">https://fb.watch/pTKqxZjPvE/?mibextid=Nif5oz</a><a href=\"https://fb.watch/pTKqxZjPvE/?mibextid=Nif5oz\" target=\"_blank\"></a><br>Pero puede salir tambien en stories de fb, insta, como post de insta (aunque no aparece en el muro), asi que esten atento a las notificaciones y tengan abierto el post.&nbsp;<br>Se comenta \"Hola _______, te dejamos un mensaje privado\" y se pone enviar mensaje. De paso revisen porque hay comments de varios meses que nunca se contestaron para preguntarle a la gente si siguen interesados.</p><p><br></p>', NULL, '2024-01-30', 0, '2024-01-29 19:49:25', '2024-01-29 19:49:25'),
(387, 'todas', 'CONTESTACION DE MSJS PROSPECTOS', '<p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Como vendedores siempre debemos esconder las debilidades y lucir las fortalezas.</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Las debilidades normalmente son dos:<br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Precio: lo ocultamos desviando la conversación para conseguir una clase de prueba antes de mostrarlo, para que el cliente entienda por qué el costo es elevado.</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Actividades no disponibles: lo solucionamos ofreciendo otra similar (ejemplo PILATES / YOGA).</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Les dejo un caso en donde se hizo una consulta primero de una debilidad (respondida bien) y luego de dos fortalezas (promo familiar e instructor) y se procedió erróneamente desviando el chat en lugar de mostrarlas.</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">-------------------------------------------------</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Cliente consulta por ZUMBA</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">- Vendedor: No contamos con clase de Zumba por ahora Agus (te puedo ofrecer nuestras clases grupales que son más aeróbicas como funcional o crossfit, hiciste antes Agus?</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">- Cliente: no hice, cuanto sale el mensual y qué días hay funcional? Y ya que estamos me gustaría saber el precio para hacer musculación y si hay algún descuento empezando con mi hermana y si hay alguien que te entrene.</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">- Vendedor: primera vez que vendrías al gym o ya viniste en algún momento?</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Luego el cliente no contestó más.<br>--------------------------------------------------</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\"><span style=\"color: var(--bs-modal-color); font-size: 1rem;\">Podríamos haber enganchado al cliente con las cosas que les interesaban.&nbsp;</span><span style=\"color: var(--bs-modal-color); font-size: 1rem;\">Es decir, el método de desviar solamente sirve si la respuesta pretende ocultar una debilidad, pero deben saber que no es indispensable en todos los casos.</span></p>', NULL, '2024-01-30', 0, '2024-01-29 20:34:42', '2024-01-29 20:36:14'),
(388, 'todas', 'AHORA 12', 'Hoy es el ultimo día para vender con AHORA 12, porque no sabemos como seguirá el programa en febrero. Asi que se da de baja el programa en ahora 12 y los planes largos con tarjeta hasta nuevo aviso', NULL, '2024-01-31', 0, '2024-01-29 20:56:57', '2024-01-29 20:56:57'),
(389, 'monteros', 'BENJAMIN ORELLANA', 'No debe abonar mas, se le cargara un contrato todos los meses se le cobrara y se egresara como administración pagina web.&nbsp;', NULL, '2024-02-01', 0, '2024-01-31 20:15:27', '2024-01-31 20:15:27'),
(390, 'todas', 'PROMO BNA', 'PROMO BNA/MODO CN TARJETAS DE CREDITO EN 6 CUOTAS SOLO DIA JUEVES HASTA FIN DE FEBRERO Y VEMOS COMO CONTINUA<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Activamos una promo donde las personas pagaran 3 meses y le cargaremos cuatro, osea le regalamos un mes. Como tienen que pagar, desde su app BNA + es decir banco nacion, entran a \"MODO\", modo es un modo de pago que tiene el banco nacion donde en su cuenta vinculan sus tarjetas, entonces es como que pueden pagar con tarjeta pero desde su celu, no es necesaria la tarjeta fisica, pero como se la pasa por el posnet? Con un codigo QR, que se genera entrando a ventas, y dice generar codigo qr, me avisan si no lo encuentran. Ahora el monto maximo que pueden pasar por cada pago es de 12mil, por lo que uds tienen que hacer es calcular el pago total por ejemplo, en monteros sale 12400 x 4 = 49600 que es lo que tenemos que cobrarle (el mes que se le regala le regala el banco luego cuando le llega el resumen de su tarjeta, nosotros cobramos normal los 4 meses). Pero como podemos solo hacer cobros de 12000 tenemos que hacer 3 cobros de 12 mil (36mil) + un cobro de 13600 (ahi estarian en total los 49600). El codigo que tienen que usar siempre es 6 en este caso (no el 16), solo con el codigo qr usan el 6.<br><br>Obviamente tienen que explicarle a la gente que el mes que se le regala es en el resumen luego.\r\n            <br><br>Dejo el procedimiento en preguntas frecuentes', NULL, '2024-02-02', 0, '2024-02-02 16:20:41', '2024-02-02 18:33:08'),
(391, 'todas', 'PRESENTACION PRECIOS', 'Recuerden que para presentar los precios lo ideal es una vez encontrada la actividad ideal para la persona ofrecer los precios en su forma mensual, semestral, anual y con promo BNA si esta activa. Siempre ofrecer todas esas formas de pago', NULL, '2024-02-05', 0, '2024-02-02 18:39:30', '2024-02-02 18:39:30'),
(392, 'monteros', 'SPOTIFY', 'Actualizar precios desde febrero a 1750 por sede', NULL, '2024-02-04', 0, '2024-02-03 20:22:34', '2024-02-03 20:22:34'),
(393, 'todas', 'GANADORES', 'Debemos mencionar en la historia que publicamos a los ganadores del sorteo, en sede concepcion loana si puede enviarle a brisa o adrian los perfiles para que etiqueten aqui. Por otro lado tenemos que preparar las tarjetitas de quechevere, gerf y lookfit, y una bolsita de hammer para colocar y entregar una remera. Le envian todos los mensajes a los ganadores tambien, cada sede se hace cargo de los suyos, y debe pedirle a los ganadores que descarguen la aplicacion para poder recibir el premio', NULL, '2024-02-05', 0, '2024-02-05 03:15:31', '2024-02-05 03:15:31'),
(394, 'todas', 'CURSO CERTIFICADO', 'Chicos recuerden organizarse para este sabado, es obligatorio, muchas gracias!', NULL, '2024-02-19', 0, '2024-02-06 14:04:26', '2024-02-06 14:04:26'),
(395, 'monteros', 'FRANFRAN', 'Tenes que entrar a agendas de contacto, filtras las de la brisa dia por dia para ir enviando sus agendas ya que ella no las hara. No te olvides Fran', NULL, '2024-02-07', 0, '2024-02-06 14:05:16', '2024-02-06 14:05:16'),
(396, 'concepcion', 'ALQUILER ORQUERA', 'Mandar a Fabi que deje la plata del alquiler de Orquera.<br>Controlar con Lu si ya pagó el alquiler de Bety', NULL, '2024-02-07', 0, '2024-02-07 13:21:37', '2024-02-07 13:22:58'),
(398, 'todas', 'LEER PREG FRECUENTES', '- Chicos sumamos dos preguntas frecuentes para que lean, como proceder con los vouchers de regalo (cuando alguien quiere realizarle un regalo a otra persona).<br><br>- Promo BNA bien explicado, lean bien asi saben instruir a los clientes', NULL, '2024-02-14', 0, '2024-02-10 19:05:26', '2024-02-10 19:05:26'),
(399, 'todas', 'MUSICA', '<div>En caso de arrancar en el turno mañana se ingresa a la playlist Hammer Gym, dentro de la lista van a BUSCAR y esciben la siguiente canción segun se el día y le dan play:<br><br><span style=\"color: var(--bs-modal-color); font-size: 1rem;\">LUNES</span><br></div><div>MONACO HOUSE REMIX</div><div><br></div><div>MARTES</div><div>LOLLIPOP TECH HOUSE</div><div><br></div><div>MIERCOLES</div><div>EPIC SAX GUY</div><div><br></div><div>JUEVES</div><div>BZRP #57 REMIX</div><div><br></div><div>VIERNES</div><div>CHORRITO PA LAS ANIMAS TECH</div><div><br></div><div>Es para que no suene la misma musica todos los días a la misma hora.</div>', NULL, '2024-02-13', 0, '2024-02-12 19:07:20', '2024-02-12 19:07:20'),
(400, 'monteros', 'ADRIAN', 'Recordar pago dispenser 100.000 en pagofacil', NULL, '2024-02-13', 0, '2024-02-12 22:55:08', '2024-02-12 22:55:08'),
(401, 'todas', 'LIMPIEZA', 'Buenos dias, por favor quiero recordarles sobre la limpieza de recepcion. Cada turno tiene que informar si recibe su recepcion sucia para hablar con el turno anterior, en el caso que no avise se tiene que reesponsabilizar de limpiarlo. Seamos respetuosos con los compañeros, no es justo que nadie tenga que lavar las cosas de uno u ordenarlas y si alguien fuera de recepcion pide las cosas uds se la prestan si quieren pero los comprometen a que luego los laven ellos, si no lo hacen, se hacen cargo ustedes y no le prestan mas', NULL, '2024-02-14', 0, '2024-02-13 14:13:29', '2024-02-13 14:13:29'),
(402, 'concepcion', 'SOREMER EMERGENCIAS', 'Se dio de alta hasta 30 de abril el servicio de emergencias de soremer, en donde si alguien se siente mal por cualqueir cosa, se golpea lastima etc llaman a&nbsp;4311446 o 0810-777-7676. Estara pegado en la pc', NULL, '2024-02-15', 0, '2024-02-14 15:30:31', '2024-02-14 15:30:31'),
(403, 'todas', 'VENTA DE PLANES', 'Buen dia chicos, recuerden siempre de al presentar los precios, cuando lo hagan sobre una actividad especifica, presenten en su plan mensual, semestral, anual y consulten si tienen modo bna', NULL, '2024-02-16', 0, '2024-02-15 13:08:21', '2024-02-15 13:08:21'),
