(409, 'concepcion', 'recaptacion aerobics', 'Hola nombre! Soy Irina de HammerX. Como estas? Estuve viendo que no asistis a nuestras clases de aerobics desde (tiempo) y queria preguntarte cual fue el motivo e invitarte a retomar con la actividad, para esto te quiero ofrecer un descuento de un 15% off que podes aprovecharlo hasta fin de mes! Si te gustaría retomar avisame y coordinamos ! :)<br><br>Enviar a todos aquellos que no esten haciendo otra actividad<br><br>', NULL, '2024-02-20', 0, '2024-02-19 19:35:13', '2024-02-19 19:35:13'),
(412, 'concepcion', 'FAMILIARES', 'Tengo una familia lobo sebastian, que son 4 integrantes pero nunca le hicieron el grupo familiar, brisa me comento tambien que en concep no se viene haciendolos, no te olvides siempre que hagas una promo tienen que vincularlos en un grupo lu, asi no se les complica de ver si estan todos activos por si no pagaran simultaneamente', NULL, '2024-02-20', 0, '2024-02-20 13:50:58', '2024-02-20 13:50:58'),
(413, 'concepcion', 'PROMOS FAMILIARES', 'bian, siempre que se hagan promos familiares tiene que estar la familia en grupo, si no sabe scomo en preguntas frecuentes esta como cargalos asi, por que de esa manera cuando van a renovar vos rapidamente te fijas si estan activos y quienes son sus familiares directamente. Esto es algo que hicimos hace poco por lo que hay muchos que no estaban agregados en grupo, por lo que a emdida que vayas haciendoles descuento y detectndo grupos, los vas agregando por ejemplo a la flia LOBO ayer teniamos que hacer un grupo, siempre el cabeza del grupo familiar sera el adulto, es decir a ese perfil entras a editarlo y donde dice socio individual, cambias a familiar, y abajito a la izquierda te aparece grupo familiar y te aparecera un + de ir agregando los integrantes', NULL, '2024-02-20', 0, '2024-02-20 14:22:25', '2024-02-20 14:22:25'),
