(418, 'concepcion', 'CONVENIO AFIP', '<p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">El gremio les envia a marcelo una lista con los integrantes que vendran a hammer, le solicitamos que hagan su pago por transferencia y les envie a ustedes el comprobante por whatsapp. Los afiliados y/o hasta 2 familiares del afiliado a AEFIP (Gremio de Afip) enviarán el comprobante de pago vía whatsapp a HAMMER, se debe chequear el listado de altas (solicitar a Marcelo), en caso de que figure el nombre avanzar, si no figura solicitar credencial de AEFIP del titular o del familiar que sea titular. Una vez confirmado, solicitar demás datos para crearle el perfil y dejar el siguiente mensaje:</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">\"La admisión está lista, cuando asistas debes comunicar en recepción que estás dado de alta a través del gremio de AEFIP y seguidamente vas a ingresar colocando tu número de documento en el molinete, en caso de requerir entrenador se lo comunicas en recepción para que te guíen al mismo, idealmente debes asistir con tu botella y toalla personal. Para cualquier consulta podes contactarte a través de este numero o bajarte la App HAMMERX disponible para tu teléfono Android o Iphone, donde tenes toda tu info y vas a recibir comunicados, promociones y fecha de renovación\"</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">Seguidamente enviar a franco pidiendole la factura, cuando franco les envie inmediatamente se la mandan a los clientes. Se les notifica que estará disponible en 48 hs hábiles a través de este medio. El único medio de pago para este gremio es Transferencia al CBU de BANCO NACION de Marcelo (MUY IMPORTANTE) o tarjeta de crédito. No entregar otro CBU como el de Jessi que no sea el de marcelo, no cobrar en efectivo, directamente les dicen que el convenio esta dado de alta para pagos por transferencia.</p><div><br></div>', NULL, '2024-02-21', 0, '2024-02-21 14:12:53', '2024-02-21 14:12:53'),
(419, 'concepcion', 'YOGA', 'Volvemos el 5 de marzo con yoga con profesora DORA. Martes y jueves de 16 a 17', NULL, '2024-02-21', 0, '2024-02-21 14:17:49', '2024-02-21 14:17:49'),
(420, 'todas', 'FALTANTES', 'Chicos recueden que los faltantes no se corrigen con caja, se reponen con el sueldo del dia. Por otro lado, cuando tengan un faltante revisen que hayan realizado bien todos los egresos de los cobros con transferencia y que les de bien el stock<br><br>SOBRANTES: Si tienen sobrantes si, tienen que corregir caja, no sin antes revisar que su stock este bien tambien, ya que pueden haber vendido algo, recibido la plata y nunca lo cobraron, por lo que si tienen mas en sistema que en heladera (les falta productos) seguramente es eso, ahora si lo cargaron en sistema pero no cobraron, eso me avisan a mi por que yo puedo entrar a sistema a ver quienes estan con deudas.', NULL, '2024-02-22', 0, '2024-02-21 16:21:52', '2024-02-21 16:21:52'),
(421, 'todas', 'descuentos', 'Cuando pregunten precio en recepcion les pasan el precio normal, no preguntan si entrenan con alguien ni nada de eso ¿Por que? Nosotros ofrecemos un servicio de profe en el gym, asi confundimos a la gente y tenemos que explicarles que pueden abonar un profe por aparte y demas, en ese caso estamos desvalorizando nuestro servicio, por que les estamos diciendo nosotros te damos algo masomenos y podes pagar algo mejor. Ustedes siempre tienen que recomendar que entrenen con nuestros profes, y en el caso que deseen pagar por aparte tambien recomiendan a nustros profes en primer lugar, luego estan los demas, primero sus compañeros de trabajo. Asi que ya saben, pasan precio normal y si ellos tienen descuentos que se los recuerden ellos a ustedes, no ustedes a ellos', NULL, '2024-02-22', 0, '2024-02-21 16:23:49', '2024-02-21 16:23:49');
