(439, 'concepcion', 'cumplaños guille', 'ayer cumplio años guille y brian hace unos dias. Organicen para esta tarde comprar una tortita) la mas chiquita que viene, y cantarles el cumple a los dos juntos esta tarde, inviten al que quiera ir, por supuesto que no es obligacion para los que no estan en su horario laboral, pueden hacerlo en el cambio de turno bianca y luciana asi esten las dos', NULL, '2024-03-11', 0, '2024-03-04 13:53:11', '2024-03-04 13:53:11'),
(440, 'concepcion', 'ACCESO MADRE DE CHICOS', 'Los papas de las clases de kids deben esperar abajo, tienen para sentarse y esperarlos, no puede pasar nadie por el molinete sin acceso, les notifican por favor, camila ya esta notificada tambien', NULL, '2024-03-05', 0, '2024-03-05 13:41:19', '2024-03-05 13:41:19'),
(441, 'monteros', 'abreviaturas', 'Debemos cambiar las abreviaturas de los planes para que no sean tan largas y entren en el comprobante que imprimiremos con la comandera. Tenemos que entrar a configuracion de sistema, buscas cada plan (vas controlando uno por uno en un perfil de cliente) entras a datos generales y les cambias no el nombre si no la abreviatura, esa es la que se muestra en el ticket:<br><br>Tenes que ponerles reusmido:<br><br>Clase<br>Clases grupales<br>Musculacion<br>Semestre (a todos les pones el mismo)<br>Anual<br>Pase libre<br>Pilates&nbsp;<br>Pase libre pilates<br>Cab. Solar<br>Semana Quincena<br>Invitacion (este seria para clase o semana de invitacion socios)<br><br>Las clases de prueba directamente ponele a todo Prueba.<br><br>Cualqueir cosa me preguntas (confio en vos)', NULL, '2024-03-06', 0, '2024-03-05 22:26:12', '2024-03-05 22:26:12'),
