(443, 'concepcion', 'SALDAR PRODUCTOS', 'Buen dia Lu, estamos haciendo el cierre del mes de febero, durante esta semana necesito que dejemos todos los perfiles sin deudas. Muchas gracias!', NULL, '2024-03-11', 0, '2024-03-06 12:49:26', '2024-03-06 12:49:26'),
(444, 'concepcion', 'DEUDAS', 'Buenas tardes Bian. Estoy cerrando el mes de febrero, si podes cuando abones siempre a los chicos entra antes a sus perfiles para ver si tienen que saldar algun prodcuto, en realidad eso es diario. Creo que ahora tenia un producto cargado ale diaz y ramon y bueno vos tb tenes que ir saldandola a la tuya', NULL, '2024-03-06', 0, '2024-03-06 12:52:40', '2024-03-06 12:52:40'),
(445, 'monteros', 'deudas', 'buenas tardes jess. Cuando abones los sueldos en el dia a dia entra a los perfiles de los chicos por favor y siempre saldale las deudas que tengan con el pago del dia. Ahora tienen benja y enzo creeria', NULL, '2024-03-06', 0, '2024-03-06 13:07:48', '2024-03-06 13:07:48'),
(446, 'monteros', 'EXTENSIONES DE CONTRATOS', 'Buen dia bri, los contratos auditados hay que entrar a ver diariamente quien los modifico a los vencimientos y el porque, de ultima pasame una lista a mi directamente y ya me comunico con ellos. Si no podemos hacer todos los viernes lo de la semana, es rapido eso. Agregalo en tareas y comencemos una vez finalizada la competencia', NULL, '2024-03-11', 0, '2024-03-06 13:23:18', '2024-03-06 13:23:18'),
(447, 'concepcion', 'afip', '<div>Chicos, cuando alguien les pida por el convenio afip, recuerden, solo recibimos transferencias</div><div>esta el procedimiento cargado en la pagina</div><div>para que lean</div><div>No cobren con efectivo,&nbsp;<span style=\"color: var(--bs-modal-color); font-size: 1rem;\">los hacen pasar y avisan a loana por medio de un mensaje o dejan anotado en la planilla del otro dia, para que ella les mande un msj al otro dia, pidiendole la transferencia asi le factura y le envia la factura</span></div><div>los hacen pasar, les dicen que ya se contactara el coordinador de los convenios al otro dia y <span style=\"color: var(--bs-modal-color); font-size: 1rem;\">obviamente si los atiende loana directamente les explica que tiene que hacer el pago por transferencia, que asi estamos trabajando con los convenios y le hace la facutra inmediatamente)</span></div><div>por ahora a todos los que vayan haganles, pero ya cuando nos comiencen a pasar la lista se guiaran de ahi directamente, o que lleven el carnet que ellos tienen del gremio, en el caso que no este en la lista, los hacen pasar y les piden que se contacten con su gremio para que nos confirme o los agregue a la lista&nbsp;<span style=\"color: var(--bs-modal-color); font-size: 1rem;\">ya que no estan</span></div>', NULL, '0202-03-15', 0, '2024-03-07 13:48:43', '2024-03-07 13:48:43');
