(448, 'todas', 'afip', '<p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">El gremio envia una planilla de integrantes que les pasaremos nosotros, los integrantes de la lista irian al gimnasio y ustedes corrobarian que esten presentes en la misma, en el caso de ser asi le explican que ya se comunicara nuestro coordinador de convenios ya que el turno mañana es el encargado de la facturacion, le dejan avisado al turno mañana el nombre y dni del cliente, este se comunica en la mañana con el mismo y le pide la transferencia, ya que los convenios afip solo se recibe transferencia. ES IMPORTANTE QUE NO RECIBAN EFECTIVO. Turno mañana recibe la transferencia, solicita el comprobante, le factura y le envia la factura, de ahi se carga todo normal. Siempre los hacen pasar y luego avisan para que el turno de la mañana los haga pasar. Si no saben que hacer se comunican con dueños.<br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x