=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\"></p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">VALIDO PARA:&nbsp; Los afiliados y/o hasta 2 familiares del afiliado a AEFIP (Gremio de Afip) enviarán el comprobante de pago vía whatsapp a HAMMER, se debe chequear el listado de altas o credencial si no esta en la misma. (Siempre dejenlos pasar, le cargan el mes y pasan, luego nos notifican y vemos como hacemos)</p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\"><br style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\"></p><p style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ;\">EL CBU A ENTREGAR SIEMPRE ES EL DE MARCELO SEDE CONCEPCION CHOCHO SEDE MONTEROS.</p>', NULL, '2024-03-18', 0, '2024-03-07 13:53:26', '2024-03-07 13:53:26'),
(449, 'todas', 'tvs', 'Por favor, les pido que entre todos colaboren y comprometan al resto del staff de notificar si el tv no esta funcionando. El turno mañana es encargado de prenderlos, pero luego durante el dia todos podemos ver y controlar, si no lo prendemos estamos faltando el respeto a quienes nos compraron la publicidad y ademas invertimos mucho en poder colocar los teles en concepcion. Gracias!', NULL, '2024-03-08', 0, '2024-03-07 18:20:34', '2024-03-07 18:20:34'),
(450, 'todas', 'FAMILIARES + PLANES LARGOS', '<span style=\"font-family: &quot;Messina Regular&quot;;\">- En caso que sus familiares abonen un plan largo, se le hace un descuento de 10% off solamente. Pongo un ejemplo, si 2 familiares pagaron plan largo y el paga el mensual se le hace 10% off, si fueran dos los que pagan mensual 10% a cada uno, si fueran 3, ya se los toma como un grupo diferente y se le hace el 1/2 mes gratis entre esos tres.</span>', NULL, '2024-03-08', 0, '2024-03-07 18:22:00', '2024-03-07 18:22:00'),
(451, 'concepcion', 'ALQUILERES', 'Separar 255.000 y avisar Bety para pagar (o a Marcelo para que les pase el nro). Debe firmar ella el recibo que queda en Hammer y siempre pide uno para ella.', NULL, '2024-03-08', 0, '2024-03-07 23:03:10', '2024-03-07 23:03:10'),
(452, 'concepcion', 'ALQUILERES', 'Pagar Orquera a la mañana o siesta. El monto es 65.000. Puede ir Fabiana. Preguntar si podemos retirar el contrato para firmar Marcelo a la noche y devolverlo a la mañana siguiente.', NULL, '2024-03-10', 0, '2024-03-07 23:04:35', '2024-03-07 23:04:35'),
(453, 'concepcion', 'FLORSVALDI', 'Comunicarse con el siguiente instagram para felicitarla por haber ganado el sorteo y consultar cuando comenzaria para cargar su contrato. egresar como canjes y premios', NULL, '2024-03-11', 0, '2024-03-09 23:33:42', '2024-03-09 23:33:42'),
(454, 'todas', 'Panilla de instructores', 'Presentar hasta hoy la planilla de instructores del mes de Febrero a Brisa', NULL, '2024-03-11', 0, '2024-03-11 10:17:26', '2024-03-11 10:17:26'),
(455, 'concepcion', 'PAGOS CONVENIOS', 'NATI&nbsp;34350 en total PONER EN OBSERVACIONES, COBRA HASTA EL 10/03', NULL, '2024-03-11', 0, '2024-03-11 14:56:18', '2024-03-11 14:56:18'),
(456, 'concepcion', 'camila pago', '73000&nbsp;', NULL, '2024-03-11', 0, '2024-03-11 14:59:22', '2024-03-11 14:59:22'),
(457, 'monteros', 'DJ', 'hoy viene eneas. Controlar que funcione todo', NULL, '2024-03-18', 0, '2024-03-12 13:51:34', '2024-03-12 13:51:34'),
(458, 'todas', 'ACTUALIZACION DE CUOTA', 'Actualizacion de cuota martes 19.03&nbsp;', NULL, '2024-03-14', 0, '2024-03-13 13:33:36', '2024-03-13 13:33:36'),
(459, 'todas', 'CARTILLAS', 'Preparar nuevas cartillas en recepcion', NULL, '2024-03-19', 0, '2024-03-13 13:34:02', '2024-03-13 13:34:02'),
(460, 'monteros', 'PRECIOS CONVENIOS', 'Enviar nuevos precios a Arcor y Citromax para inicio Abril. Ya ve Marcelo lo de Gympass.', NULL, '2024-03-18', 0, '2024-03-14 16:53:09', '2024-03-14 16:53:09'),
(461, 'concepcion', 'SUELDOS', 'Al pagar todos los sueldos hoy descontar productos adeudados y dejar en cero las cuentas en sistema', NULL, '2024-03-15', 0, '2024-03-14 17:39:56', '2024-03-14 17:39:56'),
(462, 'monteros', 'NUEVOS PRECIOS', '<p>Actualización de todas las actividades sin excepción en torno al 11% (Ref. la inflación que marca el gobierno fue un 13,2%). Impacta a partir del martes 19.</p><p><google-sheets-html-origin style=\"color: rgb(0, 0, 0); font-size: medium;\"></google-sheets-html-origin></p><table xmlns=\"http://www.w3.org/1999/xhtml\" cellspacing=\"0\" cellpadding=\"0\" dir=\"ltr\" border=\"1\" data-sheets-root=\"1\" style=\"border: none; --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgb(59 130 246 / 0.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; table-layout: fixed; font-size: 11pt; font-family: Calibri; width: 0px;\"><colgroup style=\"--tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --