INSERT INTO `text_contents` (`id`, `key`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'welcome_section', 'Vos, en el centro de la escena', 'En Hammerx encontrarás un montón de actividades grupales e individuales pensadas y programadas para vos.\r\n¡Contanos tu objetivo y te asesoramos sin preocuparte por tu nivel o experiencia, nuestro profe o coach se encargará de todo!', '2024-01-29 17:23:11', '2024-02-01 13:01:10'),
(2, 'act_musculacion', 'Sala de Musculación', '¿Primera vez entrenando o ya contas con experiencia? No te preocupes, porque en nuestros salones de musculación vas a contar con una gran variedad y calidad de máquinas y pesos libres para entrenar la fuerza, aumentar la musculatura y tonificar el cuerpo. Siempre guiad@ por nuestros instructores y además dispondrás de diferentes rutinas pensadas para que arranques de 0 y para desafiarte todos los días.', '2024-01-29 19:30:21', '2024-01-29 19:30:21'),
(3, 'act_cardio', 'Salas de Cardio', '¿Pensas que hacer cardio es aburrido?\r\n                            Con nuestro plan de musculacion tambien tendrás a disposición todos nuestros equipos de\r\n                            cardio, cintas, bicis, elípticos, remos, airbikes, entre otros, para que elijas el más\r\n                            divertido y apto para vos, con los que podras quemar todas las calorías que te\r\n                            propongas, o\r\n                            bien para calentar un ratito antes de comenzar tu rutina 💪🏻', '2024-01-29 19:35:26', '2024-01-29 19:35:26'),
(4, 'act_grupales', 'Salas de clases grupales', '¿Y si probas entrenando en compañía con nuestras clases grupales?\r\n                            Crossfit, Funcional, Zumba, Aerobics y muchas otras actividades para que puedas elegir\r\n                            según\r\n                            tu gusto y tus objetivos, siempre vas a tener a tu disposición coachs que te van a\r\n                            orientar\r\n                            para que arranques desde el nivel más básico o para perfeccionarte si ya contas con\r\n                            experiencia previa. ¡Consulta las clases disponibles en tu sede!\r\n                            Si sentís que las actividades individuales no son para vos aquí encontraras tu lugar  😄', '2024-01-29 19:38:29', '2024-01-29 19:44:01'),
(5, 'act_bajo_impacto', 'Salas de clases de bajo impacto', '¿Sabías que también contamos con clases de bajo impacto? Pilates,\r\n                            Yoga\r\n                            y talleres para 3era edad (consulta las disponibles en tu sede). Vas a trabajar sin\r\n                            impacto\r\n                            para fortalecer todo tu cuerpo, mejorar postura y recuperar la movilidad perdida. Son\r\n                            ideales\r\n                            para aumentar la fuerza y flexibilidad, rehabilitarte de lesiones, complementar y\r\n                            especializarte en otras actividades y para conectar la mente con tu cuerpo 🧘', '2024-01-29 19:45:43', '2024-01-29 19:45:43'),
(6, 'act_kids', 'Actividades Kids', '¿Sabías lo importante que es la actividad física en los niños?\r\n                            Por eso contamos con diferentes actividades grupales para ellos. Todas están guiadas por\r\n                            profes y pensadas para divertirse, y para acompañar su desarrollo tanto físico como\r\n                            social,\r\n                            desde las etapas más tempranas.', '2024-01-29 19:48:16', '2024-01-29 19:48:16'),
(7, 'sede_monteros_horario_semana', 'Lunes a Viernes', '07:00hs a 23:00hs', '2024-01-29 19:58:21', '2024-01-29 19:58:21'),
(8, 'sede_monteros_horario_finde', 'sabado', '10:00hs a 18:00hs', '2024-01-29 19:59:00', '2024-01-29 19:59:00'),
(9, 'sede_monteros_contacto', 'Celular', '3863564651', '2024-01-29 20:06:49', '2024-01-29 20:06:49'),
(10, 'sede_conce_horario_semana', 'Lunes a Viernes', '06:30hs a 23:00hs', '2024-01-29 20:12:20', '2024-01-29 20:12:20'),
(11, 'sede_conce_horario_finde', 'sabado', '10:00hs a 18:00hs', '2024-01-29 20:13:01', '2024-01-29 20:13:01'),
(12, 'beneficios_coach', 'INSTRUCTORES Y COACHS', 'Todas nuestras actividades cuentan con Instructores y Coachs para poder garantizar un entrenamiento\r\n                adecuado, minimizando los riesgos de lesiones y garantizando un acompañamiento óptimo y de esa manera\r\n                poder realizar los ejercicios de manera correcta y lograr los objetivos deseados. HAMMER no se\r\n                responsabiliza de las actividades y ejercicios que se realicen con instructores y coachs particulares\r\n                que no trabajen para nuestro gimnasio.', '2024-01-29 20:19:28', '2024-01-29 20:19:28'),
(13, 'beneficios_promo', 'PROMOCIONES', 'En HAMMER contamos con promociones Familiares y promociones amigos referidos. Para conocerlas hace click\r\n                aca así nos ponemos en contacto y te asesoramos 😊', '2024-01-29 20:22:34', '2024-01-29 20:22:34'),
(14, 'beneficios_convenios', 'CONVENIOS', 'GYMPASS - SIPROSA - GREMIO UEJN (PODER JUDICIAL)', '2024-01-29 20:24:17', '2024-01-29 20:24:17'),
(15, 'beneficios_congelado', 'CONGELAMIENTO DE CONTRATOS', 'Se podrá solicitar el congelamiento de contratos desde el día solicitado en adelante (no pudiendo ser\r\n                recuperados aquellos días ya perdidos), por un plazo máximo variable y dependiente del tipo de plan\r\n                contratado. Para activar el beneficio de congelamiento, la fecha debe ser acordada previamente y luego\r\n                no podrá ser modificada.\r\n                Plazo para pedir el congelamiento:', '2024-01-29 20:26:11', '2024-01-29 20:26:11'),
(16, 'beneficios_congelado_mensual', 'PLANES MENSUALES:', 'Se podrá realizar dentro de toda la duración del contrato y por única vez, con una extensión\r\n                        mínima de 14 días y máxima de 30 días, solicitados por los siguientes motivos: Enfermedades\r\n                        (solo con certificación medica), Lesiones ocurridas dentro de nuestras instalaciones (no serán\r\n                        incluidas lesiones ocurridas fuera del gimnasio) y en la cual HAMMER asuma responsabilidad de la\r\n                        misma, Viajes laborales o vacacionales en temporada (con factura de reserva).', '2024-01-29 20:39:37', '2024-01-29 20:39:37'),
(17, 'beneficios_congelado_semestral', 'PLANES SEMESTRALES:', 'Se podrá congelar dentro de toda la duración del mismo y por única vez, con una extensión mínima\r\n                        de 14 días y máxima de 45 días y solicitados por los siguientes motivos. Enfermedades (solo con\r\n                        certificación medica), Lesiones ocurridas dentro de nuestras instalaciones (no serán incluidas\r\n                        lesiones ocurridas fuera del gimnasio) y en la cual HAMMER asuma responsabilidad de la misma,\r\n                        Viajes de trabajo o vacacional en temporada (con factura de reserva).', '2024-01-29 20:41:15', '2024-01-29 20:41:15'),
(18, 'beneficios_congelado_anual', 'PLANES ANUALES:', 'Se podrá realizar dentro de toda la duración del mismo, con una extensión mínima de 14 días y\r\n                        máxima de 45 días y solicitados por los siguientes motivos. Enfermedades (solo con certificación\r\n                        medica), Lesiones ocurridas dentro de nuestras instalaciones (no serán incluidas lesiones\r\n                        ocurridas fuera del gimnasio y en la cual HAMMER asuma responsabilidad de la misma, Viajes de\r\n                        trabajo o vacacionales (con factura de reserva).', '2024-01-29 20:42:38', '2024-01-29 20:42:38'),
(19, 'beneficios_transferencia_planes', 'TRANSFERENCIA DE PLANES', 'Este beneficio es aplicable en caso de imposibilitarse la continuidad del plan por algún motivo o\r\n                disconformidad con el servicio (Garantía). Se podrá realizar la transferencia del contrato solo a nuevos\r\n                clientes, que no hayan asistido al gimnasio nunca, o que no estén asistiendo hace al menos 4 meses (120\r\n                días) o más.', '2024-01-29 20:50:47', '2024-01-29 20:50:47'),
(20, 'transferencia_mensual', 'mensual', 'En caso de planes mensuales se podrá realizar hasta 10 días de la fecha de pago del contrato.', '2024-01-29 20:56:18', '2024-02-08 15:35:57'),
(21, 'transferencia_semestral', 'semestral', 'En caso de planes semestrales se podrá realizar hasta 21 días de la fecha de pago del contrato.', '2024-01-29 20:56:51', '2024-02-08 15:36:22'),
(22, 'transferencia_anual', 'anual', 'En caso de planes Anuales se podrá realizar hasta 30 días de la fecha de pago del contrato.', '2024-01-29 20:57:42', '2024-02-08 15:36:37');
